INSERT INTO `exhibits` VALUES (1,1,0,'Болшой кувшин (хум)','Uly hum','Big jug (hum)','Керамический хум, найденный при раскопках памятника Улуг депе V-IV тыс. до н.э. Сосуд имеет гладкую поверхность, широкое тулово, сужающееся к низу.  Горловина округлой формы.','Ulugdepeden tapylan b.e. öňki V-IV müňýyllyklara degişli hum. Ýüzi tekiz. Ortaky bölegi giň göwrümli bolup, aşaky bölegi we agzy inçelýär. Agzy halka görnüşli.','The ceramic khoum (jug) found at excavation of Ulug depe of the V-IV \r\nmillennium BC. The vessel has a smooth surface, the wide trunk which is narrowed to a bottom. Mouth is of rounded shape',NULL,NULL,NULL,'public/exhibit-image/dXXsSmz7bJM950K5LGRYUJdjtVyoURFbMhujkneQ.jpg',0,1,'2024-02-27 16:56:00','2024-02-27 16:45:15'),(2,1,2,'Сосуд для воды','Suw gap','Vessel for water','Керамический сосуд V-IV тыс. до н.э., найденный при раскопках памятника Улуг депе. Имеет цилиндрическую форму, горловина с четырех сторон имеет выступы в виде ручек.','Ulugdepeden tapylan b.e. öňki V-IV müňýyllyklara degişli keramikadan ýasalan gap. Silindr görnüşli bolup, agzynyň dört tarapynda tutaja meňzeş çykgyt bar.','The ceramic vessel of the V-IV millennium BC found at excavation of Ulug depe. It has the cylindrical form, its mouth from four sides has ledges in the shape of handles',NULL,NULL,NULL,'public/exhibit-image/lnAET6SGsySTSluyYEdKn7a14Tc1cFP3qfnnBcvq.jpg',0,1,'2024-02-29 14:20:13','2024-02-27 16:49:12'),(3,1,2,'Петли ворот','Derweze petleleri','Hinge strap of gates','Пяточный камень V-IV тыс. до н.э. найденный при раскопках памятника  Улугдепе. Камень имеет круглую форму, со сквозным отверстием для вертикального крепления двери или ворот.','Ulugdepeden tapylan b.e. öňki V-IV müňýyllyklara degişli daşdan ýasalan gapy we derweze petleleri. Tegelek görnüşinde bolyp gapyň ýa-da derwezäniň açylyp ýapylmagy üçin dik agajyny otyrtmakda  oýulypdyr.','The calcaneal stone of the V-IV millennium BC found at excavation of Ulug depe. The stone has round shape, with a through opening for vertical fastening of a door or gate.',NULL,NULL,NULL,'public/exhibit-image/MIcKRkcwXMz0T2NQ2dIPWYyt90c3JckRBTlXO7qp.jpg',0,1,'2024-02-29 14:20:27','2024-02-27 16:54:50'),(4,1,1,'Расписные хумы','Daşy nagyşly humlar','Decorated hums','Керамические изделия V-IV тыс.до н.э. найденные при раскопках памятника Йылгынлыдепе. Сосуды украшались красным и черным орнаментом.','Ýylgynlydepeden tapylan b.e. öňki V-IV müňýyllyklara degişli  toýundan ýasalan keramika önümleri. Ýüzi gara we gyzyl reňkler bilen çekilen nagyşlar bilen bezelen.','The pottery of the V-IV millennium BC found at excavation of Ylgynlydepe. Vessels were decorated with a red and black ornament.',NULL,NULL,NULL,'public/exhibit-image/2TCcugsGUQ2OH3BLWpnVOGQ2Z2djsyrYAr4szhWZ.jpg',0,1,'2024-02-29 14:22:29','2024-02-27 17:07:28'),(5,1,1,'Ступа с пестом','Soky we daşy','Mortar with pestle','Каменные ступы относящиеся к  энеолит (V-IV тыс. до н.э.). С появлением земледелия использовались при дроблении зерна, после сбора урожая.','Eneolit eýýamyna (b.e. öňki V-IV müňýyllyklar) degişli soky daşlar. Ekerançylygyň ýüze çykmagy bilen ýetişdirilen dürli däne önümlerini owratmakda ulanylypdyr.','The stone mortars relating to the  eneolith (V-IV millennium BC). With the advent of agriculture they were used when crushing grain, after harvesting.',NULL,NULL,NULL,'public/exhibit-image/9GOJQ6EuTD0Vr3PYfuVCIKbhDgAF0Rsp0iBUI77o.jpg',0,1,'2024-02-29 14:22:54','2024-02-27 17:11:49'),(6,1,0,'Хум','Hum','Hum','Керамический сосуд V-IV тыс. до н.э. найденный при раскопках памятника Улуг депе.\r\nПоверхность гладкая, венчик сосуда слегка отогнут наружу. Основная часть широкая, горловина и основание заужены.','Ulugdepeden tapylan b.e. öňki V-IV müňýyllyklara degişli keramikadan ýasalan gap. Ýüzi tekiz. Erňegi çala daşyna aýlanan. Agzy we aşaky bölegi inçelip gidýär. Ortaky bölegi giň göwrümli.','The ceramic vessel of the V-IV millennium BC found at excavation of Ulug depe. Smooth surface, the nimbus of a vessel is slightly unbent outside. The main part is wide, the mouth and the basis are made narrower.',NULL,NULL,NULL,'public/exhibit-image/3dXwDsWeZR4uIgoQbzqi4ynqrv1dAx5nQKfdm3zJ.jpg',0,1,'2024-02-27 17:41:54','2024-02-27 17:25:18'),(7,1,0,'Хум','Hum','Hum','Керамический хум V-IV тыс. до н.э., найденный при археологических работах на Улуг депе. Поверхность сосуда гладкая, тулово широкое, горловина и основание кувшина узкие. Венчик имеет круглую форму.','Ulugdepeden tapylan b.e. öňki V-IV müňýyllyklara degişli hum. Ýüzi tekiz. Ortaky bölegi giň göwrümli bolup, aşaky bölegi we agzy inçelýär. Agzy halka görnüşli.','The ceramic khoum (jug) of the V-IV millennium BC found during the archaeological works on Ulug depe. Vessel surface is smooth, trunk is wide, mouth and basis of a jug are narrow. The nimbus has round shape.',NULL,NULL,NULL,'public/exhibit-image/4d5IYvU4qlH9hh22pEjGkggs8LgFy2I4zK1Wn1YF.jpg',0,1,'2024-02-27 17:40:34','2024-02-27 17:31:32'),(8,1,3,'Посуда','Gaplar','Tableware','Керамические изделия V-IV тыс. до н.э. найденные при раскопках памятника Улуг депе из светлой и черной глины.','Ulugdepeden tapylan b.e. öňki V-IV müňýyllyklara degişli keramikadan ýasalan dürli görnüşli ak we gara reňkli gaplar.','The pottery of the V-IV millennium BC found at excavation of Ulug depe made of light and black clay.',NULL,NULL,NULL,'public/exhibit-image/yjbb6rVkiVhRg8Vw1lYAFBFMNKJIAs4F7RQsJtGp.jpg',0,1,'2024-02-29 14:25:24','2024-02-27 17:44:28'),(9,1,3,'Посуда','Gaplar','Tableware','Светлоглиняные и красноглиняные керамические изделия III-II тыс из древнего Маргуша. Эти сосуды изготавливались с большим мастерством в специальных керамических печах.','Marguşdan tapylan  b.e. öňki III-II müňýyllyklara degişli keramikadan ýasalan dürli görnüşli ak we gyzyl reňkli gaplar. Bu gaplar ýörite ýasalan kürelerde bişirilip usullar bilen taýýarlapdyrlar.','Light clay and red clay pottery of III-II millennium BC from ancient Margush. These vessels were made with big skill in special ceramic furnaces.',NULL,NULL,NULL,'public/exhibit-image/PnkQWK8imNZXjpZIQ7hYl9NxAimwLPbW2uIRS1IO.jpg',0,1,'2024-02-29 14:25:41','2024-02-27 17:47:14'),(10,1,1,'Зернотерка','Owguç daş','Hulling mil','Каменные зернотерки, относящиеся к энеолиту. Это так же были основными орудиями труда при обрабатывании различных видов зерна.','Eneolit eýýamyna degişli daşdan ýasalan owguçlar. Dürli däne önümlerini owratmakda şol döwre mahsus, ýene bir usul hasaplanypdyr.','The stone greaters of Eneolit period. They were also the main instruments of labor for treatment of different types of grain.',NULL,NULL,NULL,'public/exhibit-image/PokLRSylV9hPUxgCd0jAxLI1qJEMSyIS8RRwfMZk.jpg',0,1,'2024-02-29 14:23:17','2024-02-27 17:48:42'),(11,1,4,'Кувшины','Küýze gaplar','Jugs','Керамическая посуда V-IV тыс. до н.э., различных форм, найденная на Улуг депе. Поверхность изделий гладкая. Сосуды использовались в различных хозяйственных целях.','Ulugdepeden tapylan b.e. öňki V-IV müňýyllyklara degişli keramikadan ýasalan  dürli görnüşli  gaplar. Ýüzi tekiz. Hojalykda dürli maksatlar üçin ulanypdyrlar.','The ceramic ware of the V-IV millennium BC of various forms found in Ulug depe. Surface of products is smooth. Vessels were used in various economic purposes.',NULL,NULL,NULL,'public/exhibit-image/sk6UONsnEbWyBryOG1rEHcCVXSQItvoVkOr2espg.jpg',0,1,'2024-02-29 14:26:56','2024-02-27 17:50:37'),(12,1,4,'Каменные изделия','Daş önümi','Stone products','Каменные изделия (гири) V-IV тыс. до н.э. найденные на Улуг депе. Возможно, применялись в ирригации или в других хозяйственных целях.','Ulugdepeden tapylan b.e. öňki V-IV müňýyllyklara degişli daşlar. Suwaryş ulgamynda we hojalykda dürli maksatlar üçin ulanylypdyr.','Stone products (weights) of the V-IV millennium BC found in Ulug depe. Perhaps, were applied in irrigation or other economic purposes.',NULL,NULL,NULL,'public/exhibit-image/Mqc1npNgtGkAzAOZnI1E06WHQgg3oXbSU0RnPtFz.jpg',0,1,'2024-02-29 14:27:10','2024-02-27 17:51:38'),(13,1,0,'Кувшин','Küýze','Jug','Керамические изделия средних веков. Посуда из серой глины, поверхность и венчик орнаментированы. Нижняя часть сосуда заужена и расширяется к верху.','Orta asyrlara degişli toýundan ýasalan keramika önümi. Çal reňkli, ýüzi we erňegi nagyşlanan. Aşaky bölegi inçeräk bolup ýokarlygyna giňäp gidýär.','Pottery of the Middle Ages. The ware is from gray clay, the surface and a nimbus are ornamented. The lower part of a vessel is made narrower and extends to top',NULL,NULL,NULL,'public/exhibit-image/1WY7z1Etk4EvPBVuOj1oocy9BOjmUgk8AJENjQnt.jpg',0,1,'2024-02-27 17:53:05','2024-02-27 17:53:05'),(14,1,0,'Различная посуда','Dürli görnüşli gaplar','Various tableware','Различные керамические сосуды средних веков. Мастера изготавливали их различными методами. Поверхность посуды украшена гравированным и лепным орнаментом.','Orta asyrlara degişli toýundan ýasalan küýzeler we keramika gaplar. Ussalar olary dürli görnüşlerde ýasapdyrlar. Ýüzüne ýelmeme we çyzma ususlynda dürli nagyşlar bilen bezäpdirler.','Various ceramic vessels of the Middle Ages. Masters made them by various methods. The surface of ware is decorated with the engraved and modelled ornament.',NULL,NULL,NULL,'public/exhibit-image/N6Dk6hzeJmoqBPrQ41ERTIQtiB2bGjR8TkTICtdp.jpg',0,1,'2024-02-27 17:54:38','2024-02-27 17:54:38'),(15,1,0,'Хум','Hum','Hum','Керамические изделия II-III вв. до н.э. Светло-серого цвета, без орнамента. Тулово широкое, горловина и основание узкие.','B. e. öňki II-III asyrlara degişli toýundan ýasalan keramika önümi. Çal reňkli, ýüzi tekiz. Ortaky bölegi giň göwrümli bolup, aşaky bölegi we agzy inçelýär.','Pottery of the II-III centuries BC. Light gray color, without ornament. Wide trunk, mouth and basis are narrow.',NULL,NULL,NULL,'public/exhibit-image/Dp4s4jps5JI1ma5uM8SrJ6PazNCN2duWevVc8rO8.jpg',0,1,'2024-02-27 17:55:51','2024-02-27 17:55:51'),(16,1,0,'Хум','Hum','Hum','Керамические изделия средних веков. Посуда из серой глины, поверхность и венчик орнаментированы. Нижняя часть сосуда заужена и расширяется к верху.','Orta asyrlara degişli toýundan ýasalan keramika önümi. Çal reňkli, ýüzi we erňegi nagyşlanan. Aşaky bölegi inçeräk bolup ýokarlygyna giňäp gidýär.','Pottery of the Middle Ages. The ware is from gray clay, the surface and a nimbus are ornamented. The lower part of a vessel is made narrower and extends to top.',NULL,NULL,NULL,'public/exhibit-image/fim0KSc5PRuntxQCMYe8KJ1QQ1STiS6pazbkygwx.jpg',0,1,'2024-02-27 17:57:07','2024-02-27 17:57:07'),(17,1,0,'Хум','Hum','Hum','Керамические изделия средних веков. Посуда из серой глины, поверхность украшена простым узором. Средняя часть сосуда расширена, нижняя часть и горловина заужены.','Orta asyrlara degişli toýundan ýasalan hum. Çal reňkli, ýüzünde tegelek basma usulynda nagyş bar. Aşaky bölegi inçeräk bolup, ýokarlygyna giňäp gidýär.','Pottery of the Middle Ages. The ware is from gray clay, the surface is ornamented with simple ornament. The middle part of a vessel is wide, the lower part and trunk are narrow.',NULL,NULL,NULL,'public/exhibit-image/jojBkooMAg4usg0uIy15OFEF6bAf41Timu2FMetK.jpg',0,1,'2024-02-27 17:58:00','2024-02-27 17:58:00'),(18,1,0,'Хум','Hum','Hum','Керамический сосуд XI-XIII вв. Изготовлен из серой глины и украшен круглым налепленным и процарапанным орнаментом. Горловина сосуда округлой формы. Тулово широкое, основание и венчик заужены.','XI-XIII asyrlara degişli toýundan ýasalan hum. Çal reňkli, ýüzünde tegelek ýelmeme we çyzma usulynda nagyş bar. Agzy halka görnüşli. Ortaky bölegi giň göwrümli bolup, aşaky bölegi we agzy inçelýär.','Ceramic vessel of XI-XIII centuries. It is made of gray clay and decorated with the round stuck and scratched ornament. The mouth of a vessel is of rounded shape. The trunk is wide, the basis and a nimbus are made narrower.',NULL,NULL,NULL,'public/exhibit-image/RCFWks0bIZbBOsyeherh8PXU28C4JQSIom9tG8lb.jpg',0,1,'2024-03-22 15:12:26','2024-02-27 17:59:33'),(19,1,0,'Водопроводная труба','Suw geçiriji turba','Water pipe','Средневековая водопроводная керамическая труба для водоснабжения населённых пунктов.','Orta asyrlara degişli toýundan ýasalan şäheriň suw-lagym ulgamy üçin geçiriji.','Medieval water ceramic pipe for water supplying of the settlements.',NULL,NULL,NULL,'public/exhibit-image/vPAxa5jUGMtDoJCqwKGWNptqfxiiDqeenPHG96pc.jpg',0,1,'2024-02-27 18:01:41','2024-02-27 18:01:41'),(20,1,0,'Хум','Hum','Hum','Керамический хум XV-XVII вв. Сероглиняный, поверхность гладкая. Нижняя часть узкая и расширяется к верху.','XV-XVII asyrlara degişli toýundan ýasalan hum. Çal reňkli, ýüzi tekiz. Aşaky bölegi inçeräk bolup, ýokarlygyna giňäp gidýär.','Ceramic khoum (jug) of XV-XVII centuries. Gray clayed, the surface is smooth. The lower part is narrow and extends to the top.',NULL,NULL,NULL,'public/exhibit-image/J8xAE5kCHUC3TKM5R9WVOMR2yitkDVllBKEm7HrI.jpg',0,1,'2024-02-28 13:37:52','2024-02-28 13:37:52'),(21,1,61,'Посуда','Gaplar','Tableware','Средневековые керамические сосуды, изготовленные различными методами и украшенные глазурью и орнаментом.','Orta asyrlara degişli toýundan keramika gaplar. Olary dürli görnüşlerde ýasapdyrlar. Ýüzi dürli nagyşlar we syrçalar bilen bezelipdir.','The medieval ceramic vessels made by various methods and decorated with glaze and ornament.',NULL,NULL,NULL,'public/exhibit-image/AWrgFoqprRZE4kvbo70y0pLD8LgGT7fBRGykS6AG.jpg',0,1,'2024-03-22 15:20:49','2024-02-28 13:39:08'),(22,1,0,'Различная посуда','Dürli görnüşli gaplar','Various tableware','Различные керамические изделия найденные в Маргуше, III-II тыс. до н.э.','Marguşdan tapylan dürli görnüşli toýundan ýasalan keramika gaplar, b.e öňki III-II müňýyllyk.','Various pottery found in Margush, III-II millennia B.C.',NULL,NULL,NULL,'public/exhibit-image/4AgXSprNPfBfyjZvKs7sNYfzbtbUqyw3hltoofEk.jpg',0,1,'2024-03-22 15:41:25','2024-02-28 13:43:07'),(23,1,0,'Различная посуда','Dürli görnüşli gaplar','Various tableware','Керамические изделия разнообразных форм и различных цветов с  орнаментами и без орнамента V-IV тыс. до н.э.','B. e. öňki V-IV müňýyllyklara degişli dürli görnüşli, dürli reňkdäki, nagyşly we tekiz keramika önümleri.','Pottery of various forms and various colours with ornaments and without ornament of the V-IV millennium BC.',NULL,NULL,NULL,'public/exhibit-image/v7Mw43iwrIY6CcqJvfk5LS29ctl2sUgobssl98IZ.jpg',0,1,'2024-03-22 15:39:06','2024-02-28 13:44:14'),(24,1,6,'Светильник','Çyradan','Lamp','Различные виды керамических и бронзовых светильников X-XII вв. Они украшены глазурью и разнообразным орнаментом.','X-XII asyrlara degişli bürünçden hem-de toýundan ýasalan çyradanlar. Olar dürli görnüşlerde ýasalypdyr. Ýüzi dürli reňkli syrçalar, nagyşlar we ýazgylar bilen bezelen.','Different types of ceramic and bronze lamps of X-XII centuries. They are decorated with glaze and various ornament.',NULL,NULL,NULL,'public/exhibit-image/5N1ymRwwebjz8EVcDAkXSOqhoNn4mcbZsIv7W8xq.jpg',0,1,'2024-03-22 15:31:01','2024-02-28 13:45:15'),(25,1,8,'Остатки белой пшеницы','Ak bugdaýyň galyndysy','Remains of white wheat','Зерна Белой пшеницы найденные при раскопках памятника Анау, относящиеся к III тыс до н.э. Они были найдены 1904 году во время раскопок на северном холме Анау американской экспедицией Рафаэля Помпелли.','Änewiň taryhy depelerinden  tapylan  b.e. öňki III müňýyllyga degişli ak bugdaýyň däneleri. Olary 1904-nji ýylda amerikan ekspedisiýasyna ýolbaşçylyk eden professor Rafael Pampelli Änewiň demirgazyk depesinde gazuw-agtaryş işlerini geçiren wagtynda ýüze çykarypdyr.','The seeds of White wheat found at excavation of Anau archaeological object, relating to III millennium BC. They were found in 1904 during excavation on the northern hill of Anau by the American expedition of Raphael Pampelli.',NULL,NULL,NULL,'public/exhibit-image/PmMylOMpVnAdrg4Ve2CkFpMeRFxwZR2SNtF1Efxb.jpg',0,1,'2024-02-29 14:46:24','2024-02-28 13:57:31'),(26,1,8,'Зёрна пшеницы и винограда','Bugdaý we üzümiň däneleri','Grains of wheat and grape','Найденные на Улуг депе, косточки винограда и зерна пшеницы, относящиеся к II тыс. до н.э.','Ulugdepeden tapylan  b.e. öňki II müňýyllyklara degişli üzüm we bugdaý däneleri.','Grape seeds and the seeds of wheat relating to II millennium BC found at Ulug depe.',NULL,NULL,NULL,'public/exhibit-image/z3r6252MzgGqO6lfn9NCIAU7ZRGSnto6tyTD4UsU.jpg',0,1,'2024-03-14 16:33:14','2024-02-28 13:59:19'),(27,1,8,'Остатки пшеницы','Bugdaýyň galyndysy','Remains of wheat','Зерна пшеницы найденные при раскопках древнего Маргуша. Этот памятник \r\nВ.И.Сарианиди открыл 1972 году и начал раскопки, которые проводил много лет.','Marguşdan tapylan  b.e. öňki II müňýyllyklara degişli bugdaý däneleri. W. I. Sarianidi 1972-nji ýylda açyp, birnäçe ýyllap gazuw-agtaryş işlerini yzygiderli geçirdi.','Wheat seeds found at ancient Margush\'s excavation. This archaeological site was opened in 1972 by archaeologist V.I. Sarianidi who carried out excavations there which spent many years.',NULL,NULL,NULL,'public/exhibit-image/QrV9uMmLQZj6PmZKfrBpAbqGISycHQzm7za7U1Y5.jpg',0,1,'2024-03-14 16:36:02','2024-02-28 14:01:44'),(28,1,8,'Остатки пшеницы','Bugdaýyň galyndysy','Remains of wheat','Зерна пшеницы из памятника Дехистан X-XII. Древний Дахыстан или Дехистан, расположен на севере от реки Етрек на плодородной равнине. До монгольского нашествия, это был цветущий оазис с развитым земледелием, оросительной системой и бурной городской жизнью.','Dehistandan tapylan  X-XII asyrlara degişli  bugdaý däneleri. Gadymy Dahystan ýa-da Dehistan, ol Etrek derýasynyň demirgazyk tarapynda ýerleşen mes toprakly sähralykdyr. Mongol basybalyşlaryna çenli ol ýerde çylşyrymly suwardyş desgalary bolup, ekerançylyk giň gerim alypdyr we şäher durmuşy möwç urupdyr.','Wheat seeds from Dekhistan of X-XII centuries AD. Ancient Dakhystan  (Dekhistan), is located to the north from Etrek River on the fertile plain. Before the Mongolian invasion it was blossoming oaziz with the developed agriculture, an irrigating system \r\nand stormy city life.',NULL,NULL,NULL,'public/exhibit-image/dYXyPhSZHb2HWmyAXX7kBLSoPZ3RhvwqadTt8mEH.jpg',0,1,'2024-02-29 14:47:50','2024-02-28 14:30:04'),(29,1,9,'Посуда','Gaplar','Taleware','Керамическая чаша V-IV тыс. до н.э. из Йылгынлы депе. Этот памятник расположен недалеко от селения Мяне этрапа Алтын Асыр Ахалского велаята.','Ýylgynlydepeden tapylan b.e. öňki V-IV müňýyllyklara degişli  toýundan ýasalan keramika önümleri. Ol Ahal welaýatynyň Altyn asyr etrabynyň Mäne obasynyň golaýynda ýerleşýär.','Ceramic bowl of the V-IV millennium BC from Yylgynly depe. It was located near the settlement of Myane of Altyn Asyr region of Ahal Province.',NULL,NULL,NULL,'public/exhibit-image/w99u3PYa13h5zRjtNp1bCgZejU0tM3esN2Fe7tAx.jpg',0,1,'2024-02-29 14:49:32','2024-02-28 14:31:51'),(30,1,9,'Посуда с узорами','Daşy nagyşly gaplar','Tableware with ornaments','Керамическои изделия найденные при раскопках памятника Монджукли депе V- IV тыс. до н.э. Этот памятник находится в 3 км к юго-востоку от селения Мяне, этрапа Алтын Асыр, Ахалского велаята.','Monjuklydepeden tapylan b.e. öňki V-IV müňýyllyklara degişli  toýundan ýasalan keramika önümleri. Ol Ahal welaýatynyň Altyn asyr etrabynyň Mäne obasyndan 3 km günorta-gündogarda ýerleşýär.','The pottery found at excavation of Mondzhukly dep of V-IV millennium BC. This monument is in 3 km to the southeast from the settlement of Myane of Altyn Asyr region of Ahal Province.',NULL,NULL,NULL,'public/exhibit-image/EEf4YVOMlvTaFTFhcoGEz7wlIUajj81OsxnEHbCO.jpg',0,1,'2024-02-29 14:49:51','2024-02-28 14:32:58'),(31,1,9,'Керамические изделия','Keramika önümleri','Keramika önümleri','Керамические изделия найденные при раскопках памятника Намазгадепе V-III тыс. до н.э. Этот памятник  площадью 70 гектар, находится в 7 км. к западу от центра этрапа Кака.','Namazgadepeden tapylan b.e. öňki V-III müňýyllyklara degişli toýundan ýasalan keramika önümleri. Ol Ahal welaýatynyň Kaka etrap merkezinden 7 km günbatarynda ýerleşip, 70 gektar meýdany tutýar.','The pottery found at excavation of Namazga depe of V-III millennium BC. This archaeological object of 70 hectares, is in 7 km. to the west from the center of Kaka region.',NULL,NULL,NULL,'public/exhibit-image/pg3WDWTZ4yM4yD2KpvfR86h2si8eX0mIzJGbVv59.jpg',0,1,'2024-02-29 14:50:55','2024-02-28 14:34:18'),(32,1,10,'Каменная зернотерка с пестом','Owguç daşy bilen daş','Stone hulling mil with pestle','Неолит период первой земледельческой культуры. Люди начали заниматься земледелием и изготавливать каменные орудия труда для размалывания зерна. VII-V тыс. до н.э.','Neolit eýýamy ekerançylygyň ilkinji ýüze çykan döwri hasaplanýar. Şol döwürde ýaşan adamlar ekerançylyk bilen meşgullanypdyrlar we daşdan hojalykda ulanmak üçin däne owguçlaryny ýasapdyrlar. B.e. öňki VII-V müňýyllyklara degişli.','Neolithic period of the first agricultural culture. People began to be engaged in agriculture and to make stone instruments of labor for grain grinding. The VII-V millennium BC.',NULL,NULL,NULL,'public/exhibit-image/U2et3GDSCtetmGXjkcLF8eOLVG6alksTaLK9V8Il.jpg',0,1,'2024-02-29 14:52:19','2024-02-28 14:39:09'),(33,1,10,'Кремневые орудия труда','Çakmak daşdan zähmet gurallar','Flint labour tools','Орудия труда древнего человека каменного века (мезолит), изготовленные путем отбивки и шлифовки кремня. XI-VII тыс. до н.э.','Daş asyrynda (mezolit) ýaşan adamlaryň çakmak daşdan döwmek we ýylmamak usulynda ýasap ulanan zähmet gurallary. B.e. öňki XI-VII müňýyllyklar bilen senelenýär.','The instruments of labor of the ancient person of the Stone Age (Mesolith) made by beating and grinding of flint. The XI-VII millennium BC.',NULL,NULL,NULL,'public/exhibit-image/WtFDtYBI1EVe6TXkgS4EuXUukz11WGnxDsL2OBN0.jpg',0,1,'2024-02-29 14:54:31','2024-02-28 14:41:42'),(34,1,10,'Фрагменты глиняной посуды','Gabyň bölekleri','Pieces of clay tableware','Фрагмент толстостенного керамического сосуда из Джейтуна. Украшен характерной для неолита простой росписью. VII-V тыс. до н.э.','Jeýtundan tapylan toýundan ýasalan galyň keramika bölegi. Ýüzi neolit eýýamyna mahsus, ýönekeý çyzyk görnüşindäki nagyşlar bilen bezelen. B.e. öňki VII-V müňýyllyklara degişli.','Fragment of a thick-walled ceramic vessel from Jeytun. Decorated with painting, characteristic for Neolith. The VII-V millennium BC.',NULL,NULL,NULL,'public/exhibit-image/d5TMlGBitsGKQqHbBBKh3z7MfLhXlXHzmayN9OoJ.jpg',0,1,'2024-02-29 14:54:58','2024-02-28 14:43:40'),(35,1,11,'Напрясло','Ikbaşlar','Ring of spindle','Различные пряслицы IV-III тыс. до н.э.,используемые женщинами при ткачестве. Это подтверждает появление ткачества в то время. Пряслицы имеют полукруглую форму, концы которой сужаются.','B.e. öňki IV-III müňýyllyklara degişli zenanlaryň ulanan dürli görnüşli ikbaşlary. Bu bolsa dokmaçylygyň ýüze çykandygyny görkezýär. Ikbaşlar esasan ujy çürelip gidýän ýarym togalak görnüşli bolupdyr.','Various details of tool relating to the IV-III millennium BC, used by women when weaving. It confirms emergence of weaving at that time. The mentioned tool has the semicircular form the end of which are narrowed.',NULL,NULL,NULL,'public/exhibit-image/kHjeW1soH5hIxwdKOS0MMvO1bUSLJKocGgDqirGz.jpg',0,1,'2024-03-25 14:36:12','2024-02-28 14:46:06'),(36,1,11,'Каменные изделия','Daş önümleri','Stone articles','Каменные амулеты бронзового века из Алтын депе. Эти изделия имели квадратную, круглую и прямоугольную форму, их нанизывали на нить и носили на шее. III-II тыс. до н.э.','Bürünç asyryna degişli Altyndepeden tapylan tumar daşlary. Daşdan tumarlar tegelek, gönüburçly ýa-da inedördül şekilde bolup, sapaga düzüp boýunlaryndan asypdyrlar. B.e öňki III-II müňýyllyk.','Stone amulets of a Bronze age from Altyn depe. These products had the square, round and rectangular form and they were strung on thread and carried on a neck. III-II millennia B.C.',NULL,NULL,NULL,'public/exhibit-image/muMz1UDwFw6GzZKQtHaa6XnDu4LPtcx2yX4lpVLo.jpg',0,1,'2024-03-25 14:35:18','2024-02-28 14:46:56'),(37,1,11,'Лошадиный зуб и голень','Atyň diş we injik süňkleri','Horse tooth and shank','Зуб и голень лошади, относящиеся к энеолиту найденные при археологических раскопках на Анау. Кони участвовали в различных церемониях и были дрессированы. III-II тыс. до н.э.','Änewiň taryhy depelerinden tapylan eneolit döwrüne degişli atyň dişi we injik süňki. Atlar dabaralaryň bezegi bolupdyr. Olara baş öwredipdirler. B.e öňki III-II müňýyllyk.','The tooth and a shin of a horse relating to an Eneolith found at archeological\r\nexcavations to Anau. Horses participated in various ceremonies and were trained. III-II millennia B.C',NULL,NULL,NULL,'public/exhibit-image/aLykjOoZBX7LwjUXuwJoHuIHT1sWQ9cmoiEvZlYy.jpg',0,1,'2024-03-25 14:34:20','2024-02-28 14:48:02'),(38,1,0,'Книга','Kitap','Book','2-ух томная книга изданная в городе Вашингтон (США) в 1908-ом году Американского учёного Рафаэля Помпелли “Древнее развитие Анау\". Зарождение, развитие окружающей среды” подаренная музею со стороны Президентского Совета.','Türkmenistanyň Prezidentiniň Diwany tarapyndan muzeýe sowgat berlen Amerikan alymy R.Pampelliniň 1908-nji ýylda ABŞ-nyň Waşington şäherinde neşir edilen iki jiltden ybarat “Änewiň gadymy ösüşi. Gelip çykyşy, ösüşi we daş töwereginiň täsiri” atly kitaby.','Publisished in Washington (USA) in 1908, the 2-volume book of the Americans scientist Rafael Pompelli “Ancient development of Anau\". Origin, development and influence on the environment” donated to the Museum by the Presidential Couneil.',NULL,NULL,NULL,'public/exhibit-image/Cry23h2ueHsdltRmAUAlZ3VDqpfoiw6wuhKNzNJw.jpg',0,1,'2024-02-28 14:50:25','2024-02-28 14:50:25'),(39,1,0,'Различная посуда и фрагменты','Dürli görnüşli gaplar we bölekleri','Various tableware and pieces','Расписная керамика и фрагменты сосудов V-III тыс до н.э., найденные при раскопках Намазга депе. Керамическую посуду в основном украшали богатым геометрическим орнаментом и использовали нескольких цветов.','Namazgadepeden tapylan b.e. öňki V-III müňýyllyklara degişli  toýundan ýasalyp bişirilen dürli reňkli keramika önümleri we nagyşlanan küýze bölekleri. Nagyşlar çylşyrymlaşyp, olar köp reňkde çekilipdir. Küýze nagyşlarynda geometrik şekiller agdyklyk edýär.','Painted ceramics and fragments of vessels of V-III millennium BC found at excavation to Namazga depe. Ceramic ware of several colours was generally decorated with a rich geometrical ornament.',NULL,NULL,NULL,'public/exhibit-image/0GoZleQGCgEC6uCmYaeIFrKTwyqt543mbZYvdXuq.jpg',0,1,'2024-03-15 18:51:03','2024-02-28 14:52:26'),(40,1,0,'Посуда','Gaplar','Tableware','Различные виды керамических изделий, найденные в Маргуше.','Marguşdan tapylan dürli görnüşli toýundan ýasalan keramika önümler. Küýzegärleriň esasy ünsi gap-gaçlaryň daşky görnüşlerini üýtgetmek bolman, eýsem, olaryň täze görnüşlerini oýlap tapmaga hem gönükdirilipdir.','The different types of pottery found in Margush.',NULL,NULL,NULL,'public/exhibit-image/SzyNFiwPmYUF4mf9zJ2b4UiR1UwlDyWlbVOc57z5.jpg',0,1,'2024-03-22 15:34:46','2024-02-28 14:53:40'),(41,1,12,'Женские фигурки. Алтындепе','Zenan heýkeljikleri. Altyndepe','Woman’ s figurines. Altyndepe','Глиняная женская статуэтка найденная при археологических работах в Алтындепе. III тыс. до н.э.','Altyndepeden tapylan toýundan ýasalan zenan heýkeljikleri. B.e öňki III müňýyllyk','The clay female figurine found during the archaeological works in Altyndepe. III millennium B.C.',NULL,NULL,NULL,'public/exhibit-image/ZVg6Mny3dkcUXPuNJKmhujwQptFIWJWQxNyT6xkw.jpg',0,1,'2024-03-15 18:46:49','2024-02-28 14:55:51'),(42,1,12,'Заколка','Sançgyçlar','Hairping','Булавки для украшения волос женщин. Их изготавливали из кости и бронзы. Один конец булавки иногда украшался каким либо изображением. III-II тыс. до н.э','Marguşdan tapylan zenanlarynyň saçlaryna dakmak üçin niýetlenen sançgyçlar. Olar süňkden we bürünçden ýasalypdyr. Sançgyçlaryň käbirleriniň bir tarapy dürli görnüşli şekiller bilen bezelipdir. B.e öň III-II müňỳyllyk.','Pins for decoration of women’s hair. They were made of a bone and bronze. One end of a pin was sometimes decorated with some image. III-II millennia B.C',NULL,NULL,NULL,'public/exhibit-image/CkzeyGhFaeAtyQaGVzzKZKsDFAbcloh0yY0XB8tk.jpg',0,1,'2024-03-25 14:17:34','2024-02-28 14:57:08'),(43,1,12,'Коробочка для сурьмы','Sürme çalynýan gap','Boх for hair dye','Косметический флакон для сурьмы из Маргуша. III-II тыс. до н.э','Marguşdan tapylan bürünçden ýasalan sürme gaplar. B.e öňki III-II müňỳyllyk.','Cosmetic bottle for antimony from Margush. III-II millenia B.C',NULL,NULL,NULL,'public/exhibit-image/Jon8arHRFY0Eu7rnQOMoUJV0z4qPkg0tAAjMDjFB.jpg',0,1,'2024-03-25 14:20:56','2024-02-28 14:58:42'),(44,1,12,'Печати','Möhürler','Seals','Глиняные и бронзовые печати, украшенные различными орнаментами. III-II тыс. до н.э','Marguşdan tapylan dürli görnüşli şekiller çekilen toýundan we bürünçden ýasalan möhürler. B.e öň III-II müňỳyllyk.','The clay and bronze seals decorated with various ornaments. III-II millennia B.C',NULL,NULL,NULL,'public/exhibit-image/gr3DL0FJNqjbqWSgnHr5UAYfzEM6S6rzMz2mSVZC.jpg',0,1,'2024-03-25 14:17:51','2024-02-28 15:01:08'),(45,1,0,'Глиняная посуда','Toýun gaplar','Clay tableware','Керамические изделия III-I вв. до н.э. Светло-серого цвета, без орнамента. Тулово широкое, горловина и основание узкие.','B. e. öňki III-I asyrlara degişli toýundan ýasalan keramika önümi. Çal reňkli, ýüzi tekiz. Ortaky bölegi giň göwrümli bolup, aşaky bölegi we agzy inçelýär.','Pottery of the III-I centuries BC. Light gray color, without ornament. Wide trunk, mouth and basis are narrow.',NULL,NULL,NULL,'public/exhibit-image/t3MO7tcFZqsyYYJGT6th5FQTO4uvK3G2lQrsEhrG.jpg',0,1,'2024-03-22 15:27:01','2024-02-28 15:03:48'),(46,1,13,'Глиняные бусы','Toýun monjuklar','Clay beads','Бусы, украшения, относящиеся к раннему средневековью (III-VI вв.)','Irki orta asyrlar (III-VI) döwrüne degişli monjuklar. Şol döwre degişli bezeg şaý-sepleri bolupdyr.','The beads, jewelry relating to the early Middle Ages (III-VI centuries AD).',NULL,NULL,NULL,'public/exhibit-image/2PEhpDiRjtXVWVHQny3voabHqVDX3iuNxYeLXv4a.jpg',0,1,'2024-03-15 18:42:44','2024-02-28 15:06:37'),(47,1,13,'Различные статуэтки','Dürli şekilli heýkeljikler','Various figurines','Глиняные статуэтки людей, относящиеся к раннему средневековью (III-VI вв.)','Irki orta asyrlar (III-VI) döwrüne degişli adam şekilli heýkeljikler.','The clay figurines of people relating to the early Middle Ages (III-VI centuries AD).',NULL,NULL,NULL,'public/exhibit-image/1sUaLqyw7khuAl35cCSbL9I0Q0RqxRcxQ4vdDiai.jpg',0,1,'2024-03-15 18:39:10','2024-02-28 15:08:09'),(48,1,13,'Детские игрушки','Haýwan şekilli çaga oýnawaçlary','Children toys','Глиняные статуэтки животных, относящиеся к раннему средневековью (III-VI вв.)','Irki orta asyrlar (III-VI) döwrüne degişli haýwan şekilli heýkeljikler.','The clay figurines of animals relating to the early Middle Ages (III-VI centuries AD).',NULL,NULL,NULL,'public/exhibit-image/pFBOL7forDOx2WnEqoqC8FLvWcr0LRw1JiGfWQIH.jpg',0,1,'2024-03-15 19:16:11','2024-02-28 15:09:15'),(49,1,14,'Фрагменты орнамента','Bezeg bölegi','Pieces of ornament','Декоративный фрагмент III-II вв. до н.э. от неизвестного предмета из бронзы.','B. e. öňki III-II asyrlara degişli bezeg bölegi. Durmuşda ulanylan bürünçden ýasalan näbelli bir esbabyň bölegi.','Decorative fragment of the III-II centuries BC from unknown subject made of bronze.',NULL,NULL,NULL,'public/exhibit-image/j5Qe0Oit0g5eI4pQTbtovD3z7nzm2ZjcZjykiSkL.jpg',0,1,'2024-03-15 19:01:05','2024-02-28 15:10:40'),(50,1,14,'Античные монеты','Antika döwrüniň teňňeleri','Antique coins','Монеты, относящиеся к III-II вв. до н.э. Такие деньги использовали в быту люди античного времени.','B. e. öňki III-II asyrlara degişli teňňeler. Antiki döwürde adamlaryň durmuşda ulanan bürünç pullary.','The coins relating to the III-II centuries BC. Such money was used in life by people of antique time.',NULL,NULL,NULL,'public/exhibit-image/X2tVFQeISjlxMujFnVUXKIAr5NBLagNntnoMgjcl.jpg',0,1,'2024-02-29 15:09:18','2024-02-28 15:11:38'),(51,1,14,'Архитектурные фрагменты','Binanyň bezeg bölekler','Architectural pieces','Декоративные фрагменты архитектуры III-II вв. до н.э., которые использовали при украшении зданий в античное время.','B. e. öňki III-II asyrlara degişli bina bölekleri. Antiki döwrüniň binagärlik sungatynda ulanylan bezegler.','Decorative fragments of architecture of the III-II centuries BC which used at decoration of buildings in antique time.',NULL,NULL,NULL,'public/exhibit-image/M0CF3dkmeh7NXyMho9QD9pt7nglHSpeMgulb2AKd.jpg',0,1,'2024-03-15 19:00:14','2024-02-28 15:12:48'),(52,1,60,'Глиняный светильник','Toýundan çyra','Clay lamp','Глиняные светильники X-XII, различных форм, украшенные орнаментом и цветной глазурью.','X-XII asyrlara degişli toýundan ýasalan çyradanlar. Olar dürli görnüşlerde ýasalypdyr. Ýüzi dürli reňkli syrçalar bilen bezelipdir.','The clay lamps of X-XII centuries of various forms decorated with an ornament and color glaze.',NULL,NULL,NULL,'public/exhibit-image/QXsJyB94biKigGoGp7ZZ9KkZOoZ8A3l5caVl89cz.jpg',0,1,'2024-03-15 19:02:46','2024-02-28 15:14:57'),(53,1,15,'Различная посуда','Dürli görnüşli gaplar','Various tableware','Керамические изделия X-XII вв., украшенные орнаментом и глазурью. Горловина слегка отогнута наружу, ручка плоская.','X-XII asyrlara degişli toýundan ýasalan keramika gaplar. Dürli görnüşli nagyşlar we syrça bilen bezelen. Erňegi daşyna aýlawly, tutawaçly sünnäläp ýasapdyrlar.','The pottery of the X-XII centuries decorated with an ornament and glaze. The mouth is slightly unbent outside, the handle is flat.',NULL,NULL,NULL,'public/exhibit-image/WDSgnVXL6eqmgX1sjdB9mCeN1UpMu7STOigomLov.jpg',0,0,'2024-03-15 18:56:28','2024-02-28 15:17:15'),(54,1,15,'Различная посуда и фрагменты','Dürli görnüşli gaplar we bölekleri','Various tableware and fragments','Керамические фрагменты сосудов X-XII вв. с характерными орнаментами того времени.','X-XII asyrlara degişli toýundan ýasalan keramika gaplaryň bölekleri. Şol döwre mahsus, nagyşlar bilen bezelen.','Ceramic fragments of vessels of the X-XII centuries, with characteristic ornaments of that time.',NULL,NULL,NULL,'public/exhibit-image/h3Yvm1scGj8QahHHbjv02VvtMcKfabDYj5r8GSua.jpg',0,1,'2024-03-15 18:55:14','2024-02-28 15:18:02'),(55,1,15,'Стеклянные изделия','Aýna önümleri','Glass products','Стеклянные изделия X-XII вв. с орнаментом для разнообразных целей.','X-XII asyrlara degişli aýnadan ýasalan dürli görnüşli çüýşe gutular. Dürli maksatlar üçin niýetlenen çüýşe gaplar nagyşlar bilen bezelipdir.','Glass products with ornament of X-XII centuries for the various purposes.',NULL,NULL,NULL,'public/exhibit-image/bcz8uUhshUEhWePTcuR3TfZdGuu9jO7ugTMn7XD1.jpg',0,1,'2024-03-13 15:21:45','2024-02-28 15:24:57'),(56,1,0,'Сосуды с ручкой','Saply  küýzeler','The vessels with handle','Керамические изделия различных цветов X-XII вв. Сосуды с ручкой, горловиной, украшенные орнаментом.','X-XII asyrlara degişli toýundan ýasalan dürli reňkli küýzeler. Bokurdakly, saply, nagyşly we tekiz görnüşli ýasalypdyr.','Pottery of various colours of the X-XII centuries. The vessels have the handle, mouths decorated with an orname.',NULL,NULL,NULL,'public/exhibit-image/yMBrKTV22iR2HXcqo6nDPWgrIPHfvdmu7fFZotMW.jpg',0,1,'2024-03-22 15:28:10','2024-02-28 15:29:13'),(57,1,59,'Коробочка для лекарств','Derman gutusy','Medicine box','Глиняные сосуды X-XII вв. для лекарственных средств.  Возможно, в них хранили  и носили с собой лекарственные растения.','X-XII asyrlara degişli toýundan ýasalan derman gutylary. Adamlar derman gutylarynda derman otlary saklamak üçin ulanypdyrlar we ýanlarynda göteren bolmaklary mümkin.','Clay vessels of the X-XII centuries for medicines. Perhaps, the herbs were stored and carried in them.',NULL,NULL,NULL,'public/exhibit-image/PwVhJWgeYnJsEi0BfxCfs6h2GJZdHRTeQnCxuTK7.jpg',0,1,'2024-03-13 16:57:36','2024-02-28 15:30:41'),(58,1,0,'Различная посуда','Dürli görnüşli gaplar','Various tableware','Керамические сосуды III-I вв. до н.э. из серой и красноватой глины. Без орнамента, горловина слегка отогнута наружу, в виде ручек.','B. e. öňki III-I asyrlara degişli keramika gaplar. Ýüzi tekiz. Gyzyl we çal reňkli. Bokurdakly, erňegi daşyna aýlawly hem-de tutaçly görnüşinde ýasalypdyr.','Ceramic gray and reddish clay vessels of the III-I centuries BC. Without ornament, the mouth is slightly unbent outside, in the form of handles.',NULL,NULL,NULL,'public/exhibit-image/qNEd3DrW0EsskLjE969v4wRVymVzIglKbosroUhN.jpg',0,1,'2024-02-28 15:32:09','2024-02-28 15:32:09'),(59,1,0,'Сосуды для ртути','Simap gaplary','Vessels for mercury','Керамические сосуды для ртути X-XII вв. Ртуть использовалась мастерами при ювелирных работах, а так же в других бытовых целях.','X-XII asyrlara degişli toýundan ýasalan simap gaplary. Ussalar simaby zergärçilik işlerinde we başga-da durmuş hajatlary üçin ulanypdyrlar.','Ceramic vessels for mercury of the X-XII centuries. Mercury was used by masters during the jewelry works, and also in other household purposes.',NULL,NULL,NULL,'public/exhibit-image/NF2KCE1bstC1AqR21347wsRnmpp0ZzDr8nPSwCed.jpg',0,1,'2024-03-25 14:45:03','2024-02-28 15:34:02'),(60,1,0,'Каменные посуды','Daş gaplar','Stone tableware','Средневековые сосуды, вырезанные из камня. Мастера изготавливали из камня различные виды посуды и казаны для использования в хозяйственных целях.','Orta asyrlar döwrüne degişli daşdan ýasalan gaplar. Ussalar daşdan dürli görnüşli mejime, gazan ýaly hojalykda ulanyp boljak gaplary ýasapdyrlar.','The medieval vessels which are cut out from stone. Masters made different types of stone ware and cauldrons for use in the economic purposes.',NULL,NULL,NULL,'public/exhibit-image/SbISFN4Dfvfmdmbu9YhC0YdS6r6mA6Kp26FLCJCf.jpg',0,1,'2024-03-15 19:14:22','2024-02-28 15:35:06'),(61,1,16,'Серебряные монеты','Kümüş teňňeler','Silver сoins','Монеты серебро дирхам сарабскими мотивами и арабскими надписями на аверсею Хан- Аргун (1284-1291г.) XIII-XIV веках.','Ýüzi arap şekilli we arap ýazuwly kümüş dirhem. Han- Argun (1284-1291ý.) XIII-XIV asyrlar.','Coins silver I Silver with Arabic motifs inscriptions on the obverse .Khan –Argun (1284-1291) XIII-XIV centuries.',NULL,NULL,NULL,'public/exhibit-image/JVSAPB4XD4CFlBfzboWlghEPcjD1VCdo4Mqcc3eG.jpg',0,1,'2024-03-22 15:14:06','2024-02-28 15:38:13'),(62,1,16,'Булавка','Iňňebajyk','Pin','Статуя птицы из латуни. Абиверт- Пештаг. X-ХII веках','Iňňebajyk misden ýasalan guşuň şekili. Abiwert-Peştag. Х-ХII asyrlar.','Abird statue made of brass. Abivert-Peshtag. Х-ХII centuries.',NULL,NULL,NULL,'public/exhibit-image/NZqs8aUjxB8nDrMoSD7vXjjjTD9IZ8y63dU3esQ5.jpg',0,1,'2024-03-22 15:10:27','2024-02-28 15:39:31'),(63,1,0,'Посуда','Gaplar','Tableware','Керамические чаши XI-XIII вв. украшенные различным орнаментом и глазурью.','XI-XIII asyrlara degişli toýundan ýasalan mejimeler dürli görnüşli syrçalar we nagyşlar bilen bezelipdir.','The ceramic bowls of XI-XIII centuries decorated with various ornament and glaze.',NULL,NULL,NULL,'public/exhibit-image/WwXhRpXfNRJ8rkwqAQBi3LFNJ7H6gCB4fYRelWLR.jpg',0,1,'2024-03-22 15:23:06','2024-02-28 15:41:08'),(64,1,0,'Глиняная, глазурованная посуда','Toýun, syrça gaplar','Clay, glaze tableware','Глиняные чаши XI-XIV вв. украшенные разнообразным орнаментом и глазурью.','XI-XIV asyrlara degişli toýundan ýasalan tabaklar, dürli görnüşli syrçalar we nagyşlar bilen bezelipdir.','The clay bowls of XI-XIV centuries decorated with a various ornament and glaze.',NULL,NULL,NULL,'public/exhibit-image/Bz9nifvzGeva50onOghboHAqxOnu4YFT4tx8qwIK.jpg',0,1,'2024-02-28 15:43:49','2024-02-28 15:43:49'),(65,1,0,'Глиняная, глазурованная посуда','Toýun, syrça gaplar','Clay, glaze tableware','Глиняные чаши XI-XIV вв. украшенные разнообразным орнаментом и глазурью.','XI-XIV asyrlara degişli toýundan ýasalan tabaklar. dürli görnüşli syrçalar we nagyşlar bilen bezelipdir.','The clay bowls of XI-XIV centuries decorated with a various ornament and glaze.',NULL,NULL,NULL,'public/exhibit-image/Lah6OwtoKikxKJd8e9rMhqeqFy2R6XtmVh6guJoS.jpg',0,1,'2024-02-28 15:48:06','2024-02-28 15:48:06'),(66,1,17,'Фрагмент Анауской мечети','Änew metjidiniň bina bölegi','Pieces of Anau mosque','Декоративный глазурованный фрагмент мечети Анау XV века.','XV asyra degişli Änew metjidiniň bina bölegi. Syrçalar bilen bezelen.','Decorative glazed fragment of Anau mosque of XV century.',NULL,NULL,NULL,'public/exhibit-image/0OEf6qgPyiXTbPF6reZfDipIx4xNpXbDDrwsn002.jpg',0,1,'2024-02-29 15:22:22','2024-02-28 15:50:27'),(67,1,17,'Архитектурные фрагменты','Binanyň bezeg bölekleri','Architectural pieces','Фрагмент архитектуры VII-X вв. Средневековые мастера использовали обожжённые кирпичи и ганч, украшали здания текстами и декоративным орнаментом.','Orta asyrlara (VII-X) degişli bina bölegi. Ussalar binanyň gurluşygynda gançdan we bişen kerpiçden peýdalanypdyrlar. Dürli nagyşlar we ýazgylar bilen bezäpdirler.','Fragment of architecture of VII-X centuries. Medieval masters used burnt bricks and ganch (carved ornament on chamotte or gypsum) while decoration the buildings with texts and decorative ornaments.',NULL,NULL,NULL,'public/exhibit-image/MalLQDFf74ie7UCkI6Y23rZ3Wg4OJvckWwDKAEvW.jpg',0,1,'2024-02-29 15:22:41','2024-02-28 15:52:51'),(68,1,17,'Зернотёрка','Ýargyç','Hulling mill','Изготовленная из обожженной глины зернотерка XII-XIV вв., найденная в Абиверде. Предназначалась для очистки и молотьбы зерна.','XII-XIV asyrlara degişli toýundan ýasalan ýargyç. Ol Abiwertden tapylyp, däne önümlerini arassalamakda we owmakda ulanylypdyr.','The grain greater of the XII-XIV centuries made of burned clay found in Abiverd. It is intended for cleaning and threshing of grain.',NULL,NULL,NULL,'public/exhibit-image/DWHKoZ3dKkRLc4IXMLGyMFZ45IYV0xFOXOSckpqZ.jpg',0,1,'2024-02-29 15:23:13','2024-02-28 15:54:05'),(69,1,17,'Петля','Petle','Hinge strap','Глиняный подпятник XI-XII вв. Использовался для вертикального крепления входной двери.','XI-XII asyrlara degişli toýundan ýasalan petle. Tegelek görnüşinde içinde gapyň dik agajy açylyp ýapylar ýaly oýulypdyr.','Clay thrust bearing of XI-XII centuries. It was used for vertical fastening of an entrance door.',NULL,NULL,NULL,'public/exhibit-image/BWUnw8JKQYXgfD6PToaERC5w7vhCwbNoS2PJ1u5R.jpg',0,1,'2024-02-29 15:23:53','2024-02-28 15:55:07'),(70,1,0,'Глиняная, глазурованная посуда','Toýun, syrça gaplar','Clay, glaze tableware','Глиняные блюда и чаши из Парыздепе XI-XII вв. Керамические изделия украшены глазурью и орнаментом.','Paryzdepeden tapylan XI-XII asyrlara degişli toýundan ýasalan mejimeler we tabaklar. Ýüzüne dürli görnüşli syrça nagyşlary salnypdyr.','Clay dishes and bowls from Paryzdepe of XI-XII centuries. Pottery is decorated with glaze and ornament.',NULL,NULL,NULL,'public/exhibit-image/sHV6GT72JB38BXhiQ1BJWOD8YmdYXdnNEHFMiXr0.jpg',0,1,'2024-03-22 15:24:12','2024-02-28 15:58:20'),(71,1,63,'Орудия труда','Zähmet gurallary','Labour tools','Бронзовые орудия труда древних земледельцев Маргуша.','Marguşdan tapylan  bürünçden ýasalan palta, kätmen, diş-diş tygly orak, biz, deşewaç ýaly dürli zähmet gurallary.','Bronze labor instruments of ancient farmers of Margush.',NULL,NULL,NULL,'public/exhibit-image/cAhQyU5eUTdEbvjK0yMP3maz2j1n7DujNbi6bNw3.jpg',0,1,'2024-03-13 17:52:18','2024-02-28 15:59:44'),(72,1,5,'Кувшины','Küýze gaplar','Jugs','Средневековые керамические чаши и кувшины различных форм.','Orta asyrlara degişli toýundan ýasalan küýzeler we keramika gaplar. Ussalar olary dürli görnüşlerde ýasapdyrlar.','Medieval ceramic bowls and jugs of various forms.',NULL,NULL,NULL,'public/exhibit-image/GrYWLjslyzCzog4iEoO1aUYz1ONy1DSrFYlYVm7i.jpg',0,1,'2024-02-29 14:29:56','2024-02-28 16:06:27'),(73,1,5,'Нижняя часть подсвечника','Şemdanyň aşaky bölegi','The bottom of candlestick','Ножка бронзового светильника X-XII вв., поверхность выполнена в технике рельефа.','X-XII asyrlara degişli misden ýasalan şemdanyň aýagy. Aýakly güberçekli edilip  ýasalan.','The leg of the bronze lamp of X-XII centuries, a surface is executed in \r\ntecnique of relief.',NULL,NULL,NULL,'public/exhibit-image/NAiRB5rVwfBCskKpdnrTfyLquyx5Xb3Y42T99J3w.jpg',0,1,'2024-02-29 14:31:36','2024-02-28 16:07:24'),(74,1,5,'Казан','Gazan','Cauldron','Средневековый бронзовый казан. Поверхность и горловина украшена орнаментом и надписями.','Orta asyrlara degişli bürünçden ýasalan gazan. Ýüzi we erňegi  nagyşlar hem-de ýazgylar bilen bezelen.','Medieval bronze cauldron. The surface and a mouth are decorated with ornament and inscriptions.',NULL,NULL,NULL,'public/exhibit-image/FDiERsxvoLBpzc7NQFNsATAulmrtTjIE2uINfOyk.jpg',0,1,'2024-02-29 14:31:49','2024-02-28 16:08:16'),(75,1,7,'Бронзовая посуда','Bürünç gaplar','Bronze tableware','Бронзовая и медная посуда X-XII вв. Мастера красиво украшали края и поверхность сосудов и ступок.','X-XII asyrlara degişli misden we bürünçden ýasalan gaplar. Ussalar ýüzi we erňegi nagyşly sokulary we küýzeleri ýasapdyrlar.','Bronze and copper ware of the X-XII centuries. Masters beautifully decorated edges and a surface of vessels and mortars.',NULL,NULL,NULL,'public/exhibit-image/EKXbAJY4yFcyFElndlNly9PAxPMjlCibsX4RNReX.jpg',0,1,'2024-02-29 14:44:33','2024-02-28 16:10:20'),(76,1,7,'Подсвечник','Toýun şemdan','Clay сandlestick','Керамический светильник X-XII вв. Ножки светильника изящно изготовлены.','X-XII asyrlara degişli toýundan ýasalan şemdan. Owadan görnüşde aýakly sünnälenip  ýasalan.','Ceramic lamp of the X-XII centuries. Legs of the lamp are made gracefully.',NULL,NULL,NULL,'public/exhibit-image/RxhcGlhABwrnRGIfg2GMlBmNbMIOxL9UeX5EBqnP.jpg',0,1,'2024-02-29 14:43:51','2024-02-28 16:11:44'),(77,1,7,'Нижняя часть подсвечника','Şemdanyň aşaky bölegi','The bottom of candlestick','Медный средневековый светильник с рельефными ножками.','Orta asyrlara degişli misden ýasalan şemdan. Aýakly, güberçekli edilip  ýasalan.','Copper medieval lamp with relief legs.',NULL,NULL,NULL,'public/exhibit-image/NP6ITCNOOC3vGmT5JqapSzJq7mi3nFoNOFg63LB1.jpg',0,1,'2024-02-29 14:43:25','2024-02-28 16:13:09'),(78,1,62,'Бронзовый казан','Bürünç gazan','Bronze cauldron','Бронзовая посуда X-XII вв. Мастера изготавливали казаны и ступки, украшенные орнаментом и надписями.','X-XII asyrlara degişli bürünçden ýasalan gaplar. Ussalar sokylary we gazanlary ýasapdyrlar. Olaryň ýüzüni we erňegini nagyşlar hem-de ýazgylar bilen bezäpdirler.','Bronze ware of X-XII centuries. Masters made the cauldrons and mortars decorated with ornament and inscriptions.',NULL,NULL,NULL,'public/exhibit-image/5HvjGHVDP2WSMACsdqcO93aK5oDqTnY85DIAb4hu.jpg',0,1,'2024-03-14 17:12:06','2024-02-28 16:32:20'),(79,1,6,'Различная посуда','Dürli görnüşli gaplar','Various tableware','Средневековые керамические сосуды, изготовленные различными методами и украшенные глазурью и орнаментом. XI-XIV века','Orta asyrlara degişli toýundan keramiki gaplar. Olary dürli görnüşlerde ýasapdyrlar. Ýüzi dürli nagyşlar we syrçalar bilen bezelipdir. XI-XIV asyrlar','The medieval ceramic vessels made by various methods and decorated with glaze and ornament. XI-XIV centuries',NULL,NULL,NULL,'public/exhibit-image/b00nBI1epposrkNCdsyaEmg0wy8edM2C8ipHEPQL.jpg',0,1,'2024-03-22 15:32:05','2024-02-29 14:41:05'),(80,3,0,'Деревянная ступa','Agaç soky','Tree trunk','Деревянный пест и ступка. Предназначена для толчения зерновых культур. Изготавливается из твёрдых пород дерева. Конец XIX – начало XX веков.','Soky – içine salnan önümi owradar, döwer ýaly agaçdan içi oýulan görnüşde ýasalan hojalyk esbaby. Aşagy ýerde jaýlaşykly durar ýaly tegelek görnüşinde tekiz ýasalypdyr. Onuň içinde hem önümi owratmak, döwmek üçin ujy tommaýly, süýri agaçdan ýasalan gural bar. Bu gurala sokudaşy diýilýär. XIX asyryň ahyry XX asyryň başy.','Wooden mortar with pestle. It is intended for crushing grain crops. It was made of hard sorts of wood. The end  of the XIX -   beginning of the XX century.',NULL,NULL,NULL,'public/exhibit-image/UwCK5vdR7Ptnrqv9f8hKbQRhylTioPR7LVnQvEBD.jpg',0,1,'2024-02-29 15:34:01','2024-02-29 15:34:01'),(81,3,18,'Мешок для хранения','Argyş çuwal','Bag for storage','Мешок для хранения муки или зёрен пшеницы, ячменя. Соткан в технике безворсового ткачества из шерсти. По верхнему краю пришивается верёвка свитая из козьей шерсти. Начало XX века.','Uzak ýollara gidilip, haryt alyş-çalyşyna esaslanyp, un, bugdaý, arpa ýaly däneli ösümlikleri salmak üçin ulanylan elde dokalan palas önümi. Argyş çuwal ýüňden zolakly, kakma usulynda dokalypdyr. Çuwalyň agzyna we iki gyrasyna geçiniň çöpürinden işilen ýogyn ýüp halkalaýyn tikilipdir. XX asyryň başy.','Bag for storage flour or grains of wheat or barley. It is woven of wool in the technique of pileless weaving. On the upper edge is sewed a string twisted from goat wool. Beginning of the XX century.',NULL,NULL,NULL,'public/exhibit-image/Dl0KZZu7zHHIO1g2yLiGY71dVcw3DaoytYz9AUaP.png',0,1,'2024-03-13 16:07:28','2024-02-29 15:38:34'),(82,3,19,'Молотилка для зерна','Tokmak','Grain thresher','Приспособление для обмолота зерна. Изготавливалась из дерева, в виде сабли. Им можно было обмолотить небольшое количество зерна. Конец XIX – начало XX веков.','Bugdaý, arpa ýaly däneli ösümlikleri döwmek üçin ulanylýan öý hojalyk esbaby. Tokmak agaçdan ýasalyp, bir ujy el bilen tutar ýaly inçeldilen saply, gylyç şekilli süýri görnüşde ýasalypdyr. Onuň bilen az mukdardaky bugdaý, arpa, künji başlary döwülýär. XIX asyryň ahyry XX asyryň başy.','A device for thrashing. It was made of wood in the form of a sabre. It was possible to thrash a trace of grain. The end of the XIX -   beginning of the XX century.',NULL,NULL,NULL,'public/exhibit-image/ivAUUYonFpibpqQKxeVJz3FejuS2ssBw5gqEkLtl.jpg',0,1,'2024-02-29 15:40:48','2024-02-29 15:40:48'),(83,3,19,'Деревянная миска','Agaç okara','Wooden bowl','Деревянная миска для еды. Изготавливалась на токарном станке, из твёрдых пород дерева, таких как карагач, урюк и шелковица. На основании для устойчивости имеется специальный выступ. Конец XIX – начало XX веков.','Ýogyn güjüm, garagaç, erik, tut ýaly agaçlardan tegelenip kesilip, içi oýulyp, daşy ýylmanyp ýasalan hojalyk esbaby. Onuň aşagy ýerde jaýlaşykly durar ýaly ýaýbaň bolýar. Okaralar ululy kiçili bolup, öý hojalygynda azyk önümlerini goýmakda ulanylypdyr. XIX asyryň ahyry XX asyryň başy.','Ýogyn güjüm, garagaç, erik, tut ýaly agaçlardan tegelenip kesilip, içi oýulyp, daşy ýylmanyp ýasalan hojalyk esbaby. Onuň aşagy ýerde jaýlaşykly durar ýaly ýaýbaň bolýar. Okaralar ululy kiçili bolup, öý hojalygynda azyk önümlerini goýmakda ulanylypdyr. XIX asyryň ahyry XX asyryň başy.',NULL,NULL,NULL,'public/exhibit-image/dIIrjCdtuOugNijzOpIUqNvw6fAl7CCFmfKTl450.jpg',0,1,'2024-02-29 15:42:33','2024-02-29 15:42:33'),(84,3,19,'Сито','Tir (öwser)','Sieve','Сито для просеивания зерна. Обод изготовлен из дерева, сетка из грубой ткани. Начало  XX векa.','Galla öwsülýän gap, öý hojalyk önümi. Tir ýuka, ýasy agaçdan, tigir görnüşli tegelenip, gasňagyň aşak ýüzüne ownuk iri gözli mata tutulyp ýasalypdyr. XIX asyryň ahyry XX asyryň başy.','Sieve for wheat bolting. The rim is made of wood; net is made of a rough cloth. Beginning of the XX century.',NULL,NULL,NULL,'public/exhibit-image/pESrHvcY03WfzTAbOjneZhNOFWu5E2qqC5fUp2LN.jpg',0,1,'2024-02-29 15:51:04','2024-02-29 15:43:37'),(85,3,19,'Ручная мельница','El degirmen','Hand mill','Ручной каменный жернов. В центральное отверстие насыпалось зерно, в отверстие расположенной с краю вставлялась ручка для вращения. При вращении зерно перетиралось в муку. Конец XIX – начало XX веков.','Zenanlaryň bugdaýdan un almak üçin elde işledilen, daşdan ýasalan zähmet guraly. Guralyň merkezindäki deşige bugdaý guýlupdyr. Gapdal deşigine agaçdan tutawaç oturdylyp aýlanypdyr. Degirmeniň daşlaryna “paý” diýlipdir. XIX asyryň ahyry XX asyryň başy.','Hand mill.   The  central aperture was filled with grain, the handle was inserted into an aperture located on the edge for rotation. At rotation grain was ground in a flour. The end  of XIX -   beginning of the XX century.',NULL,NULL,NULL,'public/exhibit-image/FQCfEO7A4MU7YeZ57cEdOvhgnHOaTi3NTeQdh1Ba.jpg',0,1,'2024-02-29 15:45:00','2024-02-29 15:45:00'),(86,3,19,'Деревянная ступa','Agaç soky','Mortar with pestle','Деревянный пест и ступка. Предназначена для толчения зерновых культур. Изготавливается из твёрдых пород дерева. Конец XIX – начало XX веков.','Soky – içine salnan önümi owradar, döwer ýaly agaçdan içi oýulan görnüşde ýasalan hojalyk esbaby. Aşagy ýerde jaýlaşykly durar ýaly tegelek görnüşinde tekiz ýasalypdyr. Onuň içinde hem önümi owratmak, döwmek üçin ujy tommaýly, süýri agaçdan ýasalan gural bar. Bu gurala sokudaşy diýilýär. XIX asyryň ahyry XX asyryň başy.','Mortar with pestle. It is intended for crushing grain crops. It is made of hard sorts of wood. The end  of the XIX -   beginning of the XX century.',NULL,NULL,NULL,'public/exhibit-image/nZXmCgShQxY21XYPLoJzh51tgJZI9p7RkfZz5B1N.jpg',0,1,'2024-02-29 15:50:40','2024-02-29 15:50:40'),(87,3,19,'Пшеницa','Bugdaý','Wheat','Пшеница текущая из горшка. Конец XIX – начало XX веков.','Küýzeden akýan bugdaý. XIX asyryň ahyry XX asyryň başy.','Wheat flowing from a pot. The end  of the XIX -   beginning of the XX century.',NULL,NULL,NULL,'public/exhibit-image/2xhJhtbatV9PfVzJ5JUWOHJixBBiZLTnhNQyAtcw.jpg',0,1,'2024-02-29 15:58:17','2024-02-29 15:58:17'),(88,3,18,'Телега с хомутом','Araba we hamyt','Cart with clamp','Конская, грузовая, четырёхколёсная повозка. Повозка состоит деревянной площадки, четырёх колёс и двух оглобель. Начало XX века.\r\nЧасть конской упряжи. Состоит из двух деревянных клещей, с внутренней стороны проложена мягкой прокладкой. Начало XX века.','Ata goşulyp, ýük daşalýan ýönekeý oba hojalyk ulagynyň bir görnüşi. Araba esasan agaçdan ýasalýar. Onuň esasy bölekleri dört tigirden, iki aryş agajyndan, tigirleriň içinden geçýän okdan ybaratdyr. XX asyryň başy.\r\nAraba goşulýan malyň boýnuna geýdirilýän esbap. Hamyt iki bölek ýarym aýlaw agaçdan ybarat bolup, onuň malyň boýnuna degýän tarapynyň öňünden düýrlenen ýa-da gatlanan ýumşak mata goýulýar. XX asyryň başy.','Horse, cargo, four-wheel vehicle. The vehicle consists of wooden platform, four wheels and two shafts. Beginning  of the XX century.\r\nPart of a harness. Consists of two wooden pincers,   from the inside is laid   a soft lining. Beginning of the XX century.',NULL,NULL,NULL,'public/exhibit-image/YMqmB5SgKswVkDlzgWwJKcTR18EqRDKMTgCRxJGQ.jpg',0,1,'2024-02-29 16:05:08','2024-02-29 16:05:08'),(89,3,20,'Деревянная крышка','Agaç gapak','Wooden cover','Деревянная крышка для казана. Крышка изготавливалась из дерева, сверху имеется pучка. ХХ век.','Hamyr ýaýmak üçin ulanylan öý hojalyk önümi. Gapak ýüzi tezik agaçdan, ýasy, tegelek görnüşde sepleşdirlip ýasalypdy. Gapaga iki sany agaçdan aýak goýlupdyr. XX asyr.','Wooden cover for cauldron. It was made of wood and there is a handle. XX century.',NULL,NULL,NULL,'public/exhibit-image/LlTgEW8Z3IMhwNC4xqurn90V2a2KkEc7Ai1Cxro6.jpg',0,1,'2024-02-29 16:08:57','2024-02-29 16:08:57'),(90,3,20,'Репиде','Repide','Repide','Приспособление используемое пекарями при работе на открытом огне. Представляет из себя круглую подушку с карманом на боку. Пекарь \r\nодевает его на руку и производит закладку раскатанного теста во внутрь печи. Изготавливали из двух видов ткани, по краю украшен чёрно-белой верёвочкой. Конец ХХ века.','Tamdyra çörek ýapylanda ulanylan öý hojalyk esbaby. Repide eliňi ýakmazlyk we üstüne hamyr goýmak üçin, ýüz tarapy bizden, arkasy kendirden tegelek görnüşinde, ele geýdirer ýaly ýer goýlup tikilipdir. Repidäniň tutuş töweregi alaja bilen bezelipdir. XX asyryň ahyry.','The device used by bakers in work with open fire. It is a small round pillow with a pocket on one side. Baker hangs it on a hand and places of the rolled dough in inside of the furnace. It was made of two kinds of a cloth, on the edge it is decorated by a black-and-white string. The end of the XX century.',NULL,NULL,NULL,'public/exhibit-image/RiZdDbrfXq9hGOR9iY0l8GgWogT6TCLbCpLFfM6T.jpg',0,1,'2024-02-29 16:11:05','2024-02-29 16:11:05'),(91,3,20,'Сито','Elek','Sieve','Сито для просеивания муки. Обод изготовлен из дерева, сетка из тонкой металической проволоки. ХХ век.','Uny eläp arassalamak üçin ulanylan öý hojalyk esbaby. Elek ýuka, ýasy agaçdan, tigir görnüşli tegelenip, gasňagyň aşak ýüzüne ownuk gözenekli sim tutulyp ýasalypdyr. XX asyr.','Sieve for wheat bolting. The rim is made of wood; net is made of a thin wire. XX century.',NULL,NULL,NULL,'public/exhibit-image/2uj1O9TojMFQ7P5tjRGl7i5G8pSWP564IhNW0Ucu.jpg',0,1,'2024-02-29 16:12:03','2024-02-29 16:12:03'),(92,3,20,'Кендирик','Kendirik','Kendirik','Скатерть для просеивания муки и раскатывания теста. Изготавливали из толстой грубой ткани. Снаружи украшен узором “гоша тойнук”, по краю пришита чёрно-белая верёвочка. ХХ век.','Üstünde un elemek, hamyr ýugurmak, öýmek üçin ulanylan öý hojalyk esbaby. Kendirik galyňrak kamys matadan tikilipdir. Onuň daşyna “goşa toýnukly” alaja tutulyp, burçlaryň birikýän ýerine alajadan goçak şekili berlipdir. XX asyryň ahyry.','Tablecloth for wheat bolting and dough rolling. It was made of thick and rough cloth. From outside it is adorned with “gosha toynuk” pattern, on the edge it is sewed a black-and-white string. XX century.',NULL,NULL,NULL,'public/exhibit-image/2ANxT9ZJs4rYm6N21bRXHCanQpcKznFLQuJlB3Lp.jpg',0,1,'2024-02-29 16:15:37','2024-02-29 16:15:37'),(93,3,20,'Деревянная миска','Agaç okara','Wooden bowl','Деревянная миска для еды. Изготавливалась на токарном станке, из твёрдых пород дерева. На основании для устойчивости имеется специальный выступ. Начало XX века.','Berk agaçdan tegelenip kesilip, içi oýulyp, daşy ýylmanyp ýasalan hojalyk esbaby. Onuň aşagy ýerde jaýlaşykly durar ýaly ýaýbaň bolýar. Okaralar ululy kiçili bolup, öý hojalygynda naharlary goýmakda ulanylypdyr. XX asyryň başy.','Wooden bowl for food.  It was made of hard sorts of wood on a lathe. There is a special lug on the base for steadiness. Beginning  of the XX century.',NULL,NULL,NULL,'public/exhibit-image/f8TGTjctpeCkE89KZIvsnQwZJUd30YY3pax1BZV3.jpg',0,1,'2024-02-29 16:17:04','2024-02-29 16:17:04'),(94,3,21,'Лемех','Ýerdemir (paza)','Colter','Лемех. Устанавливался в нижней части плуга. Изготавливали методом литья либо ковки. Конец XIX – начало XX веков.','Ekerançylykda ýer sürlende ulanylan gural. Azalyň omajynyň ujuna geýdirilýän, peýkam görnüşli metaldan ýasalan demir paza. XIX asyryň ahyry XX asyryň başy.','Colter. It is placed in the bottom of plough. It was made by means of casting or smithery. The end of the XIX -  beginning of the XX century.',NULL,NULL,NULL,'public/exhibit-image/AtvPNO8NT34XoiWgFDkMDWovTSKB1stKsmQgwAlg.jpg',0,1,'2024-02-29 16:19:45','2024-02-29 16:19:45'),(95,3,21,'Вилы','Çarşak','Pitchfork','Вилы. Предназначены для работ с сеном. Имеет три зуба, изготавливался из железа, рукоятка из дерева. Начало ХХ века.','Ot, petde, harman atmak, sowurmak üçin ulanylan oba hojalyk guraly. Çarşak metaldan, üç dişli görnüşde ýasalypdyr. Bu guralyň agaç sap geýdirer ýaly ýörite turba görnüşli sap ýeri bar. XX asyryň başy.','Pitchfork. It is intended for work with hay. It has three teeth, it was made of iron, handle is wooden. Beginning of the XX century.',NULL,NULL,NULL,'public/exhibit-image/KNTDqaFOtQDfX40sfcJxTfLMZXspFGYR8TQ7MGoS.jpg',0,1,'2024-02-29 16:20:39','2024-02-29 16:20:39'),(96,3,21,'Джыкырык','Jykyryk','Jykyryk','Часть механизма, предназначенного для обмолота зерна. Изготавливается из твёрдых пород дерева. Конец XIX – начало ХХ веков.','Bugdaýyň hoşasyny sypaldan arassalamak üçin ulanylan oba hojalyk guraly. Bu gural berk agaçdan süýri görnüşde ýasalyp, onuň oýulan deşiklerine agaç bölekleri oturdylyp ulanylypdyr. Bu jykyryk guralynyň bir bölegi. XIX asyryň ahyry XX asyryň başy.','A piece of device intended for crushing grain crops. It is made of hard sorts of wood. End of the XIX- beginning of the XX century.',NULL,NULL,NULL,'public/exhibit-image/LY7AOCZUVsuNh6LpPBA6i5fQZa33f68RyHmUHLFP.jpg',0,1,'2024-02-29 16:22:43','2024-02-29 16:22:43'),(97,3,21,'Вилы','Ýabak','Pitchfork','Вилы. Предназначены для работ с сеном. Имеет шесть зубов, изготавливался из дерева. Начало ХХ века.','Ot-çöp, ýandak, bede, desse, harman ýaly zatlary ýygnamak, üýşürmek, götermek üçin ulanylan oba hojalyk guraly. Ýabak, esasan-da, “göwreden”, “agaç dişden”, “agaç çüýden”, “agaç sapdan” ybarat bolup, tutuşlygyna agaçdan ýasalypdyr. XX asyryň başy.','Pitchfork. It is intended for work with hay. It has six teeth, it was made of iron, handle is wooden. Beginning of the XX century.',NULL,NULL,NULL,'public/exhibit-image/23SNtGex0d7atqrDAHQy8nb36dG2YaS4BlcChMNf.jpg',0,1,'2024-02-29 16:24:06','2024-02-29 16:23:59'),(98,3,21,'Седло','Hatap','Saddle','Седло верблюжье. Изготавливалась из дерева, устанавливалась на верблюда при помощи подпруг. Конец XIX – начало XX веков.','Düýäniň howudynyň öň tarapyna birikdirilýän, dört bölek, ýagny iki çaty görnüşindäki agaç esbap. Hatabyň dört saly hem birmeňzeş edilip, gaty agaçdan ýasalýar. Her iki saly gulakçöp arkaly olaryň deşiklerinden geçirilip birikdirilýär. Birikdirilen çatylar gulagyň oky arkaly biri-birine 10-15 sm aralykda birleşdirilýär. XIX asyryň ahyry XX asyryň başy.','Saddle for camel. It was made of wood and was placed on a camel with a help of saddle girth. The end  of the XIX -   beginning of the XX century.',NULL,NULL,NULL,'public/exhibit-image/5BMpi4vFKG1zdTrOj87p2zqcn7leuRgjAkvAWeou.jpg',0,1,'2024-02-29 16:25:18','2024-02-29 16:25:18'),(99,3,21,'Плуг','Azal','Рlough','Традиционный плуг. Запрягался быками или верблюдами и использовался для вспашки земли. Состоит из сошника и лемеха. Конец XIX – начало XX веков.','Ata, öküze, düýä goşulyp ýer sürmek üçin ulanylan oba hojalyk guraly. Ýogun agaçlardan taraşlap ýasalypdyr. Onuň ok, künde ýaly bölekleri bolýar. Ýer sürlende azal, esasan, bir jübüt mala ýa-da ýeke düýä, ata, öküze tirkelýär. XIX asyryň ahyry XX asyryň başy.','Traditional plough. It was harnessed by bulls or camels and it was used for ground ploughing. It consists of ploughshare and colter. The end  of the XIX -   beginning of the XX century.',NULL,NULL,NULL,'public/exhibit-image/thClQAQ4Q8pOBoZspC0iL7ENrwitWOhcsHLl6Acm.jpg',0,1,'2024-02-29 16:26:09','2024-02-29 16:26:09'),(100,3,21,'Ярмо','Boýuntyryk','Yoke','Ярмо – деревянный хомут для запрягания пары быков и лошадей. Изготавливалась из дерева, имеется два места для животных. Животные запрягаются при помощи кожаных ремней или верёвок. Конец XIX – начало XX веков.','Ýer sürmek üçin öküzleriň, atlaryň boýunlarynyň üstüne atylýan oba hojalyk guraly. Boýuntyryk agaçdan ýasalyp, onuň dört sany deşigi bolýar. Her iki çetki deşikden ýokardan aşak, ujy tomarçakly samaçaw agaçlary sokulýar. Öküzleriň boýny her iki samaçawyň arasynda galýar we samaçawlaryň aşagy gaýyş ýa-da ýüp bilen daňylýar. Samaçawlaryň boýy 50-60 sm çemesinde bolýar. XIX asyryň ahyry XX asyryň başy.','Yoke  – a wooden collar for harness of  steams of pair and horses. It was made of wood, there are two places for animals. Animals are harnessed with the help of leather belts or cords. The end  of the XIX -   beginning of the XX century.',NULL,NULL,NULL,'public/exhibit-image/ARnFgWUJ4ZEqNaPsWo2QUFzrvRqTsaZKfGVQXH9i.jpg',0,1,'2024-02-29 16:27:16','2024-02-29 16:27:16'),(101,3,0,'Большая ступа для получения масла','Juwazyň sokusy','A big mortar for churning','Большая ступа для получения масла. Основание ступы закапывалось в землю, а тяжёлый деревянный пест вращался при помощи верблюда. Для получения масла использовались семена местных растений. Изготавливался из твёрдых пород дерева, таких как карагач. Конец XIX – начало ХХ веков.','Içinde juwazyň oky aýlanýan, ortasy oýulan, ýogyn, togalak agaç. Sokynyň düýbi ýere gömülýär. Soky, esasan, garaman ýa-da güjüm agaçlaryndan ýasalýar. Juwaz künjüden we käbir çigitden ýag almak üçin gurulan desga. XIX asyryň ahyry XX asyryň başy.','A big mortar for churning. The base mortar was dug in  the ground and heavy wooden pestle was rotated with a help of a camel. For churning were used seeds of local plants. It was made of hard sorts of wood, such as karagach. The end of the XIX-   beginning of the XX century.',NULL,NULL,NULL,'public/exhibit-image/Bg383LlSBaVSZceLHKyXlgO0SOjaIXeU64YWIIZq.jpg',0,1,'2024-02-29 16:29:17','2024-02-29 16:29:17'),(102,3,22,'Деревянная миска','Agaç okaralar','Wooden bowl','Деревянная миска для еды. Изготавливалась на токарном станке, из твёрдых пород дерева, таких как карагач, абрикос и шелковица. На основании для устойчивости имеется специальный выступ. Конец XIX – начало XX веков.','Ýogyn güjüm, garagaç, erik, tut ýaly agaçlardan tegelenip kesilip, içi oýulyp, daşy ýylmanyp ýasalan hojalyk esbaby. Onuň aşagy ýerde jaýlaşykly durar ýaly ýaýbaň bolýar. Okaralar ululy kiçili bolup, öý hojalygynda naharlary goýmakda ulanylypdyr. XIX asyryň ahyry XX asyryň başy.','Wooden bowl for food.  It was made of hard sorts of wood such as karagach, apricot tree and mulberry tree on a lathe. There is a special lug on the base for steadiness. The end of the XIX -   beginning of the XX century.',NULL,NULL,NULL,'public/exhibit-image/wzZ8tGNCxxalTfX27WTwRiVLrAcrLmyTKhp6kwmT.jpg',0,1,'2024-02-29 16:31:29','2024-02-29 16:31:19'),(103,3,22,'Деревянные ложки','Agaç çemçeler (kaşyk)','Wooden spoons','Деревянные ложки. Изготавливалась из твёрдых пород дерева, встречаются как для левшей, так и для правшей. Конец  XIX – начало XX веков.','Naharlanmak üçin ulanylan, uzyn saply, bir tarapy süýnmek görnüşinde ýasalan agaç enjam. Ol berk agaçdan tutuş sapy bilen bir bütewi ýasalypdyr. Çemçäniň saglakaý hem-de çepbekeý görnüşleri bolýar. XIX asyryň ahyry XX asyryň başy.','Wooden spoons. They were made of hard sorts of wood both for left-handed and right-handed persons. The end of the XIX -   beginning of the XX century.',NULL,NULL,NULL,'public/exhibit-image/qkagZBIsk2gViA6jicYZ9VoG0Xoh9DVurivIN0bP.jpg',0,1,'2024-02-29 16:32:47','2024-02-29 16:32:47'),(104,3,22,'Сачак','Saçak','Sachak','Скатерть для хранения хлеба. Изготавливали в технике безворсового ткачества, из двух видов шерсти, верблюжьей и бараньей. Украшено узором “узульмез” в технике вышивка. По краю пришита чёрно-белая верёвочка. Скатерть считается священной. ХХ век.','Içine çörek dolanýan, düýäniň ýüňünden dokalan önüm. Düýe ýüňi bilen goýunuň reňklere boýalan ýüňi garylyp, zolak görnüşinde, kakma usulynda dokalypdyr. Saçaga köjüme usulynda “üzülmez” nagşy salnypdyr. Gyrasyna düýäniň ýüňünden “bugdaýly” alaja aýlanypdyr. Saçaga diňe bir çörek dolanman, toý ýerlerine gidilende pişme, gant we süýjülikler salnypdyr. Saçak mukaddeslikdir. XX asyr.','Tablecloth for bread keeping. Made in the technique of pileless weaving, of two kinds of a wool, camel’s hair and sheep\'s wool. It is adorned by “uzulmez”  pattern in the technique of embroidery. On edge is sewn the black-and-white string. The tablecloth is considered to be sacred. The XX century.',NULL,NULL,NULL,'public/exhibit-image/WFhN53RwkM6Cc3M1UEyIDKB0XjXacbJFyL42HIJc.jpg',0,1,'2024-02-29 16:34:00','2024-02-29 16:34:00'),(105,3,0,'Серп','Orak','Sickle','Сельскохозяйственное орудие – серп.  используется для уборки зерновых культур и резки трав. На лезвие серпа с внутренней стороны набиваются специальным инструментом зубцы. ХХ век.','Galla ekinlerini ýa-da ot ýygmak üçin ulanylan oba hojalyk guraly. Orak metaldan egri tyg şekilinde, onuň ýüzi dişelip, agaç saply ýasalypdyr. XX asyr.','The agricultural labour tool - a sickle. It is used for grain crops harvesting and are   grass cutting. On inner side of blade of a sickle are made teeth with special instrument. The XX century.',NULL,NULL,NULL,'public/exhibit-image/MZgjyF6Oi7cfVp8TbRVylujBMsxrkX5AjY9OQOV7.jpg',0,1,'2024-03-04 14:29:49','2024-02-29 16:36:06'),(106,3,23,'Сачак','Saçak','Sachak','Скатерть для хранения хлеба. Изготавливали в технике безворсового ткачества, из двух видов шерсти, верблюжьей и бараньей. Украшено узором “узульмез” в технике вышивка. По краю пришита чёрно-белая верёвочка. Скатерть считается священной. ХХ век.','Içine çörek dolanýan, düýäniň ýüňünden dokalan önüm. Düýe ýüňi bilen goýunuň reňklere boýalan ýüňi garylyp, zolak görnüşinde kakma usulynda dokalypdyr. Saçaga köjüme usulynda “üzülmez” nagşy salnypdyr. Gyrasyna düýäniň ýüňünden “bugdaýly” alaja aýlanypdyr. Saçaga diňe bir çörek dolanman, toý ýerlerine gidilende pişme, gant we süýjülikler salnypdyr. Saçak mukaddeslikdir. XX asyr.','Tablecloth for bread keeping. Made in the technique of pileless weaving, of two kinds of a wool, camel’s hair and sheep\'s wool. It is adorned by “uzulmez”  pattern in the technique of embroidery. On edge is sewn the black-and-white string. The tablecloth is considered to be sacred. The XX century.',NULL,NULL,NULL,'public/exhibit-image/zD3mocD36OEUPB9n6ZiCVa7Aof65qVcy5qQMUEop.jpg',0,1,'2024-02-29 16:41:14','2024-02-29 16:41:14'),(107,3,23,'Инструмент для украшения хлеба','Dürtgüçler (dikeç)','The device for adorning bread','Инструмент для украшения хлеба. Изготавливали из дерева на токарном станке, железные зубья выложены в орнамент. Для украшения самого инструмента использовались проволочные подвески, которые при работе издавали звук. ХХ век.','Bişiriljek çöregiň, petiriň ýüzüni dürtüp çykmak üçin ulanylan öý hojalyk önümi. Keltejik agaç saply, dabany metaldan diş-diş edilip ýasalypdyr. Dürtgüjiň sapyna şyňňyrdap ses eder ýaly goçak görnüşli sim şelpeler hem berkidilipdir. XX asyr.','The device for adorning bread. It was made of a tree on a lathe, iron teeths are laid out in ornament. For decoration of the device were used wire pendants,   which made a sound at work. The XX century.',NULL,NULL,NULL,'public/exhibit-image/f8whAuexCB4cJCK4acxDTouzhFnaGtPTh1Mxb9Vg.jpg',0,1,'2024-02-29 16:42:11','2024-02-29 16:42:11'),(108,3,23,'Мешочек для хранения соли','Duz torba','A bag for keeping salt','Мешочек для хранения соли. По верхнему краю пришита чёрно-белая верёвочка. ХХ век.','Duz guýmak üçin ulanylan öý hojalyk önümi. Duz torba kendir matadan tikilipdir. Torbanyň agzyna alaja ýüpi tutulypdyr. XX asyr.','A bag for keeping salt. On the upper edge is sewed black-and-white string. The XX century.',NULL,NULL,NULL,'public/exhibit-image/JSJnCKIQrOasSf6Ry2By8o3uWBuy9bAqY9sA06ok.jpg',0,1,'2024-02-29 16:43:05','2024-02-29 16:43:05'),(109,3,23,'Туркменская скалка','Oklaw','Turkmen rolling pin','Традиционная туркменская скалка. Одна сторона имеет четырёхугольное окончание с четырьмя зубцами, другой конец имеет конусовидное завершение. Обе стороны использовались для украшения разных сортов хлеба. Конец XIX – начало ХХ веков.\r\nСкалка обычная. В середине имеется утолщение. ХХ век.','Hamyr ýaýmak üçin agaçdan, merkezi ýognas edilip ýasalan öý hojalyk enjamy. Onuň bir ujunda dört sany dişi bar. Ol dürtgüç hökmünde ulanylypdyr. Beýleki ujy süýem barmak görnüşinde inçe bolup, petir çörek bişirilende dürtmek üçin peýdalanylypdyr. XIX asyryň ahyry XX asyryň başy.\r\nHamyr ýaýmak üçin agaçdan, merkezi ýognas edilip, iki gyrasy eliň aýasyna laýyk bolar ýaly görnüşde ýasalan öý hojalyk enjamy. XX asyryň ahyry.','Traditional Turkmen rolling pin. One side has the quadrangular ending with four teeth, the other side has cone-shaped ending. Both sides were used for adornment of different sorts of bread. The end of the XIX -   beginning of the XX century\r\nUsual  rolling pin. In the middle there is a thickening. The XX century.',NULL,NULL,NULL,'public/exhibit-image/H7zpBHQcRyDOEsMYgagkMVCTFos6WS1fSaK9HgHD.jpg',0,1,'2024-02-29 16:44:32','2024-02-29 16:44:32'),(110,3,0,'Тамдыр','Tamdyr','Tandoor','Печь для выпекания традиционного хлеба. Изготовлен в форме перевёрнутой полусферы, в верхней части круглое отверстие для выхода дыма и закладки хлеба. В нижней части находится поддувало, которое оформлено рельефным узором “голчурлы гочак”. Конец XX века.','Çörek bişirmek üçin hojalyk önümi. Tamdyr toýun palçygyndan depesi açyk gümmez şekilinde ýasalan ojak. Tamdyryň agzy erňekli, aşagy iki körükli, bir körüginiň üstünden “golçurly goçak” şekili berlip ýasalypdyr.\r\nXX asyryň ahyry.','A furnace for baking  traditional bread. It is made in the form of turned hemisphere, in the top there is a round aperture for  exit of  smoke and placing dough. In the bottom  there is ash hole, which is adorned with a relief pattern “golchurly gochak”. The end of the XX century.',NULL,NULL,NULL,'public/exhibit-image/M4OpSPRARfxidbBDWMnFJijNBYiOsCjCFTXcrApb.jpg',0,1,'2024-02-29 16:46:05','2024-02-29 16:46:05'),(111,3,24,'Тунче','Tüňçe','Tunche','Сосуд для кипячения воды. Изготовлен из меди, сбоку имеется ручка а на венчике слив. Шейка усилена валиком. В нижней части для большей устойчивости имеется подставка. Конец XIX – начало XX веков.','Çaý, suw gaýnatmakda ulanylan hojalyk esbaby. Tüňçe metaldan armyt şekilinde ýasalyp, onuň bokurdagynyň gapdalynda gulpy we jürnügi bar. Tüňçäniň ýüzüne güberçekli halkalar geçirlipdir. Aşagy ýerde jaýlaşykly durar ýaly tegelek görnüşinde aýak edilipdir. XIX asyryň ahyry-XX asyryň başy.','A vessel for water boiling. It is made of copper, there is a handle from one side and spout on the crown. The neck  is strengthened by roller. To the bottom is soldered a stand of round form for steadiness. The end of the XIX - the beginning of the XX century.',NULL,NULL,NULL,'public/exhibit-image/sfXJIVIdvdm0lgEJ4hyHOfuCbTW3dSL49CChU8m4.jpg',0,1,'2024-03-04 12:07:31','2024-02-29 16:49:30'),(112,3,24,'Серп','Orak','Sickle','Сельскохозяйственное орудие используется для уборки пшеницы и ячменя. Иногда используют при резкe верблюжьей колючки, и уборке сухой травы\r\nВ отличии от серпа на его лезвие не набиваются зубцы, а просто ровно затачиваются. ХХ век.','Ak ekin ormakda, ýandak, ot ýatyrmakda ulanylan oba hojalyk guraly. Aňňal metaldan ýarym aý şekilinde ýasalyp, onuň ýüzi dişelmeýär, çalnyp ýiteldilýär. Onuň sapy agaçdan ýasalypdyr. XX asyr.','The agricultural labour tool is used for wheat and barley harvesting. Sometimes is used for cutting  camel\'s-thorn and dried grass. Unlike sickle it has no teeth on the blade, it only is sharpened. The XX century.',NULL,NULL,NULL,'public/exhibit-image/WXBvH9x3dIYrG4ixIux5m4rqKgTJzIJid1PqrPbV.jpg',0,1,'2024-03-04 12:06:11','2024-02-29 16:51:50'),(113,3,25,'Конный плуг','At kültesi','Horse plough','Плуг  использовали для вспашки плотной почвы поднятия целины .Чтобы тянуть такое орудие труда использовали крупнорогатый скот (волов и быков ). Чтобы регулировать направление и глубину борозды за плугом шёл человек держась за две рукоятки . Он также часто руководил движением животных тянущих за собой плуг. XIX –XX век.','At kültesi  -Ýeri çuňdan  agdarmakda we joýa ,pel çekmekde  ulanylan.  Iri şahly mallara tirkelip pel çekipdirler. At kültesiniň gyşarmazlygy üçin kültäni bir adam  saklap gelipdir. XIX -XX asyr.','The plow was used to plow dense soil to raise virgin soil. To  pull such a tool cattle (Oхen and bulls) were used. To regulate the direction and depth of the furrow a person walked behind the plow holding two handles. He also often supervised the movement of animals pulling the plow. XIX –XX century.',NULL,NULL,NULL,'public/exhibit-image/wUISTp1GLsSYfk5yYSX7UzvthJEvxXVHFMe02ZU3.jpg',0,1,'2024-02-29 16:57:09','2024-02-29 16:57:09'),(114,3,25,'Конная косилка','At pendi','Riding mower','Плуг  использовали для вспашки плотной почвы, поднятия целины .Чтобы тянуть такое орудие труда использовали крупнорогатый скот (волов и быков ). Чтобы регулировать направление и глубину борозды за плугом шёл человек держась за две рукоятки. Он также часто руководил движением животных тянущих за собой плуг   XIX –XX век.','At pendi- Ýeri çuňdan  agdarmakda we joýa ,pel çekmekde  ulanylan.  Iri şahly mallara tirkelip pel çekipdirler. At pendiniň  gyşarmazlygy üçin kültäni bir adam  saklap gelipdir. XIX -XX asyr.','The plow was used to plow dense soil to raise virgin soil.To  pull such a tool cattle (Oхen and bulls) were used . To regulate the direction and depth of the furrow a person walked behind the plow holding two handles .He also often supervised the movement of animals pulling  the plow XIX –XX century.',NULL,NULL,NULL,'public/exhibit-image/CRDlx5YcObgDqX51dnNcUGjP5eYigz5KEGYCSHrR.jpg',0,1,'2024-02-29 17:01:32','2024-02-29 17:01:26'),(115,3,25,'Плуг','Öküz künde','Plough','Плуг – был орудием используемым  для вспашки и выравнивания  поверхности  земли. XIX –XX век.','Öküz künde –ýeri ýüzleý sürmekde we tekizlemekde ulanylan gural. Iri şahly mallara tirkelip işledilen. XIX -XX asyr.','Aplow was a tool used for plowing and leveling the surface of the earth XIX –XX century.',NULL,NULL,NULL,'public/exhibit-image/hNS815WH8Y3coYP5w7T4Nep3gdyOFKORBohYxW20.jpg',0,1,'2024-02-29 17:02:21','2024-02-29 17:02:21'),(116,3,25,'Борона','Mala','Agricultural harrow','Борона- используется при обработке земли. Его прикрепляли к крупному рогатому скоту и использовали для охоты на крупных животных. XIX –XX век.','Mala -Ýeri işläp bejermekde ulanylan. Iri  şahly mallara tirkelip, iri kesekleri owratmakda ulanylypdyr. Esasanam mallara tirkelende ýere agram bermek üçin malanyň üstünde daýaw adam oturdyp işledilipdir. XIX -XX asyr.','A harrow is an agricultural tool for surface tillage. It was attached to cattle or coupled with tractor cultivators XIX –XX century.',NULL,NULL,NULL,'public/exhibit-image/o23v19Kpz9jJOzYiP5NpxZYgh69KmJzTMfCms4Sk.jpg',0,1,'2024-02-29 17:03:21','2024-02-29 17:03:21'),(117,3,25,'Косилка для травы','Ot orýan gural','For a grass','Конная косилка –сельскохозяйственное орудие использующаяся для срезания травы на сельскохозяйственных угодьях то есть для сенокоса.  XIX –XX век.','Ot orýan gural- Bu guralda öri meýdanlarda,  tekiz ýerlerde  ot ormak üçin peýdalanylypdyr. XIX -XX asyr.','A horse –drawn mower is an agricultural implement used for cutting grass on agricultural land that is for haymaking XIX –XX century.',NULL,NULL,NULL,'public/exhibit-image/Eo3r0Y1kZKgAb4OAe97HfVPaMWQ1FE5MGWZatIqI.jpg',0,1,'2024-02-29 17:04:16','2024-02-29 17:04:16'),(118,2,26,'Агарчякмен','Agarçäkmen','Agarchakmen','Национальный мужской халат. Сшита из ткани высокой плотности, сотканной из тонкой верблюжьей шерсти. Края для крепости прошиты лентой красного цвета. Воротник украшен орнаментом «пугтама». Конец XIX – начало ХХ веков.','Erkek adamalaryň geýen milli egin-eşigi. Agarçäkmen düýäniň gapdal ýüňünden inçe egrilip, örän syk dokalan matadan tikilen çäkmen. Dona berklik üçin gyzyl jähek tutulyp, ýakasy pugtama bilen bezelip, bent bagy aýlanypdyr. XIX asyryň ahyry XX asyryň başy.','National men’s oriental robe. It is sewed of the cloth of close weave, woven of thin camel’s hair. The edges are sewed by red cord. The collar is adorned with  “pugtama” ornament. The end of the XIX - the beginning of the XX century.',NULL,NULL,NULL,'public/exhibit-image/n0tVsOhWnJIaQHNc9o9A63CbLHPpU0rABJOxKU3A.jpg',0,1,'2024-02-29 17:20:05','2024-02-29 17:20:05'),(119,2,26,'Чарык','Çaryk','Charyk','Мужская обувь. Изготовлена из кожи крупного рогатого скота. Носили во все времена года. XIX век.','Erkek adamalaryň geýen aýakgaby. Ol iri malyň hamyndan ýörite bişilip, başlygyna ýüp geçirlip tikilipdir. Çaryk ýylyň ähli pasyllarynda geýlipdir. XIX asyr.','Men’s footwear. It is made of a cattle leather. It was worn the whole year. XIX century.',NULL,NULL,NULL,'public/exhibit-image/DUpI3vAm5aSaNWjMe7Q7F6J9ErWFzoWlaoxce4Yp.jpg',0,1,'2024-02-29 17:21:08','2024-02-29 17:21:08'),(120,2,26,'Детская обувь и колодка для изготовления','Çaga çarygy galyby bilen','Children’s footwear and boottree','Детская обувь. Изготовлена из кожи крупного рогатого скота. По краю имеется затягивающийся шнурок. Носили во все времена года. XIX век\r\nДеревянная колодка, предназначенная для изготовления детской обуви. Из одной колодки обувь изготавливали на обе ноги. XIX век.','Çaganyň geýen aýakgaby. Ol iri malyň hamyndan ýörite biçilip, bütin gyralary başlygynyň üsti deşilip, ýüp geçirlip, büzülip tikilipdir. Çaryk bütin ýylyň dowamynda geýlipdir. XIX asyr.\r\nGalyp – çaga aýakgaby dikilende oňa ülňi almak üçin ulanylan agaçdan ýasalan esbap. Aýakgabyň iki taýynyň ülňüsi hem bir galypda taýýarlanypdyr. XIX asyr.','Children’s footwear. It is made of a cattle leather. There is a tightened string on the edge.   It was worn the whole year. XIX century Wooden boottree for making children’s footwear. One boottree was used for making   footwear for both feet.',NULL,NULL,NULL,'public/exhibit-image/hqNeSdAljcKpAMkP3JyyVkDGAnJUipJLp7VR2Dgk.jpg',0,1,'2024-02-29 17:22:53','2024-02-29 17:22:53'),(121,2,26,'Обувь и колодка для её изготовления','Çokaý galyby bilen','Footwear  and boottree','Мужская обувь. Изготовлена из кожи крупного рогатого скота, не имеет каблуков. Верхняя часть носика украшалась бахромой. Носили во все времена года. XIX век.\r\nДеревянная колодка, предназначенная для изготовления детской обуви. Из одной колодки обувь изготавливали на обе ноги. XIX век.','Erkek adamlar üçin niýetlenip tikilen aýakgap. Çokaý iri malyň hamyndan biçilip, ökjelik goýulman tikilipdir. Çokaýyň dabanlygy ýokary galdyrylyp başlyga birikdirilýär. Burnunyň üsti seçeklenip bezelipdir. Çokaý bütin ýylyň dowamynda geýlipdir. XIX asyr\r\nGalyp – çokaý aýakgaby dikilende oňa ülňi almak üçin ulanylan agaçdan ýasalan, iki bölekden ybarat bolan galybyň bir bölegi. Aýakgabyň iki taýynyň ülňüsi hem bir galypda taýýarlanypdyr. XIX asyr.','Men’s footwear. It is made of a cattle leather and has no heels. The top of toe was adorned with fringe. It was worn the whole year. XIX century.  \r\nWooden boottree for making children’s footwear. One boottree was used for making   footwear for both feet.',NULL,NULL,NULL,'public/exhibit-image/2faUlY3WNSyofdEcePvjbEjeuLENjocszQwg6yHg.jpg',0,1,'2024-02-29 17:24:52','2024-02-29 17:24:52'),(122,2,26,'Куртекче','Kürtekçe','Kurtekche','Национальная детская рубашка для мальчика. Сшита из домотканой ткани, спина украшена косичками из детских волос сорокадневного возраста. Конец XIX – начало ХХ веков.','Oglan çagalaryň geýen milli egin-eşigi. Ýüpek matalardan garylyp tikilip, arka tarapyna çaganyň çile saçlary dakylypdyr. XIX asyryň ahyry XX asyryň başy.','National shirt for a little boy. It is sewed of homespun cloth, its back is adorned with pigtails made of child\'s hair after forty days of birth. The end of the XIX - the beginning of the XX  century.',NULL,NULL,NULL,'public/exhibit-image/dyUtYBM9MJGUXOUmsLxT38izcIg2WUns1PJ6NAeW.jpg',0,1,'2024-02-29 17:25:45','2024-02-29 17:25:45'),(123,2,27,'Деревянные ложки','Agaç çemçeler (kaşyk)','Wood spoons','Ложка. Изготовлена из цельного куска дерева твёрдых пород. Ложка с одной стороны имеет слив, изготавливался для людей с преобладающей правой рукой и левой. Конец XIX – начало ХХ веков.','Naharlanmak üçin ulanylan, uzyn saply, bir tarapy süýnmek görnüşinde ýasalan agaç enjam. Ol berk agaçdan tutuş sapy bilen bir bütewi ýasalypdyr. Çemçäniň saglakaý hem-de çepbekeý görnüşleri bolýar. XIX asyryň ahyry XX asyryň başy.','Spoon. It is made of unitary block of hard sort wood. The spoon has an outlet from one side, it was made for right-handed and left-handed persons. The end of the XIX - the beginning of the XX century.',NULL,NULL,NULL,'public/exhibit-image/lGLZUkokvBj0aeI2QgxOOqj9TAlqv54s6CNeqz6n.jpg',0,1,'2024-02-29 17:28:59','2024-02-29 17:28:59'),(124,2,27,'Чолпы','Çolpy','Cholpy','Шумовка. Изготовлена из тонких ивовых прутьев. Конец XIX – начало ХХ веков.','Söwüt çybygyndan örülip, saply ýasalan, süzgüç, örme susgyç. XIX asyryň ahyry XX asyryň başy.','Skimmer. It is made of thin willow twigs. The end of the XIX - the beginning of the XX century.',NULL,NULL,NULL,'public/exhibit-image/tLIa5n1Ee4zf7sZ3RVFS5OwmWuXrUQxoq128l6fa.jpg',0,1,'2024-02-29 17:30:00','2024-02-29 17:30:00'),(125,2,28,'Газык','Gazyk','Gazyk','Детали кустарного ткацкого станка. Kонец XIX – начало ХХ веков.','Çäkmenlik mata dokalanda ulanylan dokma esbaby. Küji götergiç berk agajyň toýnuk görnüşli şahasyndan ýasalypdyr. Ol ýerde mäkäm durar ýaly aşagy tekiz agaç böleginiň ortasyna ykjamlanyp salnypdyr. Bu esbap küji demir turbanyň aşagyna goýmak üçin ulanylýar. XIX asyryň ahyry XX asyryň başy.','Details of homemade weaver’s loom. End of the XIX – beginning of the XX century.',NULL,NULL,NULL,'public/exhibit-image/LHwL6stSDLVO9pOOXxPx6U8Qhfd5NWBfuQUQa7U6.jpg',0,1,'2024-02-29 17:32:01','2024-02-29 17:32:01'),(126,2,28,'Юн дарак','Ýüň darak','Yun darak','Гребень для расчёсывания шерсти. Конструкция изготавливалась из дерева, в верхней части которого вертикально установлены в три ряда шиловидные зубья. Для предохранения зубьев имеется специальная крышка. Конец XIX – начало ХХ веков.','Ýüňi daramak üçin ulanylan gural. Daragyň esasy bölegi agaçdan, dişleri metaldan ýasalypdyr. Daragyň her setirinde uzynlygy 10-12 sm çemesinde 30-a golaý ujy ýiti dişleri bar. Daragyň dişleri üçin ýörite agaçdan gorag gapagy ýasalypdyr. XIX asyryň ahyry XX asyryň başy.','Hackle for wool combing. It was made of a wood, in top of which there are vertically placed awl-shaped teeth in three rows. For protection of teeth there is a special cover. The end of the XIX - the beginning of the XX  century.',NULL,NULL,NULL,'public/exhibit-image/7JzEQzyuMDeoNxM0Ouz7e9tNxsIJJGIYUI1dU3wz.jpg',0,1,'2024-02-29 17:32:54','2024-02-29 17:32:54'),(127,2,29,'Узенги','Üzeňňi','Uzengi','Узенги–железные стремена, предназначены для упора ног всадника. При использовании стремян у наездника повышается его устойчивость, и он может одновременно управлять конём и на короткой дистанции вести бой с противником при помощи сабли. XIX век.','Üzeňňi ulanylanda atyň üstündäki adamyň çydamlylygy artyp, ol bir wagtyň özinde hem aty çapmaga, hem gysga aralykda gylyjyň kömegi garşydaş bilen söweş alyp barmaklygy başarypdyr. XIX asyr.','Uzengi–stirrups for support of horseman’s legs. When use stirrups raises stability of equestrian, and he can simultaneously ride a horse and fight with the enemy by means of a sabre in a short distance. XIX century.',NULL,NULL,NULL,'public/exhibit-image/2aqaqvfLZad0Mlc5rEDjQsrru456bGXu5VuLTInz.jpg',0,1,'2024-02-29 17:34:42','2024-02-29 17:34:42'),(128,2,29,'Гамчы','Gamçy','Gamchy','Гамчы–кожаная плеть с деревянной рукояткой. Приспособление для более эффективного управления лошадью. Рукоять изготавливалась из дерева, а сама плеть сшивалась из нескольких слоёв кожи, либо плетётся. XIX век.','Aty çapmakda ulanylýan esbap. Sapy agaçdan ýasalyp, gamçynyň özi deriden edilipdir. XIX asyr.','Gamchy–leather whip with wooden handle. The device for more efficient control of a horse. The handle was made of a wood, and the lash was sewed from several layers of leather, or was spinned. XIX century.',NULL,NULL,NULL,'public/exhibit-image/nbGqTdVb7Nc9I1t6eUrN3XDRDpF0hTBodkk3DAK8.jpg',0,1,'2024-02-29 17:35:42','2024-02-29 17:35:42'),(129,2,29,'Шалдыр','Şaldyr','Shaldyr','Шалдыр – нагайка с цепной плетью для более строгого управления ослом. Плеть состоит из шести вытянутых звеньев, на которых установлены ещё по два круглых колечка. Завершается цепь большим кольцом. При потряхивании нагайка издаёт характерный звук. XIX век.','Zynjyrly gamçy eşegi has berk dolandyrmak üçin niýetlenen. Gamçy alty sany süýnmek halkalardan düzülip, olaryň hersine ýene iki sany tegelek halkalar dakylan. Gamçynyň ujy uly halka bilen tamamlanýar. Gamçy bilen urlanda özboluşly ses çykarýar. XIX asyr.','Shaldyr – whip with chain lash for handling a donkey. The lash consists of six extended links on which are placed two round rings. The chain is ended with the big ring. At  shaking the lash makes a characteristic sound. XIX century.',NULL,NULL,NULL,'public/exhibit-image/x91vTdxFwnPEjlvwIdwz9JHb5TeopzyAFEPCViWN.jpg',0,1,'2024-02-29 17:37:08','2024-02-29 17:37:08'),(130,2,29,'Агыззырык','Agyzzyryk','Agyzzyryk','Агыззырык - конские железные удила, приспособление для обуздания лошади. Изготавливались из железа методом горячей ковки. Удила дают возможность кавалеристу для более жёсткого управления конём и повышает его маневренность в бою. XIX век.','Aty jylawlamak üçin demirden guýma usulynda ýasalan esbap. Agyzzyryk esgere söweşde ata boýun egdirmeklige mümkinçilik berýär. XIX asyr.','Agyzzyryk-horse iron bits, device for restraint of horse. It was made of iron by means of hot forging. Bits make it possible for trooper for rigorous driving of a horse and raises its manoeuvrability in fight. XIX century.',NULL,NULL,NULL,'public/exhibit-image/o0BnoQ592haym4GcEFyEKsDmO9d1BbrZSvUBr9c8.jpg',0,1,'2024-02-29 17:40:56','2024-02-29 17:40:56'),(131,2,29,'Уён','Uýan','Uyan','Уён–конская кожаная узда, предназначена для управления лошадью. Традиционная конская узда, изготовлена в технике шитья и плетения. Металлические детали изготовлены методом горячей ковки. XIX век.','Uýan - aty iýtmek üçin ulanylýan deriden ýasalan esbap. Uýan tikmek we örmek usullarda, demir esbaplary guýma usullarda taýýarlanylýar. XIX asyr.','Uyan–horse leather bridle, it is intend for driving a horse. The traditional horse bridle is made in the technique of sewing and weaving. Metal details are made by means of hot forging. XIX century.',NULL,NULL,NULL,'public/exhibit-image/t5vPiZmqsUFV39RAeqfKhDhTD4GfxjcF1pi1b0EY.jpg',0,1,'2024-02-29 17:42:25','2024-02-29 17:42:25'),(132,2,29,'Нал','Nal','Nal','Нал–конские железные подковы, предназначены для защиты копыт лошадей. Подковы в основном использовались на рабочих тягловых лошадях, и в дальних переходах на верховых конях. XIX век.','Atyň toýnagyny goramak üçin niýetlenen. Nal esasan agyr ýük çekýän we daş ýollary aşýan atlar üçin niýetlenen. XIX asyr.','Nal–iron horseshoes, were intended for protection of hoofs. Horseshoes were usually used for draught horses and in long passages on saddle horses. XIX century.',NULL,NULL,NULL,'public/exhibit-image/UMBbmjhxOOVcxTuiSyVE0lntxyVkRWZCDwNfn47v.jpg',0,1,'2024-02-29 17:44:01','2024-02-29 17:44:01'),(133,2,57,'Приспособления для приготовления ковровых нитей','Çarh guraly','Device for making carpet threads','Механизм для скручивания двух ниток в одну. Механизм состоит из деревянных деталей. Конец XIX – начало ХХ веков.','Zenanlaryň ikde egrilen ýüň ýüpligini kelep etmek üçin ulanylan agaçdan ýasalan gural. Çarhda sapagy egrip bolanlaryndan soň, berklik üçin iki sany towly sapagy birleşdirlip towlanýar. Bu guralyň iki gapdaly atanak görnüşinde bolup, olaryň daşyna metal aýlaw berkidilipdir. XIX asyryň ahyry XX asyryň başy.','A device for twisting two threads in one. It consists of wood details. The end of the XIX - the beginning of the XX century.',NULL,NULL,NULL,'public/exhibit-image/UKBot6RMIUZqTaCoS6KpIHjmAlIwTDmSYMBzntPV.jpg',0,1,'2024-03-13 16:44:04','2024-02-29 17:47:02'),(134,2,30,'Вид серпа для уборки пшеницы','Aňňal','Kind of sickle for wheat harvesting','Ангал орак–сельскохозяйственное орудие используется для уборки пшеницы и ячменя. Иногда используют при резки верблюжьей колючки, и уборке сухой травы. В отличии от серпа на его лезвие не набиваются зубцы, а просто ровно затачиваются. XIX-ХХ векa.','Orak–bugdaý we arpa, käwagtlar ýandak we gury ot ýygmak üçin ulanylýan oba hojalyk guraly. Orakdan tapawutlylykda aňňalyň ýüzi dişsiz bolýar. XIX-ХХ asyrlar.','Angal orak–agricultural labour tool for wheat and barley harvesting. Sometimes is used to cut the camel\'s-thorn and gathering of a dry grass. Unlike a sickle its blade has no toothing, it is only sharpened. XIX-ХХ centuries.',NULL,NULL,NULL,'public/exhibit-image/14EZZcNzX4nxoSi4DX5xcVnahe6jRJGnRVSMKFKJ.jpg',0,1,'2024-02-29 17:49:37','2024-02-29 17:49:37'),(135,2,30,'Серп','Orak','Sicle-agricultural labour tool','Орак–сельскохозяйственное орудие–серп используется для уборки зерновых культур и резки трав. На лезвие серпа с внутренней стороны набиваются специальным инструментом зубцы. XIX-ХХ век.','Orak - däne önümlerini we ot ormak üçin niýetlenen oba hojalyk guraly. Oragyň iç ýüzüne ýörüte gural bilen diş kakylýar. XIX-ХХ asyrlar.','Orak–agricultural labour tool–sickle, is used for grain crops harvesting and grass cutting. From inside of blade is made toothing by a special instrument. XIX-ХХ centuries.',NULL,NULL,NULL,'public/exhibit-image/jgfytSdR8LrKi7EcpGLoNNgMjQ32fE2KA0oE2RXR.jpg',0,1,'2024-02-29 17:51:07','2024-02-29 17:51:07'),(136,2,30,'Чапгы','Çapgy','Chapgy','Чапгы–инструмент для измельчения соломы. Данным орудием труда перед кормлением домашней скотины солому и другие грубые корма мелко рубят. XIX век.','Çapgy - aman owratmak üçin ulanylýan gural. Öý haýwanlaryna beriljek ot we beýleki irimçik ot-çöpler şu zähmet guraly bilen ownuk edip çapylýar. XIX asyr.','Chapgy–device for crumbling up straw. This labour tool is used to crush straw and other rough forage before feeding of cattle. XIX century.',NULL,NULL,NULL,'public/exhibit-image/8tP2EoWMhcocwEucPFIWiCxPPLa4voUGP2Hvupdh.jpg',0,1,'2024-02-29 17:52:02','2024-02-29 17:52:02'),(137,2,30,'Кованный топор','Palta','Hammered axe','Палта–кованный топор. Изготовлен из железа методом горячей ковки и закреплён на клёпках. XIX век.','Süýlüp ýasalan we berçinlenip berkidilen demir palta. XIX asyr.','Palta-hammered axe. It is made of iron means of hot forging and is fastened by means of rivets. XIX century.',NULL,NULL,NULL,'public/exhibit-image/81NqVhXLgG8I37Mmksb8LGmoYbpBLVLWV5Kl5J6T.jpg',0,1,'2024-02-29 17:53:33','2024-02-29 17:53:33'),(138,2,0,'Казан','Gazan','Cauldron','Традиционный чугунный казан для приготовления пищи. Имеет полусферическую форму, в нижней части к донцу приварена подставка. С боков имеются две полукруглые ручки. Конец XIX – начало ХХ веков.','Nahar bişirmek üçin çoýundan ýasalan hojalyk esbaby. Gazan ýarym togalak görnüşinde ýasalyp, agzy ýaýbaň, giň edilipdir. Onuň aşagy ýerde jaýlaşykly durar ýaly tegelek görnüşinde aýak edilipdir. Gazany göterer ýaly iki gapdalyna sap dakylypdyr. XIX asyryň ahyry-XX asyryň başy.','Traditional cast-iron cauldron for cooking. It has a   hemispherical form, in the bottom is welded on a stand. From the sides are welded two semicircular handles. End of the XIX – beginning of the XX century.',NULL,NULL,NULL,'public/exhibit-image/HMiC0wUyUj0HqZLdJu9zImfYZIlg0a7ZIvl2xF1B.jpg',0,1,'2024-03-04 12:01:11','2024-02-29 17:57:48'),(139,2,0,'Казан','Gazan','Cauldron','Традиционный медный казан для приготовления пищи. Имеет плоскую полусферическую форму, в нижней части к донцу приварена подставка. С боков приварены ушки с кольцами для переноса. Конец XIX – начало ХХ веков.','Nahar bişirmek üçin misden ýasalan hojalyk esbaby. Gazanyň agzy ýaýbaň, giň edilip, aşagy ýerde jaýlaşykly durar ýaly tegelek görnüşinde aýak edilipdir. Gazany göterer ýaly iki gapdalyna gulplar edilip, sap dakylypdyr. XIX asyryň ahyry-XX asyryň başy.','Traditional copper cauldron for cooking. It has a flat hemispherical form, in the bottom is welded on a stand. From the sides are welded on tabs for carrying over. End of the XIX – beginning of the XX century.',NULL,NULL,NULL,'public/exhibit-image/OO21JoKBAQcfQ0jvMVOtwdHgfrENgN9mmQ5SyJ3A.jpg',0,1,'2024-02-29 18:00:30','2024-02-29 18:00:30'),(140,2,31,'Платья из шёлка и халаты','Keteni köýnek we çabyt','Silk dresses','Национальное женское платье. Платье сшито из красной ткани “кетени”, украшена узорами “дагдан”, “ак гайма”, “гочак”. ХХ век. \r\nНациональный женский халат. Платье сшито из красной ткани “гырмызы”, украшена узорами “алмагюль”, “аладжа”, “кюрте гочак”. Края украшены красной окaнтовкой. ХХ век.','Zenanlaryň geýen milli köýnegi. Köýnek gyzyl reňkli ýüpek keteniden ýanly biçüwde tikilipdir, onuň dik ýakasy “dagdan”, “ak gaýma”, “goçak” nagyşlary bilen bezelipdir. XX asyr. \r\nZenanlaryň geýen milli dony. Gyrmyzy donluk keteniden ýanly tikilipdir, “almagül” alaja nagyşly keşdelenipdir. Ýartmajyna we jübüsiniň töweregine “almagül” nagşy keşdede, “tegbent, ýarty tegbent” nagyşlary pugtamada goçak şekili berlipdir. Çabydyň ýeňsapysynyň ýerligi gara gyraw matasyndan bolup, onuň ýüzüne “almagül”, “alaja”, “kürte goçak” nagyşlary keşdelenipdir. Çabydyň gyralary jäheklenip, aldymgaç tutulypdyr. XX asyr','National woman’s dress. The dress is sewed from a red “keteni” cloth and is adorned with “dagdan”, “ak gayma”, “gochak” patterns. XX century.\r\nNational woman’s oriental robe. It is sewed from a red “gyrmyzy” cloth and is adorned with “almagul”, “alaja”, “kurte goçak” and “goçak” patterns. XX century. The edges are adorned with red mount. XX century',NULL,NULL,NULL,'public/exhibit-image/rZUuf9grmX4wqawEBHBiCvyDM5c4WB0nqpzhB0T6.jpg',0,1,'2024-03-05 16:34:03','2024-02-29 18:11:58'),(141,2,32,'Гюп','Güp','Gup','Специальный сосуд для cбивания масла при помощи мутовки.  Изготавливали из цельного куска дерева, высотой до одного метра. Конец XIX – начало ХХ веков.','Işinde gatyk, süýt ýaýyp, ýag alamak üçin soky görnüşli agaçdan ýasalan enjam. Güpiniň boýy 1 m çemesinde bolýar. Onuň aşagy ýerde jaýlaşykly durar ýaly ýaýbaň bolýar. Güpide gatyk pişek arkaly ýaýylýar. XIX asyryň ahyry XX asyryň başy.','A special vessel for churning by means of churn. It was made of unitary block of willow tree, up to 1 metre high. The end of the XIX - the beginning of the XX century.',NULL,NULL,NULL,'public/exhibit-image/9bxLphMtN4bypgJBOZjyeLK9MlGGS8I0TBgCkiOI.jpg',0,1,'2024-02-29 18:17:05','2024-02-29 18:15:48'),(142,2,32,'Пишек','Pişek','Pishek','Мутовка. Приспособление для cбивания масла в виде длинной палки с крестовиной на конце. Изготавливается из дерева. Конец XIX – начало ХХ веков.','Ýanlykda ýa-da güpide ýag ýaýmak üçin ulanylan, ujyna atanaklaýyn tagtajyk, berkidilen uzyn agaç saply hojalyk esbaby. XIX asyryň ahyry XX asyryň başy.','Churn. A device for churning in the form of long stick with crosspiece in the end. It is made of wood. The end of the XIX - the beginning of the XX century.',NULL,NULL,NULL,'public/exhibit-image/Vla87zd2ptOEn7pwIvRVMmgeOycyFpJMNkrJe12t.jpg',0,1,'2024-02-29 18:16:50','2024-02-29 18:16:50'),(143,2,33,'Гыркылык','Gyrkylyk','Gyrkylyk','Специальные ножницы предназначенные для стрижки овец и верблюдов. Изготавливаются методом ковки и встречаются двух видов. Лезвия у ножниц имеют форму клинка, с одной стороны широкий дол. В конце рукояти кольца куда вставляется деревянный штырь, выполняющий роль шарнирной оси. Конец XIX – начало ХХ веков.','Goýnuň, düýäniň, geçiniň ýüňüni gyrkmak üçin, demir ussalary tarapyndan metaldan ýasalan, iki tygly gural. Gyrkylygyň ululy-kiçili dürli görnüşde bolup, onuň gaýçydyr, syndy ýaly barmak geçirilýän halkalary bolmaýar. Iki göni dessesiniň ujundaky diametri 1 sm çemesindäki deşige agaç segse ötürilýär. Şol segse arkaly gyrkylygyň tyglary herekete getirilýär. Gyrkylygyň iki tygynyň iç ýüzi joýa ýaly oý bolýar. Şol joýalar arkaly gyrkylyk gyrýan ýüňüni gapjamaýar. XIX asyryň ahyry XX asyryň başy.','Special scissors intended for shearing of sheeps and camels. They are  made by means of smithery and are of two kinds. Edges  of scissors have a form of blade, on the one hand there is a wide dale. At the end of a handle there are rings, where is inserted the wooden dowel, which is carrying out a role of jointed  axis. The end XIX - the beginning of the XX century.',NULL,NULL,NULL,'public/exhibit-image/STtCIFFfGb2TcchNys6Tr0AB9IIdNqWlkYrjqy7N.jpg',0,1,'2024-02-29 18:19:11','2024-02-29 18:19:02'),(144,2,33,'Сынды','Syndy','Syndy','Специальные ножницы для ковровщиц. Используются при выравнивании ворса. Конец XIX – начало ХХ веков.','Haly dokalanda çitilen çitim ýüňlerini gyrkyp tekizlemek üçin ulanylýan metaldan ýasalan ulurak gaýçy görnüşli enjam. XIX asyryň ahyry XX asyryň başy.','Special scissors for carpet makers. They are used for levelling of pile. The end of the XIX - the beginning of the XX  century.',NULL,NULL,NULL,'public/exhibit-image/peXTNBT8hzX0xmdDuZDJEzKQEOZ9NsAs4yQXlHNn.jpg',0,1,'2024-02-29 18:19:55','2024-02-29 18:19:55'),(145,2,33,'Рукоятка','Dokma darak','Handle','Ручной инструмент для вбивания узлов при изготовлении ковра. Рукоятка изготавливалась из дерева, зубья из железа. Конец XIX – начало ХХ веков.','Haly, palas dokmalar dokalanda çitilýän çitimleri, öýdümleri baslyk geçirip, berkleşdirmek üçin kakylýan, 10-12 sany demir dişli, agaç saňly gural. XIX asyryň ahyry XX asyryň başy.','Hand tool for nailing knots in carpet making. The handle was made of wood, teeth – of iron. The end of the XIX - the beginning of the XX  century.',NULL,NULL,NULL,'public/exhibit-image/uCFLPYRaEKWR2oDBkPa3Wdo6EzKTL4UEwZlbM208.jpg',0,1,'2024-02-29 18:21:52','2024-02-29 18:21:52'),(146,2,33,'Кесер','Keser','Keser','Ручной инструмент для срезания узлов при изготовлении ковра. Рукоятка изготавливалась из дерева, лезвие из стали. Конец XIX – начало ХХ веков.','Haly we haly önümleri dokalanda çitilýän ýüpi kesmek üçin ulanylýan, ujy gaýşagrak metaldan ýasalan, ýiti tygly, agaç saplyja gural. Çitim çitilende, keser elmydama sag elde saklanýar. XIX asyryň ahyry XX asyryň başy.','Hand tool for cutting knots in carpet making. The handle was made of wood, blade – of steel. The end of the XIX - the beginning of the XX  century.',NULL,NULL,NULL,'public/exhibit-image/O32pmMeCSe2NxU9WlsZfSx6ZXaN10tHNxFWX1eke.jpg',0,1,'2024-02-29 18:22:37','2024-02-29 18:22:37'),(147,2,33,'Торба с куделями','Pişgeli torba','Torba with tow','Куделя. Используются в ткацком деле, приготавливают из шерсти барана. Расчёсывают и окрашивают природными красителями. ХХ век.','Dokma önümlerini dokamakda ulanylýan ýüňden taýýarlanan pişgeler. Pişgeler dokma önümleri üçin goýnuň ýüňinden taýýarlanyp, daralýar we olar dürli tebigy reňkler bilen boýalýar. XX asyr.','Tows. They are used in weaving and are made of sheep\'s wool. They are combed and dyed by natural dyes. XX century.',NULL,NULL,NULL,'public/exhibit-image/59MwpPJRzuv1PA0B75i1IRbO6IEwhrtN5iUTdHE2.jpg',0,1,'2024-02-29 18:23:32','2024-02-29 18:23:32'),(148,2,33,'Клубки нитей','Ýumaklar','Balls','Клубки нитей. Используются при изготовлении национальных ковров. ХХ век.','Haly dokamakda ulanylýan ýüňden egrilen ýüplikler. Ýumaklar haly, palas, dolak dokamak üçin ulanylýar. XX asyr.','Balls. They are used in carpet weaving. XX century.',NULL,NULL,NULL,'public/exhibit-image/F1csp4SvP1B4CFMsU1gGlLL5h7ZQqJt1HqexRX2P.jpg',0,1,'2024-02-29 18:24:50','2024-02-29 18:24:50'),(149,2,0,'Ёмкость','Hamyr jam','Bowl for dough','Традиционный медный таз для приготовления теста. Имеет форму срезанного перевёрнутого конуса, в нижней части к донцу приварена подставка. Конец XIX – начало ХХ веков.','Hamyr ýugurmak üçin misden ýasalan hojalyk esbaby. Jamyň agzy ýaýbaň, giň edilip, aşagy ýerde jaýlaşykly durar ýaly tegelek görnüşinde aýak edilipdir. XIX asyryň ahyry-XX asyryň başy.','Traditional copper basin for making dough. It has a form of cutaway reverse cone, in the bottom is welded on a stand. End of the XIX – beginning of the XX century.',NULL,NULL,NULL,'public/exhibit-image/LkvNUEWauUdNgFfMWJnSeIYKHoiLcm86HtRiSFQr.jpg',0,1,'2024-03-01 12:44:22','2024-03-01 12:44:22'),(150,2,58,'Мельничный Жёрнов','Haraz degirmen daşy','Millstone','Каменный жернов от водяной мельницы. Внешняя сторона оформлена изображениями двенадцати животных. XVIII – XIX века.','Kilwanlar bugdaýdan un almak üçin harazlarda suwuň we malyň kömegi bilen işledilen, daşdan ýasalan zähmet guraly. Bu degirmen daşynyň üstki bölegi bolup, oňa 12 sany jandarlaryň şekilleri berlipdir. Degirmen daşynyň arka tarapynda tolkun şekilleri bolup, däneleri döwmek maksady bilen edilipdir. Guralyň merkezindäki deşige bugdaý guýlupdyr. Degirmeniň daşlaryna “paý” diýlipdir. XVIII - XIX asyr.','Millstone of watermill. The outer side is adorned with pictures of twelve animals. XVIII – XIX centuries.',NULL,NULL,NULL,'public/exhibit-image/8ocwe1btM2qJVWoaJiQgKNFWh2iwQoz9n39QCrWA.jpg',0,1,'2024-03-13 16:43:12','2024-03-01 12:45:57'),(151,2,34,'Гылыч','Gylyç','Gylych','Гылыч–сабля. Традиционная туркменская сабли. Клинок изготавливается из высококачественных сортов стали. Ножны делали из дерева, обтягивались шагреневой кожей и украшались серебром и драгоценными камнями. XIX век.','Türkmen halkyna mahsus gylyç. Gylyjyň tygy poladyň ýokary hilli görnüşlerinden taýýarlanypdyr. Gyny agaçdan edilip, daşyna geçiniň ýa-da goýunyň derisi çekilip, kümüş we gymmat bahaly daşlar bilen bezelipdir. XIX asyr.','Gylych–sabre. Traditional Turkmen sabre. Blade was made of high-quality sort of steel. Sheath was made of wood and was overpacked by shagreen leather and adorned with silver and precious stones. XIX century.',NULL,NULL,NULL,'public/exhibit-image/r0NQCK6A8J103XnMOCKdYydViriE3rDfQ4p5Brdr.jpg',0,1,'2024-03-01 12:49:43','2024-03-01 12:49:43'),(152,2,34,'Хырлы–нарезное','Hyrly tüpeň','Hyrly-rifled','Хырлы–нарезное ружьё. Для удобства при стрельбе в конструкцию туркменского ружья входили деревянные сошки. А длинный ствол с нарезами обеспечивал дальность и точность выстрела. Деревянные приклады украшались инкрустацией из кости и метала. XIX век.','Atmak üçin oňaýly bolar ýaly türkmen ýaragynyň düzümine agaçdan ýasalan direg goşulypdyr. Hyrly tüpeňiň uzynlygy atuwyň uzaklygyny we takyklygyny üpjün edipdir. Agaçdan edilen tüpeňiň gundagy süňk we metaldan edilen oturtma haşam bilen bezelipdir. XIX asyr.','Hyrly-rifled gun. For convenient shooting  a design of a Turkmen gun had wooden legs support.   The  long barrel with grooves provided range and accuracy of a shot. Wooden butts were decorated by incrustation of a bone and metal. XIX century.',NULL,NULL,NULL,'public/exhibit-image/ojqutzLYSEHRMcUAMzQzBf0OUjKCmfx29SsaNdy7.jpg',0,1,'2024-03-01 12:50:57','2024-03-01 12:50:57'),(153,2,35,'Тоганак','Toganak','Toganak','Тоганак–приспособление для закрепления вьюка на верблюде. При использовании данного приспособления и подпруги, груз более плотно прилегал к телу. XIX век.','Düýäniň arkasyndaky ýüki berkitmek üçin ulanylýan gural. Şu gural bilen çeki ulanylan ýagdaýynda, ýük düýäniň arkasynda has berk saklanýar. XIX asyr.','Toganak-device for fastening load pack on the camel. In use of this device and belly band, the load more closely laid on camel’s body. XIX century.',NULL,NULL,NULL,'public/exhibit-image/qJg5fSD1aCqr1Yg7qJILxEx8TkBrAHYkt2Zl96qu.jpg',0,1,'2024-03-01 12:52:56','2024-03-01 12:52:56'),(154,2,35,'Душак','Duşak','Dushak','Душак – верблюжьи путы, изготовленные из дерева и верёвок. Путы использовались во время пастьбы, для того что бы лошадь не могла уйти далеко от села. XIX век.','Agaçdan we ýüplerden ýasalan gural. Duşak atlar öri meýdanda bakylýan wagtynda obadan daşa gitmezligi üçin ulanylýan gural. XIX asyr.','Dushak – camel hobble, made of wood and strings. Hobble was used in pasturage with a purpose not to allow a camel go far from a village. XIX century.',NULL,NULL,NULL,'public/exhibit-image/lvGYZ6orgJp1yadU4IoOIC1Nu96uoWExPVuFvgVY.jpg',0,1,'2024-03-01 12:54:36','2024-03-01 12:54:36'),(155,2,35,'Душак','Duşak','Dushak','Душак – железные путы с замком на передние ноги лошади. Замок отмыкается при помощи специального ключа. Путы использовались во время пастьбы, для того что бы лошадь не могла уйти далеко от дома. XIX век.','Atyň öňki aýaklaryna dakylýan demirden ýasalan gulply gural. Duşak atlar öri meýdanda bakylýan wagtynda öýden daşlaşmazlygy üçin ulanylýan gural. XIX asyr.','Dushak – hobble with lock for front legs of a horse. The lock is unlocked by means of a special key. Hobble was used in pasturage with a purpose not to allow a horse go far from a village. XIX century.',NULL,NULL,NULL,'public/exhibit-image/f4YCgBGF9QtgtaE8TK11mm547i0E8m1NLV7nRP0L.jpg',0,1,'2024-03-01 12:56:13','2024-03-01 12:56:13'),(156,2,35,'Буйли','Buýli','Buyli','Буйли–часть поводка для управления верховым верблюдом и в караване. При установкe данного приспособления у верблюда протыкается носовой хрящ. Применяется к особо непослушным и агрессивным верблюдам. XIX век.','Kerweni we düýeleri iýdmek üçin niýetlenen jylawyň bir bölegi. Buýli boýun egmeýän düýäniň burnunyň kekirdewügi deşilip dakylýar. XIX asyr.','Buyli–lead for handling and saddle camel and in caravan as well. The nasal cartilage of a camel is pierced for this lead. It is used to handle especially disobedient and aggressive camels. XIX century.',NULL,NULL,NULL,'public/exhibit-image/582vr9RHygosTERNL2Kix8qw8pXRR8ZYPvv8yYmL.jpg',0,1,'2024-03-01 12:57:56','2024-03-01 12:57:56'),(157,2,35,'Тойнук','Toýnuk','Toynuk','Тойнук–приспособление для закрепления вьюка на верблюде. При использовании данного приспособления и подпруги, груз более плотно прилегал к телу. XIX век.','Düýäniň arkasynda ýük berkitmek üçin ulanylýan gural. Şu gural bilen çeki ulanylan ýagdaýynda, ýük düýäniň arkasyna has berk saklanýar. XIX asyr.','Toynuk-device for fastening load pack on the camel. In use of this device and belly band, the load more closely laid on camel’s body. XIX century.',NULL,NULL,NULL,'public/exhibit-image/wASNqhr1Q0Q6bGZKIzOVtziVpilRBlq3SLLw1sTW.jpg',0,1,'2024-03-01 12:58:58','2024-03-01 12:58:58'),(158,2,0,'Чаша','Jam','Bowl','Традиционная медная чаша для продуктов питания. Имеет полусферическую форму, в нижней части к донцу приварена подставка. Поверхность покрыта растительным орнаментом, исполненная в технике гравировка. Конец XIX – начало ХХ веков.','Nahar we gök-önümleri salyp peýdalanmak üçin misden ýasalan hojalyk esbaby. Jam ýarym togalak görnüşinde ýasalyp, aşagy ýerde jaýlaşykly durar ýaly ýaýbaň, aýakly edilipdir. Onuň ýüzüne dürli ösümlik şekilleri bilen bezelipdir. XIX asyryň ahyry-XX asyryň başy.','Traditional copper bowl for victual. It has a hemispherical form, in the bottom is welded on a stand. The surface is covered by vegetable ornament made in in technique of engraving. XIX century.',NULL,NULL,NULL,'public/exhibit-image/Iulo7TyuL1PKRCfRkCYoPKqEHXrTdzInl2WcRK8g.jpg',0,1,'2024-03-01 13:00:27','2024-03-01 13:00:27'),(159,2,36,'Миска','Tabak','Bowl','Чаша для приёма пищи. Изготовлена из меди, для устойчивости к донцу припаяна опора круглой формы. Конец XIX – начало ХХ веков.','Içine iýmit önümleri salmak üçin ulanylan hojalyk esbaby. Ol misden, içi çukur, agzy giň görnüşde ýasalypdyr. Tabagyň aşagyna ýerde jaýlaşykly durar ýaly tegelek görnüşinde aýak edilipdir. XIX asyryň ahyry-XX asyryň başy.','Bowl for food. It is made of copper, to the bottom is soldered a stand of round form for steadiness. The end of the XIX - the beginning of the XX century.',NULL,NULL,NULL,'public/exhibit-image/U1nEw1lQu6FwiNTFRvcHJpN3dIWF4h1D8802c5Ca.jpg',0,1,'2024-03-01 13:02:07','2024-03-01 13:02:07'),(160,2,36,'Миска','Tabak','Bowl','Традиционная медная чаша для продуктов питания. Имеет полусферическую форму, в нижней части к донцу приварена подставка. Поверхность покрыта растительным орнаментом, исполненная в технике гравировка. Конец XIX – начало ХХ веков.','Içine iýmit önümleri salmak üçin ulanylan hojalyk esbaby. Ol misden, içi çukur, agzy giň görnüşde ýasalypdyr. Tabagyň daşky erňeginde arap ýazgylary bar. Onuň aşagy ýerde jaýlaşykly durar ýaly tekiz edilipdir. XIX asyryň ahyry-XX asyryň başy.','Traditional copper bowl for victual. It has a hemispherical form, in the bottom is welded on a stand. The surface is covered by vegetable ornament made in in technique of engraving. XIX century.',NULL,NULL,NULL,'public/exhibit-image/9PRmadnnpPZ11KBm2N5c7c1A6xd9mQwxjJfyKeYw.jpg',0,1,'2024-03-01 13:03:06','2024-03-01 13:03:06'),(161,2,36,'Миска','Tabak','Bowl','Чаша для приёма пищи. Изготовлена из меди, для устойчивости к донцу припаяна опора круглой формы. Поверхность оформлена декоративными кругами. Конец XIX – начало ХХ веков.','Içine iýmit önümleri salmak üçin ulanylan hojalyk esbaby. Ol metaldan, içi çukur, agzy giň görnüşde ýasalypdyr. Tabagyň erňegine aýlawly şekiller berlipdir. Onuň aşagy ýerde jaýlaşykly durar ýaly içi çuň, tegelek görnüşinde edilipdir. XIX asyryň ahyry-XX asyryň başy','Bowl for food. It is made of copper, to the bottom is soldered a stand of round form for steadiness. The surface is adorned with decorative circles. The end of the XIX - the beginning of the XX century.',NULL,NULL,NULL,'public/exhibit-image/HQ5dOCsn3RwfcgG7FPTVmrWkyRqMI7URflzd8hpc.jpg',0,1,'2024-03-01 13:04:37','2024-03-01 13:04:37'),(162,2,37,'Дунк','Düňk','Dunk','Дунк – бронзовый колокол для верблюда. Этот вид колокола вешалcя на шею ведущего верблюда в караване. Поверхность обычно украшалась стилизованными рельефами птиц и зверей. XIX век.','Düýäniň boýnuna dakylýan bürünçden jaň. Jaňyň bu görnüşi kerweni çekip barýan düýä dakylypdyr. Adatça ýüzi guş we haýwan şekilli güberçek nagyşlar bilen bezelipdir. XIX asyr.','Dunk - bronze bell for camel. This kind of bell was hung up on neck of leading camel in caravan. Its surface was adorned by stylized reliefs of birds and animals. XIX century.',NULL,NULL,NULL,'public/exhibit-image/YAPCeISW76tgTMhpiSuZyVVePFnQIQJWdgFFbD98.jpg',0,1,'2024-03-01 13:08:08','2024-03-01 13:08:08'),(163,2,37,'Джанг','Jaň','Djang','Джанг – медный колокольчик для мелкого скота. Этот вид колокольчика до сих пор используется местными пастухами, вешается на шею козлов. XIX век.','Misden ýasalyp, ownuk şahly mal üçin niýetlenen. Jaňyň bu görnüşi malyň boýnuna daňylyp, häzire çenli ýerli çopanlar tarapyndan ulanylýar. XIX asyr.','Djang – copper little bell for light beasts. This kind of bell is used by local shepherds up to now. It is hung up on the goat’s neck. XIX century.',NULL,NULL,NULL,'public/exhibit-image/ZF1toRGm7cYsfPeESYbXP5JHoHqODVrWq1sqKeen.jpg',0,1,'2024-03-01 13:09:11','2024-03-01 13:09:11'),(164,2,37,'Дювме','Düwme','Duvme','Дювме – бронзовый бубенчик для мелкого скота. Данный вид бубенчика встречается среди археологических находок XII-XIII веков.  XVII-XIX век.','Ownuk şahly mal üçin niýetlenen bürünç esbap. Şeýle görnüşli düwme XII-XIII asyrlara degişli bolan tapyndylaryň arasynda duş gelýär. XVII-XIX asyr.','Duvme – bronze bell for light beasts. This kind of bell occurs among archaeological finds of XII-XIII centuries. XVII-XIX centuries.',NULL,NULL,NULL,'public/exhibit-image/cQ1Bdr6eYykn6JFVaglTeAJFVUuo5brntk4YogD6.jpg',0,1,'2024-03-01 13:10:01','2024-03-01 13:10:01'),(165,2,58,'Колца для обсадки стен подземного водовода','Käriz örtügi','Ring for casing walls of underground water conduit','Части подземного водовода. Изготавливали методом обжига. При установкe пустоты вокруг забивались землёй и щебнем. Предохранял водовод от загрязнения, осыпей и обвалов. Начало XIX – конец ХХ веков.','Käriz gazylanda belli bir tertipde dikanalar gazylyp bolanson, iki dikanany ýeriň astyndan birleşdirýän ötük gazýarlar. Şol ötüge “söw” diýilýär. Ikinji bejeriş usuly  “güle” ýasamak. Şireli topragyň palçygyny mazaly eýläp, şol toýun palçykdan edil şu döwürdäki beton turbalar ýaly güle ýasap, kürede bişirýärler. Şol “güleleri” söwüň içinde biri-birine geýdirişdirip berkidýärler. Söw opurylsada “güläniň” içinden akýan suwa päsgel bermeýär. XIX asyryň ahyry XX asyryň başy.','Pieces of underground water conduit. It was made by means of burning of ce- ramic clay. During the installation the hollow space around it was filled with ground and crushed stone. It protected the water conduit from pollution, talus and collapse. End of the XIX – beginning of the XX century.',NULL,NULL,NULL,'public/exhibit-image/EzdzQXY43x44Ay08KRWFG8V9epOKDfOtT4xwIWul.jpg',0,1,'2024-03-13 16:42:37','2024-03-01 13:11:56'),(166,2,57,'Приспособление для приготовления ковровых нитей','Kelep agajy','Device for making carpet threads','Механизм для скручивания двух ниток в одну. Механизм состоит из деревянных деталей. Конец XIX – начало ХХ веков.','Zenanlaryň ikde egrilen ýüňi ýumak etmek üçin ulanan agaçdan ýasalan guraly. Kelep agajynda sapagy egrip bolanlaryndan soň, berklik üçin iki sany towly sapagy birleşdirlip towlanýar. Bu guralyň aşaky we ýokarky bölekleri atanak görnüşinde bolup, oňa dört sany agaç bölegi geýdirilip ýasalypdyr. XIX asyryň ahyry XX asyryň başy.','A device for twisting two threads in one. It consists of wood details. The end of the XIX - the beginning of the XX century.',NULL,NULL,NULL,'public/exhibit-image/F4WGL7p0IzYotSHeP7Y5V5V1gTSEcaS8ADnFw6RP.jpg',0,1,'2024-03-13 16:28:47','2024-03-01 13:21:58'),(167,2,38,'Набилки','Dessik','Dessik','Набилки – детали кустарного ткацкого станка. Конец  XIX – начало ХХ веков.','Tara daragynyň daşyna berkidilýän iki tarapy eltutarly, taranyň argajyny kakmak üçin ulanylýan senet. Garamtyl gyzyl agaçdan ýasalan, aşagy göniburç usulynda, ýokarky böleginiň merkezi üçburç, iki tarapy nädogry görnüşde edilipdir. Aşaky we ýokarky böleginde ýüp geçirip berkidiler ýaly deşik goýlupdyr. XIX asyryň ahyry XX asyryň başy.','Details of homemade weaver’s loom. End of the XIX – beginning of the XX century.',NULL,NULL,NULL,'public/exhibit-image/DOtNegqIh10kzg6R3C2BcHC32z8EE7H9R32ZiOU4.jpg',0,1,'2024-03-01 13:28:09','2024-03-01 13:28:09'),(168,2,38,'Пришвица','Nöwert','Nowert','Пришвица – деталь кустарного ткацкого станка. Конец  XIX – начало ХХ веков.','Tarada dokalýan matanyň oralýan togalak agajy. Nöwert gulakçöp arkaly towlanýar we dokalan mata onuň daşyna oralýar. Nöwerdiň deşilen ýerinde gulakçöpi durýar. XIX asyryň ahyry XX asyryň başy.','Detail of homemade weaver’s loom. End of the XIX – beginning of the XX century.',NULL,NULL,NULL,'public/exhibit-image/AqTHYdIDFwVWY3oyDHj7lPYFGZp6TyzRRJTdYZL3.jpg',0,1,'2024-03-01 13:29:04','2024-03-01 13:29:04'),(169,2,38,'Бердо','Gylyç','Gylych','Бердо – деталь кустарного ткацкого станка. Конец  XIX – начало ХХ веков.','Gulaç, dolak ýaly ýüň önümleri dokalanda argajy kakmak üçin gylyja meňzedilip agaçdan ýasalan dokma guraly. Oňuň argajy kakýan tarapy ýuka, arka tarapy hem galyň görnüşde ýasalypdyr. Gylyjyň uç tarapy iki erşiň arasyndan aňsatlyk bilen geçer ýaly uçly bolýar. XIX asyryň ahyry XX asyryň başy.','Detail of homemade weaver’s loom. End of the XIX – beginning of the XX century.',NULL,NULL,NULL,'public/exhibit-image/1jYc6TwdYSKNkvlkRnrwnNHaeI0xrixvupxrD4ht.jpg',0,1,'2024-03-01 13:30:01','2024-03-01 13:30:01'),(170,2,38,'Аргач','Argaç','Argach','Ниты – детали кустарного ткацкого станка. Конец  XIX – начало ХХ веков.','Tara dokmasynyň üzüňňisi basylanda, dokmanyň erşiniň arasyny açmaga hyzmat edýän gamyşdan ýasalan gural, ol iki sany bolýar. XIX asyryň ahyry XX asyryň başy.','Details of homemade weaver’s loom. End of the XIX – beginning of the XX century.',NULL,NULL,NULL,'public/exhibit-image/bhFji9Ngloojx2R2hkHQkO0UqzkL5hEvbGUfLRoa.jpg',0,1,'2024-03-01 13:30:52','2024-03-01 13:30:52'),(171,2,38,'Ниты','Güle','Gule','Деталь кустарного ткацкого станка. Конец  XIX – начало ХХ веков.','Tara dokalanda matanyň syk bolmagy üçin ulanylýan agaçdan ýasalan gural. Bu gural dessik bilen bile işledilýär. XIX asyryň ahyry XX asyryň başy.','Detail of homemade weaver’s loom. End of the XIX – beginning of the XX century.',NULL,NULL,NULL,'public/exhibit-image/LLB5uZwRIVo8xgoreDZBs8xWFw3xU4G2kGtb42ET.jpg',0,1,'2024-03-01 13:31:43','2024-03-01 13:31:43'),(172,2,39,'Кундук','Kündik','Kundik','Традиционный медный кувшин для умывания рук. Имеет вытянутое горлышко и узкий длинный носик, в нижней части к донцу приварена подставка. С боков на тулове декоративные рельефные украшения в форме листа. Конец XIX – начало ХХ веков','El-ýüz ýuwmak üçin ulanylan, jüründikli, el tutarly, gapakly suw guýulýan öý hojalyk esbaby. Kündük misden ýasalyp, daşy galaýy bilen agardylypdyr. Aşagy ýerde jaýlaşykly durar ýaly tegelek görnüşinde aýak edilipdir. Boýny inçeden uzyn, jüründigi egreldilip ýasalypdyr. Kündügiň ýüzüne güberçek görnüşli halkalar berlipdir. XIX asyryň ahyry-XX asyryň başy.','Traditional copper jug for washing hands. It has oblong mouth and narrow long spout, in the bottom is welded on a stand. On the sides there are decorative relief adornments in the form of leaf. End of the XIX – beginning of the XX century.',NULL,NULL,NULL,'public/exhibit-image/XpSdulHExf99zkDLn0AZCX9cEVJ52lo3TLA0sYuI.jpg',0,1,'2024-03-01 13:35:37','2024-03-01 13:35:37'),(173,2,39,'Тунче','Tüňçe','Tunсhe','Сосуд для кипячения воды. Изготовлен из меди, сбоку имеется ручка а на венчике слив. Шейка усилена валиком. В нижней части для большей устойчивости имеется подставка. Конец XIX – начало XX веков.','Çaý, suw gaýnatmakda ulanylan hojalyk esbaby. Tüňçe metaldan armyt şekilinde ýasalyp, onuň bokurdagynyň gapdalynda gulpy bar. Tüňçäniň ýüzüne güberçekli halkalar geçirlipdir. Aşagy ýerde jaýlaşykly durar ýaly tegelek görnüşinde aýak edilipdir. XIX asyryň ahyry-XX asyryň başy.','A vessel for water boiling. It is made of copper,  from one side is a handle and outlet on a collar.  Neck is strengthened with roll. To the bottom is soldered a stand of round form for steadiness. The end of the XIX - the beginning of the XX century.',NULL,NULL,NULL,'public/exhibit-image/coAjPvjCQIyosvELyLdAhollr1iiuYMHmqv6WMHi.jpg',0,1,'2024-03-01 13:36:56','2024-03-01 13:36:56'),(174,2,39,'Мытара','Mytara','Mytara','Походная фляжка для хранения воды. Изготовлен из меди, с боков имеется петли для подвеса. В нижней части для большей устойчивости имеется подставка. Конец XIX – начало XX веков.','Içine suw guýlup, ýanyň bilen göterilen durmuş esbaby. Mytara metaldan, bokurdakly, bokurdagynyň ýanynda halkaly edilip ýasalypdyr. Aşagy ýerde jaýlaşykly durar ýaly tegelek görnüşinde aýak edilipdir. Mytarany, esasanam, ýolagçylar ýola gidenlerinde ýanlary bilen göteripdirler. XIX asyryň ahyry-XX asyryň başy.','Flask for keeping water on march. It is made of copper, there are loops from both sides for hanging. There is a stand in the bottom for steadiness. The end of the XIX - the beginning of the XX century.',NULL,NULL,NULL,'public/exhibit-image/RhVVqv37z4sigFxUEGfogneTgszNATGyfv7sTd4V.jpg',0,1,'2024-03-01 13:37:59','2024-03-01 13:37:59'),(175,2,40,'Галамдан сыядан','Galamdan we syýadan','Galamdan we syyadan','Пенал для хранения принадлежностей для письма, с припаянной сбоку чернильницей. С одного бока имеется надпись на еврейском алфавите, с другого изображения птиц, животных и человека. Всё оформление исполнено в технике гравировка. XVIII век.','Galamdan – galam salmak üçin niýetlenip, latundan ýörite gapaklyja, ýasalan esbap. Galamdan, syýa salmak üçin niýetlenen syýadan bilen bir bitewi ýasalypdyr. Onuň ýüzünde ýazgylar we dürli jandarlaryň şekilleri haşamlanypdyr. XVIII asyr.','Pencil box for keeping writing materials, with an ink pot welded on one side. There is an inscription in Jewish alphabet on one side, on the other - pictures of birds, animals and man. All the design is made in technique of engraving. XVIII century.',NULL,NULL,NULL,'public/exhibit-image/PBXRkZWWfQYnLTEBGmjINP8pFzJ6gbAZq9TSqBoP.jpg',0,1,'2024-03-01 13:39:48','2024-03-01 13:39:48'),(176,2,40,'Чиликалит','Çilkalit','Chilkalit','Магическая чаша для гадания и лечения. Имеет полусферическую форму, в нижней части к донцу приварена подставка. Во внутренней части в центре имеется полусферический выступ. Поверхность покрыта гравированным орнаментом, текстами магического содержания и изображениями знаков зодиака. Использовались местными лекарями и дервишами. XVIII век.','Tebipçilik etmek üçin ulanylan gap. Gap ýarym togalak görnüşinde ýasalyp, içi keramatly ýazgylar bilen bezelipdir. Aşagy ýerde jaýlaşykly durar ýaly ýaýbaň, tekiz edilipdir. Onuň içiniň aşaky böleginde güberçek şekili bar. Gabyň daşky ýüzi keramatly ýazgylar we müçenamalaryň şekilleri bilen çyzma usulynda haşamlanypdyr. Çilkalit ýerli tebipler we derwüşler tarapyndan ulanylypdyr. XVIII asyr.','Magic bowl for a guessing and treatment. It has a hemispherical form, in the bottom   there is welded on a support. In the inside in the centre there is a hemispherical ledge. The surface is covered by the engraved ornament, texts of the magic contents and zodiacal signs. It was used by local doctors and дервишами. XVIII century.',NULL,NULL,NULL,'public/exhibit-image/4eWXGtLbkEYhgOSMQC9P2hCWI5bIqRNwG1egLgEf.jpg',0,1,'2024-03-01 13:40:44','2024-03-01 13:40:44'),(177,2,40,'Меджиме','Mejime','Mejime','Традиционный медный поднос предназначен для подачи различных блюд и напитков, меньшего размера. Имеет круглую и плоскую форму, края усилены гофрами. Внутренняя поверхность покрыта гравированным геометрическим орнаментом. Конец XIX – начало ХХ веков.','Göwrümi kiçiräk mejime. Içine nahar we beýleki önümleri goýmak üçin niýetlenip, metaldan ýasalan hojalyk esbaby. Mejime ýalpak görnüşinde ýasalyp, onuň iç ýüzünde oýma çyzykly aýlawlar aýlanypdyr. Erňegine aýlawly şekiller berlipdir. XIX asyryň ahyry-XX asyryň başy.','A little bit smaller traditional copper tray for delivery of various dishes and drinks. It has a round and flat form, the edges are strengthened by goffer. The inner surface is covered with engraved geometrical pattern. End of the XIX – beginning of the XX century.',NULL,NULL,NULL,'public/exhibit-image/7WPQ0ubLqUaJxlXTnHEXgXYqdn7OPjGpuFz1QDwM.jpg',0,1,'2024-03-13 15:41:46','2024-03-01 13:41:56'),(178,2,40,'Меджиме','Mejime','Mejime','Традиционный медный поднос предназначен для подачи различных блюд и напитков. Имеет круглую и плоскую форму, края усилены гофрами. Внутренняя поверхность покрыта гравированным геометрическим и растительным орнаментом. Конец XIX – начало ХХ веков.','Içine nahar we beýleki önümleri goýmak üçin niýetlenip, metaldan ýasalan hojalyk esbaby. Mejime ýalpak görnüşinde ýasalyp, onuň iç ýüzi çyzma usulynda ýerine ýetirilen “goçak”, “ösümlik”, geometrik şekiller bilen haşamlanypdyr. Erňegine aýlawly şekiller berlipdir. XIX asyryň ahyry-XX asyryň başy.','Traditional copper tray for delivery of various dishes and drinks. It has a round and flat form. The edges are strengthened by goffer. The inner surface is covered with geometrical and vegetable patterns. End of the XIX – beginning of the XX century.',NULL,NULL,NULL,'public/exhibit-image/abBTXUwzOpC8Hqdz0xn4iaws33RpusT8dbyB0Tma.jpg',0,1,'2024-03-13 15:42:13','2024-03-01 13:42:45'),(179,2,41,'Ок гуты','Ok guty','Ok guty','Ок гуты–кожаная ёмкость для пуль, часть снаряжения охотника. Вмещает в себя 10-15 свинцовых пуль, носилась на ружейном поясе. Могли использовать как охотники, так и пешие воины-стрелки. XIX век.','Deriden ýasalan awçynyň esbaby. Içine 10-15 sany gurşundan ok sygyp, awçynyň kemerine dakylýar. Awçylar we pyýada atyjy goşunlar ulanypdyrlar. XIX asyr.','Ok guty–leather case for bullets, a part of hunter’s equipment. It contains 10-15 lead bullets, was carried on a gun belt. They could be used both by hunters, and by the unmounted riflemen. XIX century.',NULL,NULL,NULL,'public/exhibit-image/G6AI5rzwqD60ZDGjOKEcQGMXuQcJ1PjJljbtGiaB.jpg',0,1,'2024-03-01 14:05:33','2024-03-01 14:05:33'),(180,2,41,'Дяри гуты','Däri guty','Dari guty','Дяри гуты–кожаная ёмкость для пороха (пороховница), часть снаряжения охотника. Вмещала в себя необходимое количество пороха, необходимое для одной охоты, носилась на ружейном поясе. Сама ёмкость изготавливалась из кожи, а верхняя часть из трубчатой кости. Могли использовать как охотники, так и пешие воины-стрелки. XIX век.','Içine däri salynýan awçynyň esbaby. Awçynyň kemerine dakylyp, içine bir gezek awda ulanmak üçin däri sygypdyr. Gabyň özi deriden, ýokarky bölegi haýwanyň süňkünden ýasalypdyr. Awçylar we pyýada atyjy goşunlar ulanypdyrlar. XIX asyr.','Dari guty–leather case for gunpowder (powder flask), a part of hunter’s equipment. It contained the necessary quantity of gunpowder for one hunting, was carried on a gun belt. The case was made of leather, and the top was made of a tubular bone. It could use both by hunters, and by the unmounted riflemen. XIX century.',NULL,NULL,NULL,'public/exhibit-image/5WKaiFUe3ahdnNCEz6XnefevMoGrTYOKWzMcs3da.jpg',0,1,'2024-03-01 14:06:33','2024-03-01 14:06:33'),(181,2,41,'Кисе','Kise','Kise','Кисе–кожаный подсумок для походных мелочей, часть снаряжения охотника. В подсумке обычно хранились нитки с иголкой, небольшое количество жира для смазки и капсюля. Использовали как охотники, так и пешие воины-стрелки. XIX век.','Gaýyşdan ýasalan awçynyň enjamy, peşeň we ýörüş üçin gerek bolan ownuk-uşak zatlar salynýan haltajyk. Kisäniň içine iňňe-sapak, çalmak üçin az-owlak ýag salnypdyr. Awçylar we pyýada atyjy goşunlar ulanypdyrlar. XIX asyr.','Kise–hunter’s cartridge pouch for marching small things, a part of hunter’s equipment. In cartridge pouch were usually stored threads with a needle, a small quantity of fat for greasing and a cap. It was used both by hunters and by the unmounted riflemen. XIX century.',NULL,NULL,NULL,'public/exhibit-image/pcQWYypEqtItyFZi7c2J8VNirfLjZg2R74SxLH35.jpg',0,1,'2024-03-01 14:07:40','2024-03-01 14:07:40'),(182,2,41,'Серкеч','Serkeç','Serkech','Серкеч–кожаная ёмкость для хранения фарфоровой пиалы, часть походного снаряжения воина. В прошлом пиала была дорогой посудой, и что бы его сохранить в суровых условиях походной жизни применялся вот такой специальный чехол. Обычно внешняя сторона оформлялась различными узорами. При длительных конных переходах подвешивалась к передней луке седла. XIX век.','Deriden ýasalyp içine käse salynýan gap, esgeriň ýöriş esbaby. Ýörişe gidilende döwülmezlik üçin ulanylýan daşlyk. Serkejiň daşy köplenç dürli nagyşlar bilen bezelipdir. Uzak ýola gidilende atyň eýeriniň gaşyndan asylypdyr. XIX asyr.','Serkech–leather case for porcelain drinking bowl, a part of a soldier’s equipment. In the past a drinking bowl was expensive ware and such special case was used to keep in severe conditions of a camp life. Usually the outer side was adorned by various patterns. In long horse passages it was hung up to a front arch of a saddle. XIX century.',NULL,NULL,NULL,'public/exhibit-image/ig0BybxlF5hvDYqXurn6O2nViVv86cZPRCkcvV5b.jpg',0,1,'2024-03-01 14:08:38','2024-03-01 14:08:38'),(183,2,41,'Демрен','Demren','Demren','Демрен–медные наконечники для стрел. Наконечники изготавливали при помощи отливки и ковки. В охоте употреблялись различные виды. Были распространены по всей территории Туркменистана. XVIII-XIX века.','Guýma we süýme usulynda misden ýasalan peýkam okunyň ujy. Awçylykda dürli görnüşleri ulanylypdyr. Türkmenistanyň ähli ýerlerinde ýaýran. XVIII-XIX asyrlar.','Demren–copper arrowheads. Arrowheads were made by means of casting and smithery. In hunting were used various kinds. They were spread in all the territory of Turkmenistan. XVIII-XIX centuries.',NULL,NULL,NULL,'public/exhibit-image/PyhcLlYfqwOsi2V1UrqtPvj0WvoLo5fvpkFYxs8P.jpg',0,1,'2024-03-01 14:09:25','2024-03-01 14:09:25'),(184,2,41,'Галып','Galyp','Galyp','Галып–каменные формы для отливки свинцовых пуль. Форму изготавливали из огнеупорного камня стеатита. Данная форма предназначена для отливки одной пули, встречались формы в которых можно было одновременно отлить до десяти пуль. XIX век.','Gurşun oklary guýmak üçin daşdan ýasalan enjam. Galyp oda çydamly steatit daşyndan ýasapdyrlar. Bu galyp bir ok ýasamak üçin niýetlenen, emma bir wagtda on sany ok guýmak üçin galyplar hem duş gelýär. XIX asyr.','Galyp–stone forms for bullets casting. The form was made of a fireproof stone staetite. This form was intended for casting of one bullet, there were forms, in which it was possible to cast simultaneously up to ten bullets. XIX century.',NULL,NULL,NULL,'public/exhibit-image/e6Pz3WfmGecsrlLeX8ljoKwf9IxpHUw2ZRhAIL7i.jpg',0,1,'2024-03-01 14:10:13','2024-03-01 14:10:13'),(185,2,42,'Миски','Agaç okaralar','Bowls','Чаши для приёма пищи. Изготавливается из цельного куска дерева карагач или ива, при помощи примитивного токарного станка. Конец XIX – начало ХХ веков.','Ýogyn güjüm, garagaç agaçlardan tegelenip kesilip, içi oýulyp, daşy ýylmanyp ýasalan hojalyk esbaby. Onuň aşagy ýerde jaýlaşykly durar ýaly ýaýbaň bolýar. Okaralar ululy kiçili bolup, öý hojalygynda naharlary goýmakda ulanylypdyr. XIX asyryň ahyry XX asyryň başy.','Bowls for food. They are made of unitary block of karagach or willow tree, with the help of primitive lathe. The end of the XIX - the beginning of the XX century.',NULL,NULL,NULL,'public/exhibit-image/MgCUT857D43ViZyCoVgjhvzNTtq8mx9FLTYlGk75.jpg',0,1,'2024-03-01 14:12:44','2024-03-01 14:12:44'),(186,2,42,'Керсен – чаша','Agaç kersenler','Kersen – bowl','Чаши для приготовления теста. Изготавливались из цельного куска ивового дерева при помощи примитивного токарного станка. Конец XIX – начало ХХ веков.','Ýogyn söwüt agajynyň düýbünden tegelenip kesilip alnyp, içi oýulyp, daşy ýylmanyp ýasalan hojalyk esbaby. Onuň aşagy ýerde jaýlaşykly durar ýaly ýaýbaň bolýar. Hamyr ýugurmak üçin ulanylan gap. XIX asyryň ahyry XX asyryň başy.','Boils for dough. They were made of unitary block of willow tree, with the help of primitive lathe. The end of the XIX - the beginning of the XX century.',NULL,NULL,NULL,'public/exhibit-image/Xmc5JR8xDTY3YsH8gnpjUwJLkU3YrHXT6HcQC7X5.jpg',0,1,'2024-03-01 14:13:39','2024-03-01 14:13:39'),(187,2,42,'Сокы – ступка','Soky','Soky – mortar','Сосуд-ступка для очищения риса и толчения зерна. Изготавливается из твёрдых пород дерева. Работы производятся при помощи песта. Конец XIX – начало ХХ веков.','Şalynyň gabygyny aýyrmak, bugdaý, jöwen ýaly dänelerden ýarma ýarmak üçin, berk agaçdan içi oýulyp ýasalan hojalyk esbaby. Onuň aşagy ýerde jaýlaşykly durar ýaly ýaýbaň bolýar. Soky soky daşy bilen urlup işledilýär. XIX asyryň ahyry XX asyryň başy.','Vessel-pestle for cleaning rice and crushing grain. It is made of hard sorts of wood. The work is carried out by means of the pestle. The end of the XIX - the beginning of the XX century.',NULL,NULL,NULL,'public/exhibit-image/05NB2Chsstaf4xhGkF0cR2zj5ZmNt4dBdBvPn1Dj.jpg',0,1,'2024-03-13 15:14:51','2024-03-01 14:16:42'),(188,2,43,'Атaшгир','Ataşgir','Atashgir','Атaшгир – инструмент из железа для перемещения горящих дров и углей в топке печи. Использовался повсеместно на всей территории Центральной Азии. XIX век.','Ýanyp duran oduny we közi süýşürmek üçin ulanylýan demirden ýasalan esbap. Merkezi Aziýanyň ähli ýerlerinde ulanylypdyr. XIX asyr.','Atashgir - iron instrument for moving of burning firewood or carbons in furnace. It is used everywhere in the Central Asia. XIX century.',NULL,NULL,NULL,'public/exhibit-image/7j44UwidbDHVQsSB7a9ceIdEAIBwN1gXerlP2JkL.jpg',0,1,'2024-03-01 14:20:23','2024-03-01 14:20:23'),(189,2,43,'Аммыр','Ammyr','Ammyr','Аммыр – круглогубцу, обжитка кузнечные клещи. Использовался для удержания раскаленного металла при металлообработке. Кузнец в одной руке держал клещи с горячей заготовкой, другой рукой молотком ковал это железо. XIX век.','Metal işläp bejerilende gyzgyn metaly saklamaklyk üçin ulanylan gural. Demirçi ussa bir elinde atagza berkidilen gyzgyn demiri saklap, beýleki eli bilen metaly çekiçläp süýüpdir. XIX asyr.','Ammyr - blacksmith\'s pincers. It was used for holding of red-hot metal while working. Blacksmith held in one hand pincers with hot workpiece and hammered it by the other hand. XIX century.',NULL,NULL,NULL,'public/exhibit-image/aEWjLWTPNI5dIlZeZwvD9B5KnrlCdbKg5liE16gO.jpg',0,1,'2024-03-01 14:21:16','2024-03-01 14:21:16'),(190,2,43,'Чекич','Çekiç','Chekich','Чекич – кузнечный молоток. Это специальный вид молотка использовался кузнецами при работе с подковами. Распространён повсеместно на всей территории Центральной Азии. XIX век.','Çekiç. Çekijiň ýörite nal kakmaklyk üçin niýetlenilen görnüşi. Merkezi Aziýanyň ähli ýerlerine ýaýran. XIX asyr.','Chekich - blacksmith\'s hammer. It is a special kind of hammer was used by blacksmith when he hammered horseshoes. It is spread everywhere in the Central Asia. XIX century.',NULL,NULL,NULL,'public/exhibit-image/TGJyFGa1NEGO3mTZSwYr5hWfUUMTGxTYJU6hlFA5.jpg',0,1,'2024-03-01 14:22:08','2024-03-01 14:22:08'),(191,2,43,'Галам','Galam','Galam','Галам – железное зубило. Кузнец использовал его при рубке крупных кусков метала. Для более мелких работ применялось зубило меньшего размера. XIX век.','Demirçi ussa ony uly göwrümli metallary bölmekde ulanypdyr. Has ownuk işlerde galamyň kiçi görnüşleri ulanylypdyr. XIX asyr.','Galam – iron chisel. Blacksmith used it while chopping big pieces of metal. For chopping of small pieces of metal was used small chisel. XIX century.',NULL,NULL,NULL,'public/exhibit-image/jsv30kGesdSnRhsrb7WFg2NnKJlImspIMfTy833L.jpg',0,1,'2024-03-01 14:22:58','2024-03-01 14:22:58'),(192,2,44,'Половник','Susak','Ladle','Традиционный медный ковш. Имеет полусферическую форму, сбоку приварена рукоятка. На поверхности рукоятки геометрический орнамент, исполненная в технике гравировка. Конец XIX – начало ХХ веков.','Ýarym togalak görnüşinde misden ýasalan, uzyn saply hojalyk esbaby. Susagyň sapy çyzma usulynda pişme şikilleri bilen bezelipdir. Onuň bilen nahar gazandan okaralara guýulupdyr. XX asyryň başy.','Traditional copper dipper. It has a hemispherical form, from one side is welded on a handle. There is a geometrical ornament made in made in in technique of engraving. End of the XIX – beginning of the XX century.',NULL,NULL,NULL,'public/exhibit-image/vUR5yB9LeXkhPjCLRFSJE60kHWcfFei05y5wRpyl.jpg',0,1,'2024-03-01 14:24:26','2024-03-01 14:24:26'),(193,2,44,'Кундук','Kündük','Jug','Традиционный медный кувшин для умывания рук. Имеет вытянутое горлышко и узкий длинный носик, в нижней части к донцу приварена подставка. С боков на тулове декоративные рельефные украшения в форме листа. Конец XIX – начало ХХ веков.','El-ýüz ýuwmak üçin misden ýasalan, jüründikli suw guýulýan gap. Aşagy ýerde jaýlaşykly durar ýaly tegelek görnüşinde aýak edilipdir. Boýny inçeden uzyn, jüründigi egreldilip ýasalypdyr. Kündügiň ýüzüne güberçek görnüşli ýaprak şekili berlipdir. XIX asyryň ahyry-XX asyryň başy.','Traditional copper jug for washing hands. It has oblong mouth and narrow long spout, in the bottom is welded on a stand. On the sides there are decorative relief adornments in the form of leaf. End of the XIX – beginning of the XX century.',NULL,NULL,NULL,'public/exhibit-image/vO7VQthdoDt58Fu9rTnB1wAAfXNiMrUkFzR1M3WP.jpg',0,1,'2024-03-01 14:25:16','2024-03-01 14:25:16'),(194,2,44,'Казан','Gazan','Сauldron','Традиционный медный казан для приготовления пищи. Имеет форму усечённого конуса, в нижней части к донцу приварена подставка. Поверхность покрыта гравированным орнаментом. Конец XIX – начало ХХ веков.','Nahar bişirmek üçin misden ýasalan hojalyk esbaby. Gazan silindr görnüşinde ýasalyp, agzy ýaýbaň, giň edilipdir. Aşagy ýerde jaýlaşykly durar ýaly tegelek görnüşinde aýak edilipdir. Onuň ýüzüne halka şekilleri çyzma usulynda bezelipdir. XIX asyryň ahyry-XX asyryň başy.','Traditional copper cauldron for cooking. It has a form of truncated cone, in the bottom is welded on a stand. The surface is covered by engraved ornament. End of the XIX – beginning of the XX century.',NULL,NULL,NULL,'public/exhibit-image/5vZlnfnL1r4ZVRAZaLrfXde51mBx3hP871SRSuKH.jpg',0,1,'2024-03-01 14:25:56','2024-03-01 14:25:56'),(195,2,44,'Казан','Gazan','Сauldron','Традиционный медный казан для приготовления пищи. Имеет полусферическую форму, в нижней части к донцу приварена подставка. Конец XIX – начало ХХ веков.','Nahar bişirmek üçin misden ýasalan hojalyk esbaby. Jam ýarym togalak görnüşinde ýasalyp, aşagy ýerde jaýlaşykly durar ýaly ýaýbaň edilipdir. XIX asyryň ahyry-XX asyryň başy.','Traditional copper cauldron for cooking. It has a hemispherical form, in the bottom is welded on a stand.   End of the XIX – beginning of the XX century.',NULL,NULL,NULL,'public/exhibit-image/mfeLgEzjlDVLNrezpZbjUdOatvx4luwiJPhvdT6d.jpg',0,1,'2024-03-01 14:26:52','2024-03-01 14:26:52'),(196,2,44,'Сито','Süzgüç','Sieve','Традиционный медный дуршлаг предназначен для отделения жидкости от твёрдых веществ. Имеет полусферическую форму, на донце множество отверстий. Для удобства в использовании в верхней части имеется отогнутый край. Конец XIX – начало ХХ веков.','Suwuklygy süzmek, arassalamak üçin ownuk gözli metaldan ýörite ýasalan hojalyk esbaby. Süzgüç tabak görnüşinde ýasalyp, içi hatara düzülen ownuk deşiklerden durýar. Onuň agzy götermäne amatly bolar ýaly aýlawly edilipdir. XIX asyryň ahyry-XX asyryň başy.','Traditional copper colander is intended for separation of liquid from solid substances. It has a hemispherical form; there are many holes in the bottom. There is a bent edge for comfortable use. End of the XIX – beginning of the XX century.',NULL,NULL,NULL,'public/exhibit-image/hiEznmGowpdVa8Vu9fz8jFC4f7seWP8PgqCcXCy4.jpg',0,1,'2024-03-01 14:27:43','2024-03-01 14:27:43'),(197,2,44,'Ступка с пестиком','Soky we sokudaş','Mortar with pestle','Ступка с пестиком, предназначенa для толчения и растирания твёрдых специй. Имеет форму усечённого конуса, в нижней части к донцу приварена подставка. Конец XIX – начало ХХ веков.','Soky – içine salnan önümi owradar, döwer ýaly metaldan içi oýulan görnüşde ýasalan hojalyk esbaby. Aşagy ýerde jaýlaşykly durar ýaly tegelek görnüşinde aýak edilipdir. Onuň içinde hem önümi owratmak, döwmek üçin ujy tommaýly, süýri metaldan ýasalan gural bar. Bu gurala sokudaşy diýilýär. XX asyr.','Mortar with pestle is intended for crushing and grinding solid substances. It has a form of truncated cone, in the bottom is welded on a stand. End of the XIX – beginning of the XX century.',NULL,NULL,NULL,'public/exhibit-image/1o4JxS7i2hO9OkQjF2R92uhmOvXpp1Q1486WdY9Y.jpg',0,1,'2024-03-01 14:28:43','2024-03-01 14:28:43'),(198,2,0,'Сундук','Oýma sandyk','Box','Оригинальный сундучок для хранения различных мелочей. Изготовлен из цельного куска дерева на токарном станке. Крышка соединяется с туловом при помощи металической цепи. Конец XIX – начало XX веков.','Sandyk berk agaçdan netjarçy ussalar tarapyndan armyt şekilinde, ýonulyp ýasalypdyr. Sandyk iki bölek, ýagny gapakdan we esasdan ybarat bolup, gapak açylyp-ýapylar ýaly zynjyrlary, halkalary, tutawajy metaldan edilipdir. Onuň aşagy ýerde jaýlaşykly durar ýaly ýaýbaň ýasalypdyr. XIX asyryň ahyry XX asyryň başy.','Original box for keeping various small things. It is made of unitary block of wood on lathe. The cover is connected with a box by means of metal chain. The end of the XIX - the beginning of the XX century.',NULL,NULL,NULL,'public/exhibit-image/vrCLnnueEUcAsTs6VYJ6Dg0XhB8digYfdolB0DQf.jpg',0,1,'2024-03-01 14:30:15','2024-03-01 14:30:05'),(199,2,58,'Гор кузе','Gor küýze','Gor kuyze','Керамический сосуд для хранения напитка из верблюжьего молока. Имеется четыре ручки, вся верхняя часть окрашена зелёной глазурью. Конец XIX – начало ХХ веков','Düýe süýdünden çal tutmakda ulanylan toýundan küýze. Küýze dört gulply ýasalypdyr. Onuň agzy we gulplary ýaşyl reňkde syrçalanypdyr. XIX asyryň ahyry XX asyryň başy.','Ceramic vessel for keeping drink made of camel’s milk. It has four handles, the top is painted with green glaze. The end of the XIX - the beginning of the XX  century.',NULL,NULL,NULL,'public/exhibit-image/JVRaHlSN2INn8eexEVf7JenghJKPORADoQuwbp3p.jpg',0,1,'2024-03-13 16:39:53','2024-03-01 14:31:24'),(200,2,58,'Мельничный Жёрнов','Haraz degirmen daşy','Millstone','Каменный жернов от водяной мельницы. Внешняя сторона оформлена изображением шестиконечной звезды. XVIII – XIX века.','Kilwanlar bugdaýdan un almak üçin harazlarda suwuň we malyň kömegi bilen işledilen, daşdan ýasalan zähmet guraly. Bu degirmen daşynyň üstki bölegi bolup, onuň merkezindäki deşiginiň töweregine altyburçluk şekili, gyralaryna ýazgylar berlipdir. Guralyň merkezindäki deşige bugdaý guýlupdyr. Degirmeniň daşlaryna “paý” diýlipdir. XVIII - XIX asyr.','Millstone of watermill. The outer side is adorned with picture of hexagram. XVIII – XIX centuries.',NULL,NULL,NULL,'public/exhibit-image/phSdalqO8Y6KI2p1HhbYevpo1kPJYEVJB56KD5yT.jpg',0,1,'2024-03-13 16:40:23','2024-03-01 14:32:30'),(201,2,58,'Гор кузе','Gor küýze','Gor kuyze','Керамический сосуд для хранения напитка из верблюжьего молока. Имеется четыре ручки, вся верхняя часть окрашена зелёной глазурью. Конец XIX – начало ХХ веков.','Düýe süýdünden çal tutmakda ulanylan toýundan küýze. Küýze üç gulply ýasalyp, tolkun şekilleri bilen haşamlanypdyr. Onuň agzy ýaşyl reňkde syrçalanypdyr. XIX asyryň ahyry XX asyryň başy.','Ceramic vessel for keeping drink made of camel’s milk. It has four handles; the top is painted with green glaze. The end of the XIX - the beginning of the XX  century.',NULL,NULL,NULL,'public/exhibit-image/EGQY5ezpClbsrBG9s92Gmnaln5Jn7qY7f1wivUxu.jpg',0,1,'2024-03-13 16:39:03','2024-03-01 14:33:41'),(202,2,45,'Гайчи–ножницы','Gaýçy','Gaychy-scissors','Гайчи–ножницы с чехлом. Традиционные ножницы выковывались местными кузнецами. Для лучшей сохранности хранились в кожаных чехлах. XIX век.','Gaýçy. Gaby bilen. Bu adaty gaýçylar ýerli demirçi ussalar tarapyndan ýasalypdyr. Zaýalanmazlygy üçin gaýyşdan tikilen gaplarda saklanypdyr. XIX asyr.','Gaychy-scissors with case. Traditional scissors were hammered by local blacksmiths. It was kept in leather case for safety. XIX century.',NULL,NULL,NULL,'public/exhibit-image/oCDLflK0l359rFAOTzLjVMYtqGQfDQPdlPkfYP7q.jpg',0,1,'2024-03-01 14:35:07','2024-03-01 14:35:07'),(203,2,45,'Пяки–бритва','Päki','Pyaki–razor','Пяки–бритва. Традиционная туркменская бритва изготавливалась из закалённой стали, ручка деревянная. Распространена на всей территории Туркменистана. XIX век.','Türkmen päkisi taplanan polatdan ýasalan, tutawajy agaçdan. Türkmenistanyň ähli çäklerine ýaýrapdyr. XIX asyr.','Pyaki–razor. Traditional Turkmen razor was made of hardened steel, handle was made of wood. It is spread everywhere in the territory of Turkmenistan. XIXcentury.',NULL,NULL,NULL,'public/exhibit-image/w5L5cYJRkz4uFzFILYZlENvntkVrgxZEgenG5FEr.jpg',0,1,'2024-03-01 14:36:09','2024-03-01 14:36:09'),(204,2,45,'Пычак–ножи','Pyçak gyny bilen','Pychak–knives','Пычак–ножи с ножнами. Данный вид ножей носился мужчинами за поясом. Клинок изготавливали из закалённой стали, рукоять из кости или рога. Ножны обычно были кожаные, богатые позволяли себе из серебра. XIX век.','Şeýle görnüşli pyçagy ýigitler guşagynda göteripdir. Pyçagyň tygy taplanan polatdan, sapy bolsa süňkden ýa-da malyň şahyndan ýasalypdyr. Gyny adatça deriden ýasalypdyr, ýöne gurply adamlar özleri üçin kümüşden ýasadypdyrlar. XIX asyr.','Pychak–knives with sheath. This kind of knives was carried by men in belt. A knife was made of hardened steel, handle was made of bone of horn. Sheath usually was made of leather, rich men has sheath made of silver. XIX century.',NULL,NULL,NULL,'public/exhibit-image/LCIKOSML6zO0yZDTx9nK9NY3GQAllFldv3gLHaJt.jpg',0,1,'2024-03-01 14:37:25','2024-03-01 14:37:25'),(205,2,45,'Пычак–небольшие ножи с ножнами','Pyçak-uly bolmadyk pyçaklar gyny bilen','Pychak–small knives with sheath','Пычак–небольшие ножи с ножнами. Данный вид ножей в основном использовался пастухами и охотниками. XIX век.','Pyçagyň şeýle görnülerini adatça çopanlar we awçylar ulanypdyrlar. XIX asyr.','Pychak–small knives with sheath. This kind of knife was used by shepherds and hunters. XIX century.',NULL,NULL,NULL,'public/exhibit-image/FsbCLJwHVE7vvAudwEB1CoQVaDamvzxn8gBg3Ffy.jpg',0,1,'2024-03-01 14:38:40','2024-03-01 14:38:40'),(206,2,46,'Сапан','Sapan','Sapan','Сапан–верёвочная праща, ручное оружие для метания каменных ядер. Традиционная туркменская праща в быту использовать мальчиками для защиты посевов от посягательства птиц. В военное время могло использоваться в качестве боевого метательного оружия. XIX век.','Ýüpden ýasalyp, daşdan ýasalan oky zyňmak üçin niýetlenen. Türkmen sapany oglanjyklar ekin meýdany guşlardan goramak üçin ulanypdyrlar. Uruş döwründe harby ýaraglary zyňmak üçin ulanylan bolmagy mümkin. XIX asyr.','Sapan – string sling, hand weapon for throwing stone balls. Traditional Turkmen sling in everyday life life was used by boys for protection of crops from invasion of birds. In a wartime it could be used as the fighting missile weapon. XIX century.',NULL,NULL,NULL,'public/exhibit-image/ZkBcLcdkVq3dmQEAmjIxl2dIsBk61taQLddnrd2m.jpg',0,1,'2024-03-01 14:40:23','2024-03-01 14:40:23'),(207,2,46,'Гёджек','Göjek','Gedjek','Гёджек–снаряды для метания из пращи. В основном изготавливаются из обожжённой и необожжённой глины. Для нанесения более ощутимого урона противнику, используются каменные ядра. XIX век.','Esasan bişen we bişmedik toýundan ýasalan, sapan bilen atylýan ok. Duşmana uly zyýan ýetirmek üçin daşdan ýasalan oklar ulanylýar. XIX asyr.','Gedjek–balls for sling. Basically are made of the burnt and unburnt clay. For   more effectiveness against   the enevy, are used stone balls. XIX century.',NULL,NULL,NULL,'public/exhibit-image/lmChr01ERDssYhrG9nMeZknY8I1rjYkIH1apvPpd.jpg',0,1,'2024-03-01 14:41:08','2024-03-01 14:41:08'),(208,2,46,'Гапан','Gapan','Gapan','Гапан–железный капкан, приспособление для ловли диких зверей. Детали изготавливались из железа методом горячей ковки. Состоит из пружинных захватов, цепи и якоря. При установки взводятся пружины, а якорь зацепляется за неподвижный предмет. Начало XX века.','Gapan ýabany haýwanlary tutmak üçin ulanylýan guýma usulynda ýasalan demirden esbap. Gapan ýaýjykdan, zynjyrdan we labyrdan düzülen. Düzülende ýaýjyklar gaýtarylýar we labyr hereketsiz esbapdan ilişýär. XX asyryň başy.','Gapan–iron trap for catching wild animals. Details were made of iron by means of hot forging. It consists of spring gripping devices, chain and anchor. At installation springs are cocked, and the anchor is hooked for a motionless object. Beginning of the XX-th century.',NULL,NULL,NULL,'public/exhibit-image/S5gXColUilj5hKi5UM6ZBdCe6gxKmJJlnxrEh7TA.jpg',0,1,'2024-03-01 14:42:06','2024-03-01 14:42:06'),(209,2,47,'Сатыл','Setil (satyl)','Satyl','Традиционный медный котелок для воды. Имеет гнутую во внутрь цилиндрическую форму, с боков два ушка в которую вставлена ручка для подвеса. Поверхность покрыта орнаментом в виде кружков, исполненная в технике гравировка. XIX век.','Suw daşamak üçin ýa-da içinde suw saklamak üçin misden silindr görnüşinde ýasalan, ýarym aýlaw saply tutarly hojalyk esbaby. Setiliň agzynyň ýanynda iki sany gulp bolup, olara sap dakylypdyr. Setiliň ýüzüne halka şekilleri çyzma usulynda bezelipdir. XIX asyr.','Traditional copper kettle for water. It has a cylindrical form bent inside, from the sides there are two tabs, in which there is inserted a handle for hanging. The surface is covered by an ornament in the form of circles, made in technique of engraving. XIX century.',NULL,NULL,NULL,'public/exhibit-image/BHT4PfaCmmrYNS5DeqZB9Em2jZqnRUrWZN0B13oP.jpg',0,1,'2024-03-01 14:43:46','2024-03-01 14:43:46'),(210,2,47,'Сатыл','Setil (satyl)','Satyl','Традиционный медный котелок для воды. Имеет гнутую во внутрь цилиндрическую форму, с боков два ушка в которую вставлена ручка для подвеса. Поверхность покрыта орнаментом в виде кружков, исполненная в технике гравировка. XIX век.','Suw daşamak üçin ýa-da içinde suw saklamak üçin misden silindr görnüşinde ýasalan, ýarym aýlaw saply tutarly hojalyk esbaby. Setiliň agzynyň ýanynda iki sany gulp bolup, olara sap dakylypdyr. Setiliň ýüzüne halka şekilleri çyzma usulynda bezelipdir. XIX asyr.','Traditional copper kettle for water. It has a cylindrical form bent inside, from the sides there are two tabs, in which there is inserted a handle for hanging. The surface is covered by an ornament in the form of circles, made in technique of engraving. XIX century.',NULL,NULL,NULL,'public/exhibit-image/DduViybozorEgYv0uwerw6sn0QUOgcWB6AC1UbIm.jpg',0,1,'2024-03-01 16:29:50','2024-03-01 14:49:00'),(211,2,47,'Котелок для воды','Suw gap','Kettle for water','Традиционный медный котелок для воды. Имеет гнутую во внутрь цилиндрическую форму, с одной стороны имеется ручка. В нижней части к донцу приварена подставка. XIX век.','Suw daşamak üçin ýa-da içinde suw saklamak üçin misden silindr görnüşinde ýasalan hojalyk esbaby. Gaby göterer ýaly bir tarapyna sap dakylypdyr. Onuň aşagy ýerde jaýlaşykly durar ýaly ýaýbaň, aýakly edilipdir. XIX asyr.','Traditional copper kettle for water. It has a cylindrical form bent inside, there is a handle from one side. In the bottom is welded on a stand. XIX century.',NULL,NULL,NULL,'public/exhibit-image/t0FPEbpQ9dA3NEg0RNoqo5keh6zb1ufDo2k4XJrF.jpg',0,1,'2024-03-01 14:50:23','2024-03-01 14:50:23'),(212,2,0,'Сусак – половник','Susaklar','Susak- ladle','Разливные ложки. Изготавливались из твёрдой породы дерева карагач. На конце рукоятки имеется крючок для подвеса, предназначен для розлива жидкостей. Конец XIX – начало ХХ веков.','Söwütden, garagaç ýaly gaty, berk agaçlardan ýonulyp ýasalan, uzyn saply hojalyk esbaby. Susaklar ildirgiçli sapy bilen bir bütewi ýasalypdyr. Olar bilen nahar gazandan okaralara goýulýar. XIX asyryň ahyry XX asyryň başy.','Ladles. They were made of hard sorts of wood – karagach tree. There is a hook for hanging up, it is intended for bottling of liquids. The end of the XIX - the beginning of the XX century.',NULL,NULL,NULL,'public/exhibit-image/jIgmlW4UGSA3hq1Pwjwn2FSwPry7QmJgKn9lXCtF.jpg',0,1,'2024-03-01 14:51:28','2024-03-01 14:51:28'),(213,2,0,'Чарх','Çarh','Charh','Чарх–деталь подъёмного механизма воды из колодца. При помощи данного блока и перекинутого через него каната с ведром на конце доставалась вода из очень глубоких колодцев. Если с одного конца крепилось ведро, то другой конец привязывался к верблюду, который отходил на расстояние равное глубине колодца. XIX век.','Guýydan suw çykarmak üçin niýetlenen enjam. Çarhyň üstüne atylan ujy bedreli ýüpüň kömegi bilen çuň guýynyň içinden suw çykarylypdyr. Ýüpüň bir ujuna bedre daňylan bolsa, beýleki ujy düýä daňylyp, ol guýynyň çuňlugy ýaly uzaklyga gidip bilýär. XIX asyr.','Charh-device for lifting water from well. By means of this block and the rope thrown over it with a bucket on one end water was got from very deep wells. If from one end was attached a bucket, the other end was fastened to a camel, who moved away on a distance equal to depth of a well. XIX century.',NULL,NULL,NULL,'public/exhibit-image/mLRTtGHA84Aloqjegd1RFXmSypy5t9SBHA4yC3qg.jpg',0,1,'2024-03-01 14:52:41','2024-03-01 14:52:41'),(214,2,57,'Mельничный жёрнов','Haraz degirmen daşy topy','Millstone','Центральная деталь в которую входят спицы колеса водяной мельницы. Изготавливался из цельного массива твёрдых пород дерева, таких как чинар и карагач. Конец XIX – начало ХХ веков. Часть механизма водяной мельницы, производит регулярную засыпку зерна в отверстие каменного жернова. Конец XIX – начало ХХ веков.','Top – suw degirmeniniň çarhynyň perlerini birleşdirýän ýogyn, tegelek agaç. Top suw degirmeniniň iň esasy we möhüm bölegidir. Top degirmeniniň tutuş mehanizimini, hususan-da ýokarky degirmen daşyny “ok” bilen birleşdirip aýlaýandyr. Topy köplenç çynar agajyndan, bolmasa-da garagjyndan ýasalypdyr. XIX asyryň ahyry XX asyryň başy\r\nTeleke (şeýtan agajy) – aşaky ujy ýokarky paýa-degirmen daşyna degip, onuň aýlanmagy bilen yranyp herekete gelýän agaç. Onuň uzynlygy 40-45 sm bolup, ýokarky ujy ýalakça direlýär. Şeýlelikde, degirmen daşynyň hereketi bilen ýalakça elmydama titräp, içine doludan akyp duran bugdaý degirmen daşlarynyň bukurdagyna yzygiderli guýlup durmagyny üpjün edýär. XIX asyryň ahyry XX asyryň başy.','The central detail, which includes spokes of a wheel of a watermill. It was made of unitary block of hard sort of wood, such as plane tree and karagach. The end of the XIX - the beginning of the XX century.\r\nThe part of the mechanism of a watermill, makes regular filling up of grain into the aperture of a millstone. The end of the XIX - the beginning of the XX century.',NULL,NULL,NULL,'public/exhibit-image/ju9dLL73xyqBfVQ7cElEZRCD7m3gM8RtGKXW6jEz.jpg',0,1,'2024-03-13 16:31:41','2024-03-01 14:54:43'),(215,2,48,'Андак','Andak','Andak','Каркас для женских головных уборов. Плетётся из растительных материалов и обшивается тканью. Конструкция хорошо сохраняла форму головного убора, который сверху покрывали платком. Конец XIX – начало ХХ веков.','Zenanlaryň gyňajynyň aşagyndan geýen başgaby. Andak zenanlaryň başyndaky gyňaçlarynyň oňaýly hem-de owadan daňylmagy üçin ýardam beripdir. Andak süwselik ösümliginden örülip, daşyna mata tikilip, elde ýerine ýetirlipdir. XIX asyryň ahyry XX asyryň başy.','Skeleton for woman’s head caps. It is plaited Trudges from vegetable materials and it is covered up by a cloth. The design kept the form of a head cap well, which covered with a kerchief from above. The end of the XIX - the beginning of the XX century.',NULL,NULL,NULL,'public/exhibit-image/XErKx4qVg8TlRlCEW0RLckuI387Mrd1GaW59q3Y3.jpg',0,1,'2024-03-01 14:56:29','2024-03-01 14:56:29'),(216,2,48,'Ак кайма тахя','Ak gaýma tahýa','Ak gayma tahya','Мужская тюбeтейка. Изготовлена из шёлка, оформлена узорами «чигильдем», «акгайма», «пишме», «секиз кешде». ХХ век.','Erkek adamlaryň başgaby. Tahýanyň ýerligi ýüpek keteniden, ol “çigildem”, “ak gaýma”, “pişme”, “sekiz keşde” nagyşlar keşdelenipdir, etegi jäheklenip, gyzyl ýüp tutulypdyr. XX asyr.','Men\'s embroidered skullcap. It is made of silk, adorned with “chigildem”, “ak gayma”, “pishme”, “sekiz keshde” patterns. XX century.',NULL,NULL,NULL,'public/exhibit-image/2x66qm3fqa7pBEeZLVpcSh7phsNoJv8i9wOY3aeo.jpg',0,1,'2024-03-01 14:57:37','2024-03-01 14:57:37'),(217,2,48,'Гюль тахя','Gül tahýa','Gul tahya','Девичья тюбeтейка. Изготовлена из шёлка, оформлена узорами «гыяк», «ярты ок гёзи» и «тегбент». ХХ век.','Gyzlaryň başlaryny bezän başgaby. Tahýanyň ýerligi ýüpek keteniden, ol “gyýak”, “ýarty okgözi”, “tegbent” nagyşlar bilen keşdelenipdir, etegi jäheklenip, aldymgaç tutulypdyr. XX asyr.','Girlish embroidered skullcap. It is made of silk, adorned with “gyyak”, “yarty okgozi”, “tegbent” patterns. XX century.',NULL,NULL,NULL,'public/exhibit-image/44yinsoH3RM83BMxiL3303eUHT4dAv9uSf6XSBZx.jpg',0,1,'2024-03-01 14:58:58','2024-03-01 14:58:58'),(218,2,48,'Пояс','Bil guşak','Girdle','Женский шерстяной пояс. Пояс украшен орнаментом чёрно-белой бахромой. Конец XIX – начало ХХ веков.','Zenanlar üçin ýüňden dokalan bil guşagy. Guşak nagyşly dokalypdyr we alajadan seçek goýlupdyr. XIX asyryň ahyry XX asyryň başy.','Woman\'s wool girdle. It is adorned with ornament and black-and-white fringe. The end of the XIX - the beginning of the XX  century.',NULL,NULL,NULL,'public/exhibit-image/pZ1GZp9q86SeUt10qya9kErV2C6Lu2kpikkjHlmf.jpg',0,1,'2024-03-01 14:59:50','2024-03-01 14:59:50'),(219,2,48,'Баш дарак-расчёска','Baş darak','Bash darak-comb','Женский гребень для волос. Изготавливался из твёрдых пород дерева, с двух сторон имеются зубья. Начало ХХ века.','Zenanlaryň saçlaryny timarlamak üçin niýetlenip agaçdan ýasalan baş daragy. Darak iki taraply, ownuk hem-de iri dişli ýasalypdyr. XX asyryň başy.','Woman\'s comb. It was made of hard sorts of wood and has teeth from both sides. Beginning of the XX  century.',NULL,NULL,NULL,'public/exhibit-image/3krnkD5QqjyGKWMptZsWPwOocvmcaXtzMQEdCzcq.jpg',0,1,'2024-03-01 15:00:42','2024-03-01 15:00:42'),(220,2,48,'Эл букча','El bukja','El bukja','Женская сумочка для хранения предметов для рукоделия. Сшита из различных кусков домотканых тканей. Украшена орнаментом «чопантельпек» и чёрно-белой верёвочкой. Конец XIX – начало ХХ веков.','Zenanlaryň el işlerini salýan iş bukjasy. Dürli ýüpek keteni matalardan garylyp tikilipdir. Bukjanyň birleşdirlip tikilen ýeri “çopantelpek” nagşy bilen keşdelenipdir. Onuň agzyna “çagajykly” alaja dakylypdyr. XIX asyryň ahyry XX asyryň başy.','Woman\'s bag for keeping her articles for embroidery. It is sewed of pieces of homespun fabrics. It is adorned with “chopantelpek” pattern and black-and-white string. The end of the XIX - the beginning of the XX  century.',NULL,NULL,NULL,'public/exhibit-image/E7j0DCyuPvMj8h6orpjBjgwuDnMsUUA8atjLPLp5.jpg',0,1,'2024-03-01 15:01:32','2024-03-01 15:01:32'),(221,2,49,'Bесы','Terezi','Scales','Ручные весы для взвешивания тяжестей. Устройство состоит из поперечной рейки и двух металических тарелок, подвешeнных к концам рейки при помощи трёх верёвок. В центре рейки имеется петля для подвеса. Конец XIX – начало ХХ веков.','Agyrlyk ölçelýän aşagy iki metal tabakly, ýokarysy uzyn kese agaçly ýasalan hojalyk esbaby. Terezi agajynyň iki ujundaky üç sany deň uzynlykdaky ýüpden tabaklar asylypdyr. Terezi agajynyň merkezinde ýokary göterer ýaly ýüpi bar. XIX asyryň ahyry-XX asyryň başy.','Hand-held scales for weighing. The device consists of crosscut lath and two metal plates, hung up to the ends of lath by means of three cords. In the centre of lath there is a loop for hanging. The end of the XIX - the beginning of the XX century.',NULL,NULL,NULL,'public/exhibit-image/rKVnwV7PbBK3lv42Gs04dYng1tsTV70WI3tGt0yo.jpg',0,1,'2024-03-01 15:02:56','2024-03-01 15:02:56'),(222,2,49,'Bесы','Terezi','Scales','Ручные весы для взвешивания тяжестей. Устройство состоит из поперечной рейки и двух металлических тарелок, подвешенных к концам рейки при помощи трёх верёвок. В центре рейки имеется петля для подвеса. ХХ век.','Agyrlyk ölçelýän aşagy iki metal tabakly, ýokarysy uzyn kese demirden ýasalan hojalyk esbaby. Terezi demriniň iki ujundaky üç sany deň uzynlykdaky ýüpden gyrasy aýlawly tabaklar asylypdyr. Tereziniň ýokarky böleginiň merkezinde ýokary göterer ýaly metaldan tutawajy bar. XX asyr.','Hand-held scales for weighing. The device consists of crosscut lath and two metal plates, hung up to the ends of lath by means of three cords. In the centre of lath there is a loop for hanging. XX century.',NULL,NULL,NULL,'public/exhibit-image/gk2sJ8aHBI1Bytym3rqeh1EuhffoXyr5g0DSIl9Q.jpg',0,1,'2024-03-01 15:04:42','2024-03-01 15:04:42'),(223,2,0,'Тюн','Tüň','Tun','Сосуд для хранения воды. Данный вид сосуда использовался для ношения воды от источника к дому. Сосуд изготовлен из меди, верхний край усилен дополнительно полоской, на шейки сосуда по кругу проходит валик. Для устойчивости к донцу припаяна опора в виде усечённого конуса. Конец XIX – начало ХХ веков.','Suw salynýan hojalyk esbaby. Suw daşamak ýa-da içinde suw saklamak üçin misden, bokurdagynyň gapdaly uly tutarly, boýny egri ýasalypdyr. Agzynda, boýnunda güberçekli halka aýlanypdyr. Tüňüň aşagyna ýerde jaýlaşykly durar ýaly tegelek görnüşinde aýak edilipdir. XIX asyryň ahyry-XX asyryň başy.','Vessel for water storage. This kind of a vessel was used for carrying  water from a spring to the house. The vessel is made of copper, the upper edge is additionally strengthened by a strip, there is a roller on the neck of the vessel. To the bottom is soldered a stand in the form of the truncated cone for steadiness. The end of the XIX - the beginning of the XX century.',NULL,NULL,NULL,'public/exhibit-image/lFr63DrE14NKP0psUsJPolI25kStTiSqO2KPC0x3.jpg',0,1,'2024-03-01 15:05:43','2024-03-01 15:05:43'),(224,2,50,'Тунче','Tüňçe','Tunche','Сосуд для кипячения воды. Изготовлен из меди, для устойчивости к донцу припаяна опора круглой формы. С одной стороны сосуда закреплена ручка, с другой имеется носик для слива воды. На поверхности имеется рельефный орнамент. Конец XIX – начало ХХ веков.','Çaý, suw gaýnatmakda ulanylan hojalyk esbaby. Tüňçe misden armyt şekilinde ýasalyp, onuň bokurdagynyň gapdalynda gulpy we jürnügi bar. Tüňçäniň ýüzüne, jürnügine güberçekli şekiller berlipdir. Aşagy ýerde jaýlaşykly durar ýaly tegelek görnüşinde aýak edilipdir. XIX asyryň ahyry-XX asyryň başy.','A vessel for water boiling. It is made of copper, to the bottom is soldered a stand of round form for steadiness.  There is a handle from one side and spout from the other. On the surface is a relief ornament. The end of the XIX - the beginning of the XX century.',NULL,NULL,NULL,'public/exhibit-image/PGVqlupfceoWrjy8NXg92wSr506c6J8Gnr6jqY1O.jpg',0,1,'2024-03-01 15:07:47','2024-03-01 15:07:47'),(225,2,50,'Тунче','Tüňçe','Tunche','Сосуд для кипячения воды. Изготовлен из меди, для устойчивости к донцу припаяна опора круглой формы. С одной стороны сосуда закреплена ручка, с другой имеется носик для слива воды. На поверхности имеется рельефный орнамент. Конец XIX – начало ХХ веков.','Çaý, suw gaýnatmakda ulanylan hojalyk esbaby. Tüňçe misden armyt şekilinde ýasalyp, onuň bokurdagynyň gapdalynda gulpy we jürnügi bar. Tüňçäniň ýüzüne, jürnügine güberçekli şekiller berlipdir. Aşagy ýerde jaýlaşykly durar ýaly tegelek görnüşinde aýak edilipdir. XIX asyryň ahyry-XX asyryň başy.','A vessel for water boiling. It is made of copper, to the bottom is soldered a stand of round form for steadiness.  There is a handle from one side and spout from the other. On the surface is a relief ornament. The end of the XIX - the beginning of the XX century.',NULL,NULL,NULL,'public/exhibit-image/jtIfXQncbIHzHtwxuPO9RRnVBz77D8Mjil0zdLqx.jpg',0,1,'2024-03-01 16:27:21','2024-03-01 15:11:31'),(226,2,50,'Тунче','Tüňçe','Tunche','Сосуд для кипячения воды. Изготовлен из меди, для устойчивости к донцу припаяна опора круглой формы. С одной стороны сосуда закреплена ручка, с другой имеется носик для слива воды. На поверхности имеется рельефный орнамент. Конец XIX – начало ХХ веков.','Çaý, suw gaýnatmakda ulanylan hojalyk esbaby. Tüňçe metaldan armyt şekilinde ýasalyp, onuň bokurdagynyň gapdalynda gulpy bar. Tüňçäniň ýüzüne güberçekli halkalar geçirlipdir. Aşagy ýerde jaýlaşykly durar ýaly tegelek görnüşinde aýak edilipdir. XIX asyryň ahyry-XX asyryň başy.','A vessel for water boiling. It is made of copper, to the bottom is soldered a stand of round form for steadiness.  There is a handle from one side. On the surface is a relief ornament. The end of the XIX - the beginning of the XX century.',NULL,NULL,NULL,'public/exhibit-image/AjCW3htakNOj1xB5acVWrxFi4O17X4DG8KMR2GeI.jpg',0,1,'2024-03-01 15:15:26','2024-03-01 15:15:26'),(227,2,50,'Самовар','Demkeş','Samovar','Металлический сосуд для кипячения воды и приготовления чая. Изготовлен из меди, нагревалась внутренней топкой, представляющей собой высокую трубку. Для устойчивости к донцу припаяна опора конусовидной формы, оформлена прорезным орнаментом. С одной стороны сосуда закреплена ручка, с другой имеется носик для слива воды. Поверхность оформлена рельефным геометрическим орнаментом. Конец XIX – начало ХХ веков.','Çaý, suw gaýnatmakda ulanylan hojalyk esbaby. Demkeş metaldan armyt şekilinde ýasalyp, onuň bokurdagynyň gapdalynda gulpy we jürnügi bar. Demkeşiň tüssesi çykýan ýokarky turbasy bar. Onuň ýüzünde aýlawly, güberçekli halkalar we geometrik şekiller geçirlipdir. Aşagynda ýerde jaýlaşykly durar ýaly tegelek, gyrasy aýalawly, kesme nagyşly aýak edilipdir. XIX asyryň ahyry-XX asyryň başy.','A vessel for water boiling and tea. It is made of copper, is heated by the inner furnace in the form of long pipe. To the bottom is soldered a stand of round form for steadiness, it is adorned with cut through ornament.  There is a handle from one side and spout from the other. On the surface is a relief geometrical ornament. The end of the XIX - the beginning of the XX century.',NULL,NULL,NULL,'public/exhibit-image/pX4MKDnPjm394j2jAN5MEOwOvteUwZ4rFscutvFX.jpg',0,1,'2024-03-01 15:16:20','2024-03-01 15:16:20'),(228,2,51,'Кетени – ткани “кетени”.','Keteni matalar','Keteni cloth','Туркменские ткани из шёлка различных цветов, окрашенные природными красителями и сотканные на традиционном домашнем станке. Из этих тканей женщины шили различные виды одежды для своих семей. XXI век.','Ýüpek sapagy tebigy reňkler bilen reňklenip, tara guralynyň kömegi bilen dokalan dürli reňkli keteni matalar. Bu matalardan türkmen zenanlaryň, çagalary we erkek adamlaryň milli egin-eşikleri biçilip tikilýär. XXI asyr.','Turkmen fabrics from silk of the various colours, dyed by natural dyes and woven on the traditional home weaver’s loom. From these fabrics   women sewed various kinds of clothes for their family. The XXI century.',NULL,NULL,NULL,'public/exhibit-image/QgVK52q4JLVQq4lk3tY1LiKNBGbD9OMxswGCE0D2.png',0,1,'2024-03-01 15:18:14','2024-03-01 15:18:14'),(229,2,51,'Мяки, найча','Mäki we naýça','Maki, naycha','Челнок от традиционного ткацкого станка туркмен. Предназначена для продвижения уточных нитей через нити основы. Изготавливали из дерева, с двух сторон конусовидные окончания, в середине выемка для шпульки. \r\nШпулька – катушка с намотанными на неё уточными нитками. Конец XIX – начало ХХ веков.','Mäki – erşiň arasyndan argaç geçirmek üçin ulanylýan, iki ujy süýnmek,ortasy oýuk, içine naýça salynýan uly bolmadyk agaçdan ýasalan gural. XIX asyryň ahyry XX asyryň başy.\r\nNaýça – erşiň arasyndan argaç geçirmek üçin daşyna sapak saralyp, mäkiniň içine salynýan gamyşdan ýasalan tara guraly. XIX asyryň ahyry XX asyryň başy.','Shuttle from a traditional weaver’s loom of Turkmens. It is \r\nintended for moving of weft threads through threads of warp. Made of wood, from two sides there are cone-shaped endings, in the middle there is hollow for a spool. \r\nSpool - the reel with coiled  on it weft threads. The end of the XIX - the beginning of the XX  century.',NULL,NULL,NULL,'public/exhibit-image/l8y3FDVNmOLq6qEnsFK41epB2SFkSIMxSdzgXUZJ.png',0,1,'2024-03-01 15:19:34','2024-03-01 15:19:34'),(230,2,51,'Кюртекче','Kürtekçe','Kurtekche','Традиционная детская накидка для мальчиков, сшита из ткани “сары тагта”, плечи украшены орнаментами “тойнук” и “акгайма”. По периметру края плечиков подшита бахрома чёрно-красного цвета. Конец XIX – начало ХХ веков.','Oglan çagalaryň geýen milli egin-eşigi. Gyrmyzy donluk, sary tagta donluk ýüpek matadan tikilip, kürtekçäniň gulaklary “toýnuk”, “ak gaýma” nagyşlary bilen keşdelenipdir. Kürtekçäniň ýakasyna jähek tutulyp, gulagy işilen gyzyl we gara ýüpek sapaklar bilen seçeklenipdir. XIX asyryň ahyry XX asyryň başy.','The traditional children\'s cape for boys, is sewed from “сары тагта” cloth, shoulders are decorated by ornaments “toynuk” and “ak gayma”. In perimetre of edge of  shoulder pads is sewed the fringe of black-red colour. The end of the XIX - the beginning of the XX  century.',NULL,NULL,NULL,'public/exhibit-image/iKbUJ4huaGrkveJCndfTUy0NYzWzU5GOw5hVqkkY.png',0,1,'2024-03-01 15:20:33','2024-03-01 15:20:33'),(231,2,51,'Дюпли гынач','Düýpli gyňaç','Duypli gynach','Традиционный головной домотканый платок из шёлка, поверхность украшена орнаментом “тойнук”. По периметру края подшита бахрома чёрно-красного цвета. Конец XIX – начало ХХ веков.','Zenanlaryň başlaryna daňynan düýpli gyňajy. Gyňaç ýüpekden “toýnuk” nagyşlary salnyp tarada dokalypdyr, gyralary gyzyl we gara ýüpek sapaklar bilen işilip seçeklenipdir. XIX asyryň ahyry XX asyryň başy.','Traditional head homespun silk kerchief, the surface is adorned with “toynuk” pattern. There is a black and red fringe on the whole perimeter. End of the XIX – beginning of the XX century.',NULL,NULL,NULL,'public/exhibit-image/DmPqsQHzTBJFb5Yalg5jNksOfdDfZEEWDiFhm9Z5.png',0,1,'2024-03-01 15:21:23','2024-03-01 15:21:23'),(232,2,51,'Эл ялык','El ýaglyk','El yaglyk','Традиционный домотканый платок из шёлка для рук, поверхность украшена орнаментами “синирме” и “акгайма”. По периметру края подшита бахрома чёрно-красного цвета. ХХ век.','Ýüpekden tarada dokalan, nagyşly zenan el ýaglygy. El ýaglyk ýüpekden “siňirme”, “ak gaýma” nagyşlary salnyp, tarada dokalypdyr, gyralary gyzyl we gara ýüpek sapaklar bilen işilip seçeklenipdir. XX asyr.','Traditional   homespun silk handkerchief, the surface is adorned with “sinirme” and “ak gayma” patterns. There is a black and red fringe on the whole perimeter. XX century.',NULL,NULL,NULL,'public/exhibit-image/4RqgpgjHXy7oSOL9rh2QstfTwRyHRmkifqN8JVgQ.png',0,1,'2024-03-01 15:22:12','2024-03-01 15:22:12'),(233,2,52,'Яшыл курте','Ýaşyl kürte','Yashyl kurte','Накидка на голову невесты. Сшита из домотканых тканей. Воротник оформлен узором «гульяйды», на рукавах «чанга», подол «тегбент», в других местах «кюрте гочак». Конец XIX – начало ХХ веков.','Ýaş gelinleriň başatgyjy. Ýerligi ýüpek keteniden, ýanly biçüwli tikilipdir. Kürtäniň ýakasy “gülýaýdy”, eltutary, syny “çaňňa”, etegi “tegbent”nagyşly keşdelenipdir. Onuň ýartmaçlary, ýeňi we tutuş nagyşlaryň töweregi “kürte goçak” nagyş bilen bezelipdir. XIX asyryň ahyry XX asyryň başy.','A green cape for bride. It is sewed of homespun fabrics. The collar is adorned with “gulyaydy”, sleeves with “channa”, skirt with “tegbent” patterns, in other places there is “kurte gochak” pattern. The end of the XIX - the beginning of the XX  century.',NULL,NULL,NULL,'public/exhibit-image/jsnh4FfLr49B6Zv1xqv5l3jUkGV4ARlmRyVZu0ha.jpg',0,1,'2024-03-01 15:25:06','2024-03-01 15:25:06'),(234,2,52,'Платья из кетени и халат','Keteni köýnek we çabyt','Dresses from keteni cloth and oriental robe','Национальное женское платье. Платье сшито из ткани “кетени” красного цвета, на воротнике имеется узор “дагдан”, “ак гайма”, “гоча”. ХХ век. Национальный женский халат. Халат сшит из ткани “кетени” красного цвета, оформлен узором “тегбент”. По краям пришита красная тесьма.  ХХ век.','Zenanlaryň geýen milli köýnegi. Köýnek gyzyl reňkli ýüpek keteniden ýanly tikilipdir, onuň dik ýakasy “dagdan”, “ak gaýma”, “goçak” nagyşlary bilen bezelipdir. XX asyr. Zenanlaryň geýen milli dony. Gyrmyzy donluk keteniden ýanly tikilipdir, basma usulynda “tegbent” nagyşy salnypdyr. Ýartmajyna we jübüsiniň töweregine “tegbent” nagyşly goçak şekili berlipdir. Çabydyň gyralary jäheklenip, gyzyl ýüp tutulypdyr. XX asyr.','National woman’s dress. It is sewed from “keteni” cloth of red colour, there are “dagdan”, “ak gayma”, “gochak” patterns on the collar. XX  century. National woman’s oriental robe. It is sewed of red “keteni” cloth, is adorned with “tegbent” pattern. On the edges is sewed red cord. XX century.',NULL,NULL,NULL,'public/exhibit-image/zh5m6PSsEs56fF4QTbF02eMPTgZqZQnHhVTtp3Yt.jpg',0,1,'2024-03-01 15:33:07','2024-03-01 15:26:04'),(235,2,52,'Бёке кёвуш – туфли','Böke köwüş (gyrma köwüş)','Boke kovush – shoes','Женская обувь. Изготовлена из кожи крупного рогатого скота. Верхняя часть носка украшена растительным орнаментом. Каблук сшит из нескольких слоёв кожи, подбит железной подковкой. Конец XIX – начало ХХ веков.','Zenanlaryň aýakgaby. Aýakgap iri malyň gönünden eýlenip taýýarlanypdyr. Onuň ýüzi ösümlik nagyşlary bilen haşamlanypdyr. Gönden birnäçe gatlanyp, beýik ökje ýasalypdyr. Aýakgabyň ökjesine berklik üçin kiçeňräk nal kakylypdyr. XIX asyryň ahyry XX asyryň başy.','Woman’s footwear. It is made of a cattle leather. The top of toe is adorned with vegetable ornament. The heel is sewed of several layers of leather and resoled with iron tip. The end of the XIX - the beginning of the XX  century.',NULL,NULL,NULL,'public/exhibit-image/HGPDy8c1CT7Gqn7SC76Mdykp29XZ3yxHgJveoh6U.png',0,1,'2024-03-05 16:52:29','2024-03-01 15:33:53'),(236,2,52,'Хокга – туфли','Hokga','Hokga – shoes','Женская обувь. Изготовлена из кожи крупного рогатого скота. Верхняя часть носка украшена растительным орнаментом. Данный вид обуви могли носить и мужчины и дети. Конец XIX – начало ХХ веков.','Zenanlaryň aýakgaby. Aýakgap iri malyň gönünden eýlenip taýýarlanypdyr. Onuň ýüzi ösümlik nagyşlary bilen haşamlanypdyr. Hokga aýakgabyny diňe zenanlar däl-de, çagalar we erkek adamalar hem geýipdir. XIX asyryň ahyry XX asyryň başy.','Woman’s footwear. It is made of a cattle leather. The top of toe is adorned with vegetable ornament. The heel is sewed of several layers of leather and resoled with iron tip. The end of the XIX - the beginning of the XX  century.',NULL,NULL,NULL,'public/exhibit-image/ZEicuii5aFMi72xFfEnEvXdnjwFg15k00mhQ3pLS.png',0,1,'2024-03-05 16:52:00','2024-03-01 15:34:42'),(237,2,52,'Бёке кёвуш – туфли','Böke köwüş (gyrma köwüş)','Boke kovush – shoes','Женская обувь. Изготовлена из кожи крупного рогатого скота. Верхняя часть носка украшена растительным орнаментом. Каблук сшит из нескольких слоёв кожи, подбит железной подковкой. Конец XIX – начало ХХ веков','Zenanlaryň aýakgaby. Aýakgap iri malyň gönünden eýlenip taýýarlanypdyr. Onuň ýüzi ösümlik nagyşlary bilen haşamlanypdyr. Gönden birnäçe gatlanyp, beýik ökje ýasalypdyr. Aýakgabyň ökjesine berklik üçin kiçeňräk nal kakylypdyr. XIX asyryň ahyry XX asyryň başy.','Woman’s footwear. It is made of a cattle leather. The top of toe is adorned with vegetable ornament. The heel is sewed of several layers of leather and resoled with iron tip. The end of the XIX - the beginning of the XX  century.',NULL,NULL,NULL,'public/exhibit-image/yxxefe0pBHjyp792orMXxUF0PIY7JdTikfo5vOgX.png',0,1,'2024-03-05 16:53:28','2024-03-01 15:36:25'),(238,2,53,'Гребень для расчёсывания шерсти','Ýüň darak','Yun darak','Гребень для расчёсывания шерсти. Конструкция изготавливалась из дерева, в верхней части которого вертикально установлены в три ряда шиловидные зубья. Для предохранения зубьев имеется специальная крышка. Конец XIX – начало ХХ веков.','Ýüňi daramak üçin ulanylan gural. Daragyň esasy bölegi agaçdan, dişleri metaldan ýasalypdyr. Daragyň her setirinde uzynlygy 10-12 sm çemesinde 30-a golaý ujy ýiti dişleri bar. Daragyň dişleri üçin ýörite agaçdan gorag gapagy ýasalypdyr. XIX asyryň ahyry XX asyryň başy.','Hackle for wool combing. It was made of a wood, in top of which there are vertically placed awl-shaped teeth in three rows. For protection of teeth there is a special cover. The end of the XIX - the beginning of the XX  century.',NULL,NULL,NULL,'public/exhibit-image/awmqUkKYFsU17KXBn1bghH6v9jdWSh8qxZlKJMQz.jpg',0,1,'2024-03-01 15:38:29','2024-03-01 15:38:29'),(239,2,53,'Торба с клубками шерсти','Ýumakly torba','Torba with balls of wool','Клубки шерстяных нитей в торбе. Используются при изготовлении ковров и паласов. Конец XIX – начало ХХ веков.','Torba salnan haly dokamakda ulanylýan ýüňden egrilen ýüplikler. Ýumaklar haly, palas, dolak dokamak üçin ulanylýar. XIX asyryň ahyry XX asyryň başy.','Wool balls in a bag. They are used in making of carpets and carpetings. The end of the XIX - the beginning of the XX  century.',NULL,NULL,NULL,'public/exhibit-image/4C3soTY7GwF5UNd77n65CLhKb6s8AGnIlbbUFYoe.jpg',0,1,'2024-03-01 15:39:34','2024-03-01 15:39:34'),(240,2,54,'Торба','Ýan torba','Torba','Торба для различных мелочей. Торба соткана в технике безворсового ткачества, из хлопчатобумажных нитей белого цвета, украшена полосками серого цвета. Закрывается клапаном треугольной формы с бахромой. ХХ век.','Içine dürli zat salmak üçin ulanylan dokma önümi. Ak we çal nah ýüplüklerden garylyp, kakma usulynda zolaklaýyn kakylyp dokalypdyr. Torbanyň agzy özünden bolup, üçburç görnüşinde gutarypdyr, gutarýan ýerinde özünden seçekler bilen bezelipdir. XX asyr.','A bag for various small things. The  bag is woven in the technique of pileless weaving, from cotton threads of white colour, decorated by strips of grey colour. It is covered by the valve of the triangular form with a fringe. The XX century.',NULL,NULL,NULL,'public/exhibit-image/MwK4yXPR7FMom9KnjcseC1ikjxBHuJIsYQVDyVux.jpg',0,1,'2024-03-01 15:41:05','2024-03-01 15:41:05'),(241,2,54,'Торба','El torbalar','Torba','Женская торба для различных мелочей. Торба с обратной стороны соткана в технике безворсового ткачества, с внешней стороны в технике коврового ткачества из крашенной шерсти. Лицевая сторона оформлена узорами “гушлы гёль”, “солдат”, “бармак” и “яшыл гочак”. К нижнему краю подшита бахрома из красных, жёлтых, чёрных, зелёных и чёрно-белых нитей. ХХ век.','Zenanlaryň içine dürli zat salmak üçin ulanylan dokma önümi. El torbanyň esasy ýüzi ýüňden çitme usulynda, arka tarapy kakma usulynda dokalypdyr. Torbanyň ýerligi gyzyl reňkde. Torbanyň merkezi “guşly göl”, gyra nagyşlary “soldat”, “barmak”, “ýaşyl goçak” bilen bezelipdir. Etegi gyzyl, sary, gara, gök we alaja ýüpleri bilen uzyn seçeklenipdir. XX asyr.','A woman’s bag for various small things. The  bag is woven in the technique of pileless weaving from the back side, from the front side in the technique of carpet weaving from dyed wool.  The front side is decorated with “gushly gol”, “soldat”, “barmak”, “yashyl gochak”. To the bottom is sewed fringe from red, yellow, green and black-and-white threads. The XX century.',NULL,NULL,NULL,'public/exhibit-image/3YS6MxG87w8aSfgUCOUVpTURbBeXkcioVOerVCKc.jpg',0,1,'2024-03-01 15:42:02','2024-03-01 15:42:02'),(242,2,54,'Веревка для колыбели','Sallançak kilim','Rope for cradle','Полотно для изготовления детской люльки. Соткан в технике безворсового ткачества. Украшен полосками из различных цветов и узором “гюльяйды”. Конец XIX – начало ХХ веков.','Sallançak etmek üçin ýörite nagyşlanyp dokalan kilim. Kilim ýüňden bolup, kakma usulynda dokalypdyr. Gyzyl, ak, gara ýüň ýüplikler bilen zolak görnüşinde dokalyp, her ýerlerine “gülýaýdy” nagşy salnypdyr. XIX asyryň ahyry XX asyryň başy.','Cloth for making a cradle. It is woven in the technique of pileless weaving. It is adorned with strips of different colour and “gulyaydy” pattern. End of the XIX – beginning of the XX century.',NULL,NULL,NULL,'public/exhibit-image/nHXcPrtuwcFwg0h8lTrs7eSUikgmkeWoH14VFISy.jpg',0,1,'2024-03-01 15:43:26','2024-03-01 15:43:26'),(243,2,54,'Палас','Ýüp','Rug','Изготовленный кустарным способом верёвка из некрашеной козьей шерсти верёвка, для использования при закреплении груза и привязывания скотины. ХХ век.','Çöpünden işilip, ýük, goş-golam, mal-gara daňmak üçin, ulanylan tanap, bag. Geçiniň boýalmadyk ýüňlerinden towy gowy ýeten ýüp. XX asyr.','Homemade  cord from undyed goat wool a cord, for use at fastening of cargo and attachment of cattle. The XX century.',NULL,NULL,NULL,'public/exhibit-image/hKrLZxeW7yaJ0t5s59rtr6s8syFb48JqKm9XZAnP.jpg',0,1,'2024-03-01 15:44:16','2024-03-01 15:44:16'),(244,2,55,'Гупба – девичье головное украшение','Gupba','Gupba – girlish hair adornment','Девичье украшение на тюбетейку из серебра. Полусфера украшена филигранью, сверху установлена трубочка для декоративных перьев. По нижнему краю находятся колечки для подвесок. Конец XIX – начало ХХ веков.','Gyzlaryň tahýasynyň depesine dakylan, gümmez görnüşli kümüş şaý. Gupbanyň gümmeziniň ýüzüne işilen simli zolak kebşirlenip, ýokarsynda tüýdügi bar. Gupbanyň etegine gulplar kebşirlenipdir. XIX asyryň ahyry XX asyryň başy.','Silver adornment for girlish embroidered skullcap. Hemisphere is adorned with filigree, on the top there is a pipe for decorative leaves. In the bottom there is a ring for pendants. End of the XIX – beginning of the XX century.',NULL,NULL,NULL,'public/exhibit-image/HEQuYpwwd7nG5o8brE6t7AlQl5WbUORDf7pNaxVk.jpg',0,1,'2024-03-01 15:45:43','2024-03-01 15:45:43'),(245,2,55,'Гупба – девичье головное украшение.','Gupba','Gupba – girlish hair adornment','Девичье украшение на тюбетейку из серебра. Полусфера украшена филигранью, гравированным орнаментом и цветным стеклом имитирующие полудрагоценные камни, сверху установлена трубочка для декоративных перьев. По нижнему краю находятся подвески со стеклом. Конец ХХ века.','Gyzlaryň tahýasynyň depesine dakylan, gümmez görnüşli şaý. Gupbanyň gümmeziniň ýüzüne işilen simli zolak kebşirlenip, çyzma nagyşlar, çüýşe gaşlar bilen bezelipdir. Gümmeziniň ýokarsynda tüýdügi bar. Gupbanyň etegine gaşly şelpeler oturdylypdyr. XX asyryň ahyry.','Silver adornment for girlish embroidered skullcap. Hemisphere is adorned with filigree, engraved ornament and coloured glass, imitating semi-precious stones,  on the top there is a pipe for decorative leaves. In the bottom there are pendants with glass. End of the XIX century.',NULL,NULL,NULL,'public/exhibit-image/Q06hHjrG6xqiypvZchtBOjcfuxCVBjKmUND9y5yS.jpg',0,1,'2024-03-01 15:46:56','2024-03-01 15:46:56'),(246,2,55,'Гоза – нагрудное украшение','Gozalar','Goza – breast adornment','Детали женского серебряного украшения на косы. Украшение в виде пустотелого круга с трубочками по бокам. С лицевой стороны рельеф в виде цветка, изготовленный в технике штампа. Начало ХХ века.','Zenanlaryň saça dakan saçlyk bezeg şaýlarynyň düzüm bölegi. Kümüşden iki gatly, gapdaly turba şekilli ýasalypdyr. Bu şaýlaryň ýüzüne “gül” nagyşalary berlip, galypda guýlup ýasalypdyr. XX asyryň başy.','Pieces of woman’s silver adornment for braid. It is made in the form of hollow circle with pipes on the sides. In the front there is a relief if the form of flower made in technique of punching. Beginning of the XX century.',NULL,NULL,NULL,'public/exhibit-image/LNFdmAIBFX9x4MZ8uUOVJD38LsK1L4a73ZPiW1fZ.jpg',0,1,'2024-03-01 15:47:53','2024-03-01 15:47:53'),(247,2,55,'Ситара – декоративные детали','Sytaralar','Sytar – decorative details','Детали от женских украшений различной формы из серебра. Детали нашиваются на различные места одежды и на головной убор. С лицевой стороны рельеф в виде цветка, изготовленный методом литья. Начало ХХ века.','Ilik ýaly, ýüzi nagyşly, güberçek, tegelek guýma şaýjagazlar. Sytara zenan geýimleriniň ýakasyna, tahýanyň etegine, jübüleriň töweregine bezeg üçin dakylypdyr. Bu şaýlaryň ýüzüne “gül” nagyşalary berlip, galypda guýlup ýasalypdyr. XX asyryň başy.','Pieces of woman’s silver adornment. They are sewed on the different places of clothes and headcap. In the front side there is an ornament in the form of flower made by means of casting. Beginning of the XX century.',NULL,NULL,NULL,'public/exhibit-image/SrdB7Q7Jsl3kmPZlp3Upiauo74dV1NvxzVDNEzIq.jpg',0,1,'2024-03-01 15:48:42','2024-03-01 15:48:42'),(248,2,55,'Аппасы – декоративные бляхи','Apbasylar','Apbasy - decorative pendants','Женские серебряные украшения на нагрудную часть платья. Украшение изготавливали в виде круглых пластин. Обычно с лицевой стороны рельеф в виде цветка, камни. Конец ХХ века.','Zenan köýneginiň iki ýan ýakasyna setir-setir edilip dakylan bezeg şaýlary. Apbasylara gül şekilleri berlip, ýokarsyna gulp oturdylyp, ýüzi gaşly ýasalypdyr. XX asyryň ahyry.','Woman’s silver pectoral adornments. They were made in the form of round plates. Usually there was a relief in the form of flower, stones in front side. End of the XX century.',NULL,NULL,NULL,'public/exhibit-image/8s56NsbPDoWgrRAbMkTVjfk5EzMjrovYhHg5npGP.jpg',0,1,'2024-03-01 15:49:30','2024-03-01 15:49:30'),(249,2,55,'Гульяка – нагрудные украшения','Ýaýly gülýaka','Gulyaka - breast adornment','Женское серебряное украшение на воротник платья. Украшение оформлено сквозным орнаментом, подвесками, позолотой и цветным стеклом имитирующий полудрагоценные камни. Середина ХХ века.','Zenan köýnekleriniň ýakasyna dakylýan, kümüşden, ýüzi altyn çaýylan bezeg şaýy. Şaý süýrümtik, gyralary “kerkere”, ýüzi nerrek nagyşlar bilen bezelipdir. Ýaýly gülýaka dürli reňkli çüýşe gaşlary oturdylyp, onuň aşagyna bäş sany şelpeler dakylypdyr. XX asyryň ortalary.','Woman’s silver  adornment for collar. It is adorned with reach-through ornament, pendants, gilding and coloured glass, imitating semi-precious stones. Middle of the XX century.',NULL,NULL,NULL,'public/exhibit-image/qeBXcDrC2bveUQOa3qXAxWIvL6XqlNwxYQZ9GWPu.jpg',0,1,'2024-03-01 15:50:28','2024-03-01 15:50:28'),(250,2,56,'Инструменты ювелира','Zergärçilikde ulanylan gurallar','Jeweller’s labour tools','Вспомогательный инструмент для ювелира. Изготавливался из огнеупорного камня – стеатит. XIX век.','Zergärleriň zergärçilik önümleri ýasamakda ulanan gurallary. Bu gurallar steatit daşyndan ýasalypdyr. XIX asyr.','Jeweller’s auxiliary instrument. It was made of fireproof stone – steatite. XX century.',NULL,NULL,NULL,'public/exhibit-image/udJn7kHttQqD0mPd4undfAhNImntBpG9pMjZv2w4.jpg',0,1,'2024-03-01 15:52:31','2024-03-01 15:52:31'),(251,2,56,'Детали украшений','Şaý bölekleri','Pieces of adornments','Детали от женских украшений различной формы из серебра. Детали нашиваются на различные места одежды, на головной убор, надеваются на пальцы. С лицевой стороны рельеф в виде цветка, рогов барана, украшены цветным стеклом. XIX-ХХ века.','Zenan bezeg şaýlarynyň düzüm bölekleri. Şaýlar zenanlaryň barmaklaryna, egin-eşiklerine, tahýalaryň etegine, jübüleriň töweregine bezeg üçin dakylypdyr. Bu şaýlaryň ýüzüne “gül”, “goçak” nagyşalary berlip, çüýşe gaşlary oturdylypdyr. XIX - XX asyr.','Details of woman’s silver adornments of the various form. Details are sewed on various places of clothes, on a headcap, put on fingers. In front there is a relief in the form of a flower, horns of a ram, are decorated by colour glass. XIX-ХХ centuries.',NULL,NULL,NULL,'public/exhibit-image/pspIJZQ1vUxPiBzZxiIuaFJqBKKvdPPFbOdo0fYp.jpg',0,1,'2024-03-01 15:53:20','2024-03-01 15:53:20'),(252,2,31,'Бёке кёвуш – туфли','Böke köwüş (gyrma köwüş)','Boke kovush – shoes','Женская обувь. Изготовлена из кожи крупного рогатого скота. Верхняя часть носка украшена растительным орнаментом. Каблук сшит из нескольких слоёв кожи, подбит железной подковкой. Конец XIX века.','Zenanlaryň aýakgaby. Aýakgap iri malyň gönünden eýlenip taýýarlanypdyr. Onuň ýüzi ösümlik nagyşlary bilen haşamlanypdyr. Gönden birnäçe gatlanyp, beýik ökje ýasalypdyr. Aýakgabyň ökjesine berklik üçin kiçeňräk nal kakylypdyr. XIX asyryň ahyry.','Woman’s footwear. It is made of a cattle leather. The top of toe is adorned with vegetable ornament. The heel is sewed of several layers of leather and resoled with iron tip. The end of the XIX century.',NULL,NULL,NULL,'public/exhibit-image/HsFL4ARx6R9JATZHHlGd2mvlrYilrWNBXrLbgOV6.png',0,1,'2024-03-05 16:53:46','2024-03-05 16:36:53'),(253,2,31,'Чага чокaй – детская обувь','Çaga çarygy','Chaga chokai – children’s shoes','Детская обувь. Изготовлена из кожи крупного рогатого скота. По верхнему \r\nкраю проходит верёвка. Данный вид обуви могли носить круглый год. XIX век.','Çaganyň geýen aýakgaby. Ol iri malyň hamyndan ýörite biçilip, bütin gyralary başlygynyň üsti deşilip, ýüp geçirlip, büzülip tikilipdir. Çaryk bütin ýylyň dowamynda geýlipdir. XIX asyr','Children’s footwear. It is made of a cattle leather. On the edge is a cord. This kind of footwear could be worn the whole year. XIX  century.',NULL,NULL,NULL,'public/exhibit-image/jsOIWvglCIAXbv3QzA7jG7WfoBPHFSZHgyDxNJHL.png',0,1,'2024-03-05 16:39:12','2024-03-05 16:39:12'),(254,2,31,'Хокга – туфли','Hokga','Hokga – shoes','Женская обувь. Изготовлена из кожи крупного рогатого скота. Верхняя часть носка украшена растительным орнаментом. Данный вид обуви могли носить и мужчины, и дети. Конец XIX векa.','Zenanlaryň aýakgaby. Aýakgap iri malyň gönünden eýlenip taýýarlanypdyr. Onuň ýüzi ösümlik nagyşlary bilen haşamlanypdyr. Hokga aýakgabyny diňe zenanlar däl-de, çagalar we erkek adamalar hem geýipdir. XIX asyryň ahyry.','Woman’s footwear. It is made of a cattle leather. The top of toe is adorned with vegetable ornament. This kind of footwear could be worn by men and children as well. The end of the XIX century.',NULL,NULL,NULL,'public/exhibit-image/uPjL1p8VIROEyNzJ1USYqAjVK5dQ9neGiaWyTJgc.png',0,1,'2024-03-05 16:40:09','2024-03-05 16:40:09'),(255,1,12,'Женские фигурки. Маргуш','Zenan heýkeljikleri. Margush','Woman’ s figurines. Margush','Глиняная женская статуэтка найденная при археологических работах в Маргуш. III тыс. до н.э.','Margusdan tapylan toýundan ýasalan zenan heýkeljikleri. B.e öňki III müňýyllyk','The clay female figurine found during the archaeological works in Margush. III millennium B.C.',NULL,NULL,NULL,'public/exhibit-image/AgrSuahIjAR4DCMwimekOyI3NkzcYgZFMIznj2TI.jpg',0,1,'2024-03-15 18:45:17','2024-03-14 16:53:33'),(256,1,62,'Бронзовая ступа','Bürünç soky','Bronze mortar','Бронзовая посуда X-XII вв. Мастера изготавливали казаны и ступки, украшенные орнаментом и надписями.','X-XII asyrlara degişli bürünçden ýasalan gaplar. Ussalar sokylary we gazanlary ýasapdyrlar. Olaryň ýüzüni we erňegini nagyşlar hem-de ýazgylar bilen bezäpdirler.','Bronze ware of X-XII centuries. Masters made the cauldrons and mortars decorated with ornament and inscriptions.',NULL,NULL,NULL,'public/exhibit-image/TtkDpp4s0nAJmrRXDRllLCH90QXXHI9X1zULhZRl.jpg',0,1,'2024-03-14 17:14:03','2024-03-14 17:14:03'),(257,1,64,'Кувшин с выпуклым орнаментом','Güberçek nagyşly küýze','Mug with mushroom pattern','Глиняный кувшин. Мастера изготавливали их разного вида и формы. Поверхность посуды украшена гравированным и лепным орнаментом. III-I века до н.э.','B.e.öňki III-I asyrlara degişli toýundan ýasalan küýze. Ussalar olary dürli görnüşlerde ýasapdyrlar. Ýüzüne ýelmeme we çyzma usulynda dürli nagyşlar bilen bezäpdirler.','Various ceramic vessels of the Middle Ages. Craftsman made them using different methods. The surface of the dishes is decorated with engraved and linen ornaments. III-I  centuries  BC.',NULL,NULL,NULL,'public/exhibit-image/9pMJ6gSLigzdJtD058JqvuvFCuik1p6dl5XSmH9n.jpg',0,1,'2024-03-15 17:11:27','2024-03-15 17:11:27'),(258,1,64,'Посуда с одной ручкой','Bir gulply gap','One lockable container','Сделанная из глины посуда. Мастера  изготавливали их высокими, глубокими и с одной ручкой. В домашнем хозяйстве использовалась в  различных целях. III-I века до н.э.','B.e.öňki III-I asyrlara degişli toýundan ýasalan gap. Ussalar olary dürli görnüşlerde beýik, çuň, bir gulply edip ýasapdyrlar. Öý hojalyklarynda dürli maksatlar üçin ulanylypdyr.','Utensils made of clay. Masters made them tall, deep and with one handle. They were used in the household for various purposes. III-I  centuries  BC.',NULL,NULL,NULL,'public/exhibit-image/imQzmqPbR0V4uud9Ho1lVTjADvyzfQw4CZnZDHO0.jpg',0,1,'2024-03-15 17:13:24','2024-03-15 17:13:24'),(259,1,64,'Кувшин с горлышком','Bokurdakly küýze','A jug with a throat','Гончарные изделия из глины. Мастера  изготавливали их с узорчатой ручкой и тонким горлышком. Эта керамика предназначалась для разливания таких продуктов как масло и жир. III-I века до.н.э.','Toýundan ýasalan küýze önümi. Ussalar olary nagyşly, inçe bokurdakly, bir saply edip ýasapdyrlar. Bu küýze önümi çal, ýag ýaly önümleri guýmak üçin niýetläpdirler. B.e.öňki III-I asyrlara degişli.','Pottery made of clay. Craftsmen made them with a patterned handle with a thin throat. This pottery was intended for pouring products such as oil and grease. III-I  centuries  BC.',NULL,NULL,NULL,'public/exhibit-image/QJzjoTVOy6I6oX12CfTW8QeEoSapq9DRzmrA7t91.jpg',0,1,'2024-03-15 17:15:44','2024-03-15 17:15:44'),(260,1,64,'Посуда для муки','Un gap','A bowl for flour','Глиняная чаша для хранения муки. Мастера изготавливали их в виде высокой, глубокой чаши. Она широко использовалась в домашнем хозяйстве.  III-I века до н.э.','B.e.öňki III-I asyrlara degişli toýundan ýasalan un salynýan gap. Ussalar olary beýik, çuň we galyň görnüşinde ýasapdyrlar. Bu gaby öý hojalyklarynda giňden peýdalanypdyrlar.','Clay bowl for storing flour. The craftsmen made them in the form of a high, deep bowl. It was widely used in the household. III-I centuries BC.',NULL,NULL,NULL,'public/exhibit-image/bXuKfWatS6PPEuMtzOFmIM8EqDf41OwPfNtcgrre.jpg',0,1,'2024-03-15 17:17:41','2024-03-15 17:17:41'),(261,1,64,'Сдвоенный кувшин','Goşa  küýze','Double pot','Сдвоенный, глиняный кувшин. Мастера изготавливали их разного вида и форм.  Этот кувшин был сделан с одной ручкой на дне. III-I века до н.э.','B.e.öňki III-I asyrlara degişli toýundan ýasalan goşa  küýze. Ussalar olary dürli görnüşlerde ýasapdyrlar. Buny ussalar ýasanlarynda aşaky böleginde bir saply bokurdagyny erňekli edip ýasapdyrlar.','A double pot made of clay. Craftsmen made them in many different ways.When they made it, they made it with a single handle on the botton. III-I  centuries BC.',NULL,NULL,NULL,'public/exhibit-image/WQNUuGqiDDFo5VeXWar2j4xjBLUfQ9BnuTCE8lxZ.jpg',0,1,'2024-03-15 17:20:30','2024-03-15 17:20:30'),(262,1,65,'Глазурованная чаша','Syrçaly gap','Glaze jar','Глиняная чаша XI-XIV вв. украшенная разнообразным орнаментом, коричневой и чёрной глазурью.','XI-XIV asyrlara degişli toýundan ýasalan gap. Gara göňür  syrçalar bilen bezelipdir.','The clay bowls. Wedding bowl decorated with dark brown glazes. XI-XIV centuries.',NULL,NULL,NULL,'public/exhibit-image/0dHldSWU0rgDqBgQPVPygVHbgMRi89vd7QdH08h2.jpg',0,1,'2024-03-15 17:34:25','2024-03-15 17:34:25'),(263,1,65,'Глазурованная синей глазурью чаша.','Gök syrça berlen tabak','A plate of blue cheese','Глиняная тарелка XI-XIV вв. украшенная разнообразным орнаментом, коричневой и голубой глазурью. Нижняя часть для устойчивости сделана гладкой.','XI-XIV asyrlara degişli toýundan ýasalan tabak. Gök göňur syrçalar we nagyşlar bilen bezelipdir. Aşaky bölegi ýerde gowy durar ýaly tekiz edilip ýasalypdyr.','Clay plate decorated with blue glazes and patterns. The bottom part is made smooth so that it stays on the ground. XI-XIV centuries.',NULL,NULL,NULL,'public/exhibit-image/oqfYJrm24SfOBAgiNJz85yXIn3SHyD6mnmrz3wgx.jpg',0,1,'2024-03-15 17:36:04','2024-03-15 17:36:04'),(264,1,65,'Глиняная чаша','Toýun tabak','Clay plate','Тарелка сделанная из глины. Для особой красоты, края украшены мастерами чёрным узором. XI-XIV вв.','XI-XIV asyrlara degişli toýundan ýasalan tabak. Gyralaryny ussalar ýörite owadanlyk üçin gara nagyşlar bilen bezäpdirler.','The plate is made of clay. The edges are decorated by craftsmen with black patterns for a special beauty. XI-XIV centuries.',NULL,NULL,NULL,'public/exhibit-image/5s98sdMyAJPVJGPQk7dYPqo4ic0CiYBbOOrgoyLi.jpg',0,1,'2024-03-15 17:38:06','2024-03-15 17:38:06'),(265,1,65,'Домашняя утварь','Öý hojalyk önümi','Household product','Глиняная чаша. Нижняя часть украшена орнаментом. Использовалась в домашнем хозяйстве в различных целях. XI-XIV века.','XI-XIV asyrlara degişli gyzyl toýundan ýasalan gap. Düýp bölegi nagyş bilen bezelen. Öý hojalykda dürli maksatlar üçin ulanylan.','Clay bowl. The bottom part is decorated with a pattern. It was used for various purposes in the household. XI-XIV centuries.',NULL,NULL,NULL,'public/exhibit-image/HvhLJBb2MC0X04CSwE9Rk1MjQeBcJZcAPKinyL4s.jpg',0,1,'2024-03-15 18:20:17','2024-03-15 17:42:39'),(266,1,66,'Глазурованная посуда','Syrçaly gap','Glaze plate','Чаша сделанная из глины. Покрыта чёрной глазурью. Для устойчивости сделана ножка. XI-XIII вeкa','Toýundan ýasalan tabak. Gara syrça bilen örtülen. Ýerde gowy durar ýaly aýakly edip ýasalypdyr. XI-XIII asyrlar.','Covered with black lacquer. They are made with legs so that they stand well on the ground.',NULL,NULL,NULL,'public/exhibit-image/ckRmsPE5vGgRFe16NwvqCQQuT47OflCMJmWO2KQ3.jpg',0,1,'2024-03-15 17:47:48','2024-03-15 17:47:48'),(267,1,66,'Глиняная посуда','Toýun gap','Clay plate','Сделанная из глины и украшенная различными рисунками чаша. XI-XIII века.','Tabak toýundan ýasalyp, dürli görnüşli nagyşlar bilen bezelipdir. XI-XIII asyrlar.','The plate is made of clay and decorated with various patterns. XI-XIII centuries.',NULL,NULL,NULL,'public/exhibit-image/djm7vZDRqJ2p8FzR2n2HMbMvRlQt4I0zlnk0ZrMP.jpg',0,1,'2024-03-15 17:49:08','2024-03-15 17:49:08'),(268,1,66,'Круглая чаша','Tegelek tabak','Rounded plate','Сделанная из красной глины чаша. Украшенная круглыми линиями. XI-XIII века.','Gyzyl toýundan ýasalan tabak. Tegelek görnüşli çyzyklar bilen bezelipdir. XI-XIII asyrlar.','A plate made of red cloth decorated with circular lines. XI-XIII centuries.',NULL,NULL,NULL,'public/exhibit-image/yg8u8ikxVlRmLjxRw9FYKmW9klRDQASe0mXDzgPA.jpg',0,1,'2024-03-15 17:50:50','2024-03-15 17:50:50'),(269,1,66,'Чаша','Agzy ýasy gap','The bowl','Чаше изготовлена из белой глины. Горловина сделана изогнутой и широкой.\r\nXI-XIII века.','Ak toýundan ýasalan gap. Agyz bölegi ýasy  edilip erňekli görnüşinde ýasalypdyr. XI-XIII asyrlar.','The bowl is made of white wool. The mouth part is curved and made in a variety of ways.\r\nXI-XIII centuries.',NULL,NULL,NULL,'public/exhibit-image/5q0M8HqHTbdCwE5ZPNUV57fLpGUZ0Ec6pZeukrLq.jpg',0,1,'2024-03-15 17:53:22','2024-03-15 17:53:22'),(270,1,64,'Kерсен','Kersen','Kersen','Глинянный керсен. Мастера делали их тонкими и просторными. Это изделие использовали для различных целей в домашнем хозяйстве. Он относится к III-I векам до н.э.','Toýundan ýasalan kersen. Ussalar olary ýalpaň, giň göwrümli edip ýasapdyrlar. Öý hojalyklarynda dürli maksatlar üçin ulanypdyrlar. B.e.öňki III-I asyrlara degişli bolup durýar.','Clay kersen. Craftsmen made them thin and spacious. They used it for various purposes in households. It belongs to the III-I centuries BC.',NULL,NULL,NULL,'public/exhibit-image/0aSw71qgXnY7no61SU3MWjfLwJRrH6h5pB982v6Y.jpg',0,1,'2024-03-15 18:09:44','2024-03-15 18:09:44'),(271,1,64,'Узорчатая чаша','Nagyşly gap','Patterned bowl','Керамический горшок. Mастера украсили его различными узорами и сделали горловину красочной и глубокой.  III-I века до н.э.','B.e.öňki III-I asyrlara degişli keramika gap. Ussalar olary dürli görnüşli nagyşlar bilen bezäp, agyz bölegini erňekli we çuň edip  ýasapdyrlar.','Ceramic pot. Craftsmen decorated them with various patterns and made the mouth part colorful and deep. III-I centuries BC.',NULL,NULL,NULL,'public/exhibit-image/cUHSSFRrS5NGDpB596imlaMSHtlPeDSqXxEp0dQQ.jpg',0,1,'2024-03-15 18:11:55','2024-03-15 18:11:55'),(272,1,64,'Ваза','Güldan','Guldan','Глиняная ваза для цветов. Мастера придавали им разные формы, например нижнюю часть делали тонкой, а верхнюю широкой. В древние времена это изделие широко использовали в различных целях. III-I века до.н.э.','Toýundan ýasalan güldan. Ussalar olary ýasanlarynda, dürli şekiller berip, aşakу bölegini inçe agyz bölegini giň edip ýasapdyrlar. Gadymy döwürlerde bu önümi dürli maksatlar üçin giňden peýdalanypdyrlar. B.e.öňki III-I asyrlara degişli.','Guldan made of clay. When the craftsmen saw them, they gave them different shapes and made the bottom part thin and the mouth part wide. In ancient times, this product was widely used for various purposes. III-I centuries BC.',NULL,NULL,NULL,'public/exhibit-image/2rBHEKUty7MI7gj8YaUn91HYDXInL5mKnGjo395L.jpg',0,1,'2024-03-15 18:13:35','2024-03-15 18:13:35'),(273,1,66,'Чаша','Aýakly toýun gap','Clay vase','Сделанная из глины чаша. Для устойчивости сделана ножка. XI-XIII века.','Toýundan ýasalan gap. Ýerde gowy durar ýaly aýakly edip ýasalypdyr. XI-XIII asyrlar.','Made of clay, it is made with legs so that it stands firmly on the ground. XI-XIII centuries.',NULL,NULL,NULL,'public/exhibit-image/SlKErUzUOhXwyjmlwdlieo9aQGiKRmI25zXwBA4L.jpg',0,1,'2024-03-15 18:17:04','2024-03-15 18:17:04'),(274,1,67,'Cлой за слоем','Kätmen','Layer by layer','Слои бронзы найдены в Маргуше. Когда мастера их изготавливали, они делали их в форме четырех углов и вырезали в месте соединения отверстие. III-II тыс. до н.э','Marguşdan bürünçden ýasalan kätmenler.Ussalar olary ýasanlarynda dört bürç görnüşinde we ortaky böleginde oýma deşik goýup ýasapdyrlar. B.e öňki III-II müňýyllyk.','Bronze layers found at Margush.When the craftsmen made  them, they made them in the shape of four cornersand carved a hole in the joint. III-II millennia B.C',NULL,NULL,NULL,'public/exhibit-image/ohbUCw5XzBl3kN5zYEjTloXmJksu1Gbu1SQBPkQA.jpg',0,1,'2024-03-25 14:27:47','2024-03-15 19:21:22'),(275,1,67,'Топоры','Paltalar','Their coats','Бронзовые топоры, найденные в Маргуше. При изготовлении топоров мастера проделывали в средней части круглое отверстие изтачивали оба края. III-II тыс. до н.э','Marguşdan tapylan bürünçden ýasalan paltalar.Ussalar olary ýasanda ortaky böleginde tegelek deşik goýup iki gyrasy ýiti görnüşinde edip ýasapdyrlar. B.e öňki III-II müňýyllyk.','Bronze aхes in Margush.When making aхes,craftsmen made a round hole in the middle part and sharpened. III-II millennia B.C',NULL,NULL,NULL,'public/exhibit-image/yXZ5Mz8z1x2INLwevih8VUIZBiQ059AOGhLzLnZK.jpg',0,1,'2024-03-25 14:27:10','2024-03-15 19:23:04'),(276,1,67,'Землеройные инструменты','Ýer gazgyçlar','Earthworms','Найденные в Маргуше земледельческие инструменты сделанные из бронзы. Использовались в домашнем быту для обрабатывания земли. III-II тыс. до н.э','Marguşdan tapylan zähmet gurallary bürünçden ýasalan. Öý hojalygynda  ýerlerini  bejermekde  giňden peýdalanylypdyr. B.e öňki III-II müňýyllyk.','Agricultural tools made of bronze found in Margush were used at home for cultivating. III-II millennia B.C',NULL,NULL,NULL,'public/exhibit-image/b4pPtM8GHi2RyOht8pZOjRzFDpbRj6xtZy99kk0y.jpg',0,1,'2024-03-25 14:25:41','2024-03-15 19:25:21'),(277,1,59,'Сосуды для ртути','Simap gaplary','Vessels for mercury','Керамические сосуды для ртути X-XII вв. Ртуть использовалась мастерами при ювелирных работах, а так же в других бытовых целях.','X-XII asyrlara degişli toýundan ýasalan simap gaplary. Ussalar simaby zergärçilik işlerinde we başga-da durmuş hajatlary üçin ulanypdyrlar.','Ceramic vessels for mercury of the X-XII centuries. Mercury was used by masters during the jewelry works, and also in other household purposes.',NULL,'public/exhibit-tm-audio/M4Orwt0doI5WwJ2vb8VkKLDF10v4VqtrcP6TKw4Z.jpg',NULL,'public/exhibit-image/WjYbUuagi1lREc8RNEiIRwBcCot59fgbzJYpG7n4.jpg',0,1,'2024-03-25 14:44:14','2024-03-25 14:44:14');
